:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"Questionnaires/sondages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2577\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:378:\"Chaque année, les membres de la communauté WordPress sont invités à donner leurs retours sur WordPress. Chaque personne gravitant autour de notre CMS est concernée, qu’elle en soit simple utilisatrice, ou qu’elle participe à la conception ou à la production de sites, d’extensions, de thèmes, ou même au développement de WordPress ou de sa communauté. [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4755:\"\n<p>Chaque année, les membres de la communauté WordPress sont invités à donner leurs retours sur WordPress. Chaque personne gravitant autour de notre CMS est concernée, qu’elle en soit simple utilisatrice, ou qu’elle participe à la conception ou à la production de sites, d’extensions, de thèmes, ou même au développement de WordPress ou de sa communauté.</p>\n\n\n\n<p>Les retours obtenus par ce questionnaire sont utilisés pour la conférence annuelle du co-fondateur de WordPress, le <a href=\"https://wordpress.org/news/2022/11/state-of-the-word-2022/\"><em lang=\"en\">State of the Word</em></a> et auront une influence sur la direction stratégique du projet dans les années à venir.</p>\n\n\n\n<p>Pour le dire plus simplement, ce questionnaire aide les personnes qui construisent WordPress à en savoir plus sur la façon dont ce logiciel est utilisé.</p>\n\n\n\n<div class=\"wp-block-buttons is-content-justification-center is-layout-flex wp-container-1\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"https://wordpressdotorg.survey.fm/fr-2022\">Je participe au questionnaire annuel&nbsp;!</a></div>\n</div>\n\n\n\n<p>Cette année encore, le questionnaire est disponible en plusieurs langues – dont le français – grâce à l’aide des différentes équipes de traduction du CMS, merci à elles !</p>\n\n\n\n<p>Ce questionnaire sera accessible jusqu’à la fin de l’année 2022, et la publication des résultats est prévue courant 2023. Cette année, les questions ont été revues afin de faciliter le déroulement, la réalisation et l’analyse de l&rsquo;enquête. Certaines questions ont été supprimées, tandis que quelques nouvelles sont désormais présentes, reflétant le présent et l’avenir de WordPress. Si vous cherchez l’analyse des résultats de l’enquête de 2021, elle sera également partagée début 2023.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Faites passer le message</h2>\n\n\n\n<p>Aidez à faire connaître le questionnaire en le partageant avec votre réseau, via Slack, ou sur vos comptes de réseaux sociaux. Plus il y aura de personnes qui répondront au questionnaire et partageront leur expérience avec WordPress, plus l’ensemble du projet en bénéficiera.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Sécurité et confidentialité</h2>\n\n\n\n<p>La sécurité et la confidentialité des données sont primordiales pour le projet et la communauté WordPress. Dans cet esprit, toutes les données personnelles sont rendues anonymes : aucune adresse e-mail ou adresse IP ne sera associée aux résultats publiés. Pour en savoir plus sur les pratiques de WordPress.org en matière de confidentialité, consultez la <a href=\"https://fr.wordpress.org/about/privacy/\">politique de confidentialité</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Merci</h2>\n\n\n\n<p>Nous remercions les contributeurs et contributrices WordPress suivants pour leur aide à la mise en œuvre de ce questionnaire annuel, comprenant la création des questions, la réflexion stratégique, l’élaboration de l’enquête et sa traduction :</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/dansoschin/\">dansoschin</a>, <a href=\"https://profiles.wordpress.org/_dorsvenabili/\">_dorsvenabili</a>, <a href=\"https://profiles.wordpress.org/angelasjin/\">angelasjin</a>, <a href=\"https://profiles.wordpress.org/arkangel/\">arkangel</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">audrasjb</a>, <a href=\"https://profiles.wordpress.org/atachibana/\">atachibana</a>, <a href=\"https://profiles.wordpress.org/bjmcsherry/\">bjmcsherry</a>, <a href=\"https://profiles.wordpress.org/chanthaboune/\">chanthaboune</a>, <a href=\"https://profiles.wordpress.org/eidolonnight/\">eidolonnight</a>, <a href=\"https://profiles.wordpress.org/fernandot/\">fernandot</a>, <a href=\"https://profiles.wordpress.org/fierevere/\">fierevere</a>, <a href=\"https://profiles.wordpress.org/fxbenard/\">fxbenard</a>, <a href=\"https://profiles.wordpress.org/jdy68/\">jdy68</a>, <a href=\"https://profiles.wordpress.org/jpantani/\">jpantani</a>, <a href=\"https://profiles.wordpress.org/laurlittle/\">laurlittle</a>, <a href=\"https://profiles.wordpress.org/nao/\">nao</a>, <a href=\"https://profiles.wordpress.org/nielslange/\">nielslange</a>, <a href=\"https://profiles.wordpress.org/peiraisotta/\">peiraisotta</a>, <a href=\"https://profiles.wordpress.org/piermario/\">piermario</a>, <a href=\"https://profiles.wordpress.org/rmartinezduque/\">rmartinezduque</a>, <a href=\"https://profiles.wordpress.org/santanainniss/\">santanainniss</a>.</p>\n\n\n\n<p class=\"has-text-align-right\"><small><em>Traduction du communiqué par <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a> et <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>.</em></small></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://fr.wordpress.org/2022/12/05/questionnaire-annuel-sur-votre-experience-dutilisation-de-wordpress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"WordPress 6.1 « Misha »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://fr.wordpress.org/2022/11/02/wordpress-6-1-misha/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://fr.wordpress.org/2022/11/02/wordpress-6-1-misha/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 02 Nov 2022 03:12:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2551\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:418:\"La troisième version majeure de WordPress pour l&#8217;année 2022 est disponible. Elle a été baptisée «&#160;Misha&#160;» en l&#8217;honneur du pianiste de jazz Michail Jefimowitsch Alperin. Nous vous invitons à effectuer cette mise à jour afin de bénéficier des améliorations de stabilité, de performances, et d&#8217;utilisabilité que propose cette nouvelle version majeure. Quoi de neuf dans [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:80215:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2022/11/misha.png\"><img decoding=\"async\" width=\"1024\" height=\"679\" src=\"https://fr.wordpress.org/files/2022/11/misha-1024x679.png\" alt=\"\" class=\"wp-image-2554\" srcset=\"https://fr.wordpress.org/files/2022/11/misha-1024x679.png 1024w, https://fr.wordpress.org/files/2022/11/misha-300x199.png 300w, https://fr.wordpress.org/files/2022/11/misha-768x509.png 768w, https://fr.wordpress.org/files/2022/11/misha-1536x1019.png 1536w, https://fr.wordpress.org/files/2022/11/misha.png 1996w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p><span style=\"font-weight: 400\">La troisième version majeure de WordPress pour l&rsquo;année 2022 est disponible.</span> Elle a été baptisée «&nbsp;Misha&nbsp;» en l&rsquo;honneur du pianiste de jazz Michail Jefimowitsch Alperin.</p>\n\n\n\n<p>Nous vous invitons à effectuer cette mise à jour afin de bénéficier des améliorations de stabilité, de performances, et d&rsquo;utilisabilité que propose cette nouvelle version majeure.</p>\n\n\n\n<span id=\"more-2551\"></span>\n\n\n\n<h2 class=\"wp-block-heading\">Quoi de neuf dans WordPress&nbsp;6.1&nbsp;?</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Twenty Twenty-Three&nbsp;: un nouveau thème natif proposant 10 variations de styles distinctes</h3>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/11/Style-Variation-News-1024x601.png\" alt=\"\" class=\"wp-image-13816\" /></figure>\n\n\n\n<p>S’appuyant sur les principes fondamentaux des versions 5.9 et 6.0 pour les thèmes de blocs et les variations de style, le nouveau thème par défaut, nommé <em>Twenty Twenty-Three</em>, comprend&nbsp;<a href=\"https://make.wordpress.org/design/2022/09/07/tt3-default-theme-announcing-style-variation-selections/\">10 variations de styles différentes</a>&nbsp;et est&nbsp;<a href=\"https://make.wordpress.org/themes/handbook/review/accessibility/\">accessible</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Une meilleure expérience de création avec de nouveaux modèles entièrement revus</h3>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/11/Templates-News-1024x601.png\" alt=\"\" class=\"wp-image-13818\" /></figure>\n\n\n\n<p>Les&nbsp;<a href=\"https://make.wordpress.org/core/2022/07/21/core-editor-improvement-deeper-customization-with-more-template-options/\">nouveaux modèles (note de développement, en anglais)</a>&nbsp;comprennent un modèle personnalisé pour les publications dans l’éditeur de site. Les outils de recherche/remplacement accélèrent la conception des&nbsp;<a href=\"https://make.wordpress.org/core/2022/08/25/core-editor-improvement-refining-the-template-creation-experience/\">éléments de modèles (en anglais)</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Plus de cohérence et de contrôle sur les outils de conception</h3>\n\n\n\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped wp-block-gallery-2 is-layout-flex\">\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" data-id=\"13819\"  src=\"https://wordpress.org/news/files/2022/11/Design-Tools-News-1024x601.png\" alt=\"\" class=\"wp-image-13819\" /></figure>\n</figure>\n\n\n\n<p>L’amélioration des&nbsp;commandes pour les éléments de conception et les blocs&nbsp;rendent le processus de mise en page et de création de site plus cohérent, complet et intuitif.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Les menus peuvent être créés et modifiés plus facilement</h3>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/11/Navigation-1024x601.png\" alt=\"\" class=\"wp-image-13821\" /></figure>\n\n\n\n<p>Les&nbsp;<a href=\"https://make.wordpress.org/core/2022/09/27/navigation-block-fallback-behavior-in-wp-6-1-dev-note/\">nouvelles options de récupération du bloc Navigation (en anglais)</a>&nbsp;vous permettent de modifier le menu que vous avez ouvert sans avoir besoin d’effectuer de recherche. De plus, les commandes pour choisir et travailler sur les menus sont dorénavant placées dans les réglages du bloc. Le système de menu mobile bénéficie également d’une mise à jour avec de nouvelles fonctionnalités comprenant plusieurs options d’icônes pour personnaliser le menu.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Amélioration de la mise en page et de la visualisation des réglages des publications</h3>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/11/Document-settings-News-1024x601.png\" alt=\"\" class=\"wp-image-13825\" /></figure>\n\n\n\n<p>Un affichage plus propre et mieux organisé vous permet de visualiser et de gérer facilement les réglages importants des publications, en particulier au niveau du sélecteur de modèles et de l’outil de planification.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Réglage de verrouillage en un clic pour tous les blocs internes</h3>\n\n\n\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped wp-block-gallery-4 is-layout-flex\">\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" data-id=\"13824\"  src=\"https://wordpress.org/news/files/2022/11/Lock-News-1024x601.png\" alt=\"\" class=\"wp-image-13824\" /></figure>\n</figure>\n\n\n\n<p>Lorsque vous verrouillez des blocs, une nouvelle option vous permet d’appliquer vos réglages de verrouillage à tous les blocs d’un bloc conteneur tel que le bloc Groupe, Couverture ou encore Colonnes.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Amélioration des textes indicatifs des blocs</h3>\n\n\n\n<p>Les textes indicatifs de plusieurs blocs ont été améliorés, afin de mieux refléter les options de personnalisation qui vous permettent de concevoir votre site et son contenu. Par exemple, le texte d’aide du bloc Image affiche les réglages personnalisés des bordures et des filtres duotones avant même de sélectionner l’image à afficher.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Composez des listes et des citations enrichies en y plaçant des blocs internes</h3>\n\n\n\n<p>Les blocs Liste et Citation prennent désormais en charge les blocs internes, ce qui permet des compositions plus flexibles et plus riches, par exemple en vous permettant d’ajouter des titres à l’intérieur de vos blocs de citations.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Du texte plus <em>responsive</em> avec une typographie fluide</h3>\n\n\n\n<p>La <a href=\"https://make.wordpress.org/core/2022/08/04/whats-new-in-gutenberg-13-8-3-august/#fluid-typography-support\"></a><a href=\"https://make.wordpress.org/core/2022/10/03/fluid-font-sizes-in-wordpress-6-1/\">typographie fluide (en anglais)</a>&nbsp;vous permet de définir des tailles de police qui s’adaptent pour faciliter la lecture sur n’importe quelle taille d’écran.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Ajoutez des suggestions de compositions pour vos types de publications</h3>\n\n\n\n<p>Dans WordPress 6.0, lorsque vous ajoutiez une nouvelle page, vous pouviez voir des suggestions de compositions afin d’éviter de partir d’une page vide. Avec WordPress 6.1 vous verrez cette fenêtre modale lors de la création de n’importe quel type de publication.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Facilitation de la recherche de thèmes basés sur des blocs</h3>\n\n\n\n<p>Le répertoire des thèmes contient&nbsp;<a href=\"https://fr.wordpress.org/themes/tags/full-site-editing/\">un filtre pour les thèmes basés sur des blocs</a>, et l’aperçu des compositions donne une meilleure idée de ce à quoi le thème pourrait ressembler lorsque vous explorez les thèmes et les compositions.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Conservez les réglages de l’éditeur de site pour plus tard</h3>\n\n\n\n<p>Les réglages de l’éditeur de site sont désormais&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/10/changes-to-block-editor-preferences-in-wordpress-6-1/\">persistants pour chaque compte</a>. Cela signifie que vos réglages seront désormais cohérents sur tous les navigateurs et appareils.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Un système de gestion des styles simplifié</h3>\n\n\n\n<p>Les règles CSS pour les marges internes et externes, la typographie, les couleurs et les bordures du&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/10/block-styles-generation-style-engine/\">moteur de styles</a>&nbsp;sont désormais regroupées au même endroit, ce qui diminue le temps consacré aux tâches de mise en page et aide à générer des noms de classes sémantiques.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Amélioration de l’accessibilité de l’administration et de l’éditeur</h3>\n\n\n\n<p>Plus de 40 améliorations de l’accessibilité ont été réalisées, comprenant la résolution des problèmes de perte de focus dans l’éditeur, l’amélioration des libellés de formulaires et de la restitution vocale des messages, l’amélioration de l’interface de modifications des textes alternatifs, la correction du débordement du menu d’administration sur les petits écrans ou en zoom navigateur. En savoir plus sur les&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/11/wordpress-6-1-accessibility-improvements/\">améliorations d’accessibilité apportées par WP 6.1</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Autres changements importants</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Éléments de modèles de blocs dans les thèmes classiques</h3>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2022/10/04/block-based-template-parts-in-traditional-themes/\"></a>Les éléments de modèles de blocs peuvent désormais être <a href=\"https://make.wordpress.org/core/2022/10/04/block-based-template-parts-in-traditional-themes/\">définis dans les thèmes classiques (en anglais)</a>&nbsp;en ajoutant les fichiers HTML appropriés au répertoire&nbsp;<code>parts</code>&nbsp;à la racine du thème.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Évolution des blocs de boucle de requête</h3>\n\n\n\n<p>Les&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/10/extending-the-query-loop-block/\">nouveaux filtres</a>&nbsp;permettent aux variantes du bloc de requête de prendre en charge des requêtes personnalisées afin de créer des variantes plus spécifiques et des options avancées de filtrage des types de publication hiérarchiques.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Des filtres pour tous vos styles</h3>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2022/10/10/filters-for-theme-json-data/\"><a href=\"https://make.wordpress.org/core/2022/10/10/filters-for-theme-json-data/\">Exploitez les filtres</a> dans la barre latérale « Styles » pour contrôler les réglages sur quatre niveaux de votre site, du moins spécifique au plus spécifique : principal, thème, compte, bloc.</a></p>\n\n\n\n<h3 class=\"wp-block-heading\">Préréglages d’espacement pour une conception plus rapide et cohérente</h3>\n\n\n\n<p>Gagnez du temps et évitez de coder en dur des déclarations dans un thème grâce aux&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/07/introduction-of-presets-across-padding-margin-and-block-gap/\">valeurs de marge internes et externes prédéfinies pour de multiples blocs</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Modification limitée au contenu sur les blocs conteneurs</h3>\n\n\n\n<p>Grâce au&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/11/content-locking-features-and-updates/\">réglage de modification limitée au contenu</a>, les mises en page peuvent être verrouillées au sein des blocs conteneurs. Dans un bloc de contenu seul, ses blocs enfants sont invisibles dans la vue en liste et ne sont pas modifiables. Vous contrôlez donc la mise en page tandis que vos rédactrices et rédacteurs peuvent se concentrer sur le contenu.</p>\n\n\n\n<p>Combinez-la avec les options de verrouillage des blocs pour un contrôle encore plus poussé de vos blocs.</p>\n\n\n\n<h3 class=\"wp-block-heading\">De meilleures performances</h3>\n\n\n\n<p>WordPress 6.1 résout 25 tickets dédiés à l’amélioration des performances. De&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/10/performance-improvements-to-the-rest-api/\">l’API REST</a>&nbsp;au&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/10/multisite-improvements-in-wordpress-6-1/\">multisite</a>, en passant par&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/07/improvements-to-wp_query-performance-in-6-1/\"><code>WP_Query</code></a>&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/07/improved-php-performance-for-core-blocks-registration/\">l’enregistrement des blocs du cœur WordPress</a>&nbsp;et par de&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/06/new-cache-site-health-checks-in-wordpress-6-1/\">nouvelles vérifications sur l’outil Santé du site</a>, ou par l’ajout des attributs&nbsp;<code>async</code>&nbsp;aux images, il y a des améliorations bénéfiques pour tous les types de sites. Un récapitulatif complet est disponible dans le&nbsp;<a href=\"https://make.wordpress.org/core/2022/10/11/performance-field-guide-for-wordpress-6-1/\">guide dédié aux performance de WP&nbsp;6.1</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Guide des changements techniques de WordPress 6.1</h2>\n\n\n\n<p>WordPress 6.1 comprend encore bien plus de nouvelles fonctionnalités et d’améliorations. Pour en savoir plus, et notamment si vous développez des sites WordPress, <a href=\"https://fr.wordpress.org/2022/10/12/guide-des-changements-techniques-de-wordpress-6-1/\" data-type=\"post\" data-id=\"2509\">consultez le guide des changements techniques de cette version</a>.</p>\n\n\n\n<h1 class=\"wp-block-heading\">Plus d’informations sur WordPress 6.1</h1>\n\n\n\n<p>Découvrez WordPress 6.1 en fonctionnement&nbsp;! Notre&nbsp;<a href=\"https://youtu.be/1w9oywSa6Hw\">vidéo de présentation</a>&nbsp;propose une vue d’ensemble des principales fonctionnalités qui sont sorties avec WordPress 6.1.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\n<iframe loading=\"lazy\" class=\"youtube-player\" width=\"612\" height=\"345\" src=\"https://www.youtube.com/embed/1w9oywSa6Hw?version=3&#038;rel=1&#038;showsearch=0&#038;showinfo=1&#038;iv_load_policy=1&#038;fs=1&#038;hl=fr-FR&#038;autohide=2&#038;wmode=transparent\" allowfullscreen=\"true\" style=\"border:0;\" sandbox=\"allow-scripts allow-same-origin allow-popups allow-presentation\"></iframe>\n</div></figure>\n\n\n\n<p><br></p>\n\n\n\n<p>Visitez&nbsp;<a href=\"https://learn.wordpress.org/\">learn.wordpress.org</a>&nbsp;pour des tutoriels vidéos, des ateliers en ligne, des cours et des plans de cours pour les personnes organisant des évènements, et pour des contenus présentant les nouvelles fonctionnalités de WordPress.</p>\n\n\n\n<p>Consultez notre&nbsp;<a href=\"https://fr.wordpress.org/2022/10/12/guide-des-changements-techniques-de-wordpress-6-1/\">guide des changements techniques introduits par WordPress 6.0</a>. Il contient toutes les notes techniques que vous devez connaître si vous développez sur WordPress.</p>\n\n\n\n<h2 class=\"wp-block-heading\">L’équipe de direction de WordPress&nbsp;6.1</h2>\n\n\n\n<p><span style=\"font-weight: 400\">Les personnes mentionnées ci-dessous ont participé à la direction de cette version majeure du CMS&nbsp;:</span></p>\n\n\n\n<ul>\n<li><span style=\"font-weight: 400\">Direction générale&nbsp;: </span><a href=\"https://profiles.wordpress.org/matt/\"><span style=\"font-weight: 400\">Matt Mullenweg</span></a><span style=\"font-weight: 400\">&nbsp;</span></li>\n\n\n\n<li><span style=\"font-weight: 400\">Coordinateurs de cette version&nbsp;: </span><a href=\"https://profiles.wordpress.org/priethor/\"><span style=\"font-weight: 400\">Héctor Prieto</span></a><span style=\"font-weight: 400\"> et </span><a href=\"https://profiles.wordpress.org/desrosj/\"><span style=\"font-weight: 400\">Jonathan Desrosiers</span></a><span style=\"font-weight: 400\">&nbsp;</span></li>\n\n\n\n<li><span style=\"font-weight: 400\">Direction technique côté Core&nbsp;: </span><a href=\"https://profiles.wordpress.org/mikeschroder/\"><span style=\"font-weight: 400\">Mike Schroder</span></a><span style=\"font-weight: 400\">, </span><a href=\"https://profiles.wordpress.org/davidbaumwald/\"><span style=\"font-weight: 400\">David Baumwald</span></a><span style=\"font-weight: 400\">, et </span><a href=\"https://profiles.wordpress.org/jeffpaul/\"><span style=\"font-weight: 400\">Jeff Paul</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\"><span style=\"font-weight: 400\">Direction</span> technique côté Gutenberg&nbsp;: </span><a href=\"https://profiles.wordpress.org/czapla/\"><span style=\"font-weight: 400\">Michal Czaplinski</span></a><span style=\"font-weight: 400\">, </span><a href=\"https://profiles.wordpress.org/bernhard-reiter/\"><span style=\"font-weight: 400\">Bernie Reiter</span></a><span style=\"font-weight: 400\">, et </span><a href=\"https://profiles.wordpress.org/cbravobernal/\"><span style=\"font-weight: 400\">Carlos Bravo</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\">Gestion de projet côté cœur&nbsp;: </span><a href=\"https://profiles.wordpress.org/audrasjb/\"><span style=\"font-weight: 400\">JB Audras</span></a><span style=\"font-weight: 400\"> et </span><a href=\"https://profiles.wordpress.org/chaion07/\"><span style=\"font-weight: 400\">Ahmed Chaion</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\"><span style=\"font-weight: 400\">Gestion de projet côté</span></span> Gutenberg&nbsp;<span style=\"font-weight: 400\">: </span><a href=\"https://profiles.wordpress.org/ndiego/\"><span style=\"font-weight: 400\">Nick Diego</span></a> <span style=\"font-weight: 400\">et </span><a href=\"https://profiles.wordpress.org/annezazu/\"><span style=\"font-weight: 400\">Anne McCarthy</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\">Documentation&nbsp;: </span><a href=\"https://profiles.wordpress.org/bph/\"><span style=\"font-weight: 400\">Birgit Pauli-Haack</span></a><span style=\"font-weight: 400\">, </span><a href=\"https://profiles.wordpress.org/milana_cap/\"><span style=\"font-weight: 400\">Milana Cap</span></a><span style=\"font-weight: 400\">, et </span><a href=\"https://profiles.wordpress.org/femkreations/\"><span style=\"font-weight: 400\">Femy Praseeth</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\">Communication&nbsp;:</span> <a href=\"https://profiles.wordpress.org/jpantani/\"><span style=\"font-weight: 400\">Jonathan Pantani</span></a> <span style=\"font-weight: 400\">et </span><a href=\"https://profiles.wordpress.org/dansoschin/\"><span style=\"font-weight: 400\">Dan Soschin</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\">Tests&nbsp;: </span><a href=\"https://profiles.wordpress.org/ironprogrammer/\"><span style=\"font-weight: 400\">Brian Alexander</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\">Design : </span><a href=\"https://profiles.wordpress.org/richtabor/\"><span style=\"font-weight: 400\">Rich Tabor</span></a></li>\n\n\n\n<li><span style=\"font-weight: 400\">Design et développement du nouveau thème natif&nbsp;: </span><a href=\"https://profiles.wordpress.org/beafialho/\"><span style=\"font-weight: 400\">Beatriz Fialho</span></a><span style=\"font-weight: 400\"> et </span><a href=\"https://profiles.wordpress.org/mikachan/\"><span style=\"font-weight: 400\">Sarah Norris</span></a></li>\n</ul>\n\n\n\n<p>Il n&rsquo;aurait pas été possible de sortir WordPress 6.1 sans le travail acharné de plus de 800 personnes situées dans au moins 60 pays différents. Merci à toutes celles et ceux qui ont travaillé sur cette nouvelle version de WordPress&nbsp;!</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/1naveengiri/\">1naveengiri</a> · <a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a> · <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a> · <a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">Aaron Robertshaw</a> · <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a> · <a href=\"https://profiles.wordpress.org/hurayraiit/\">Abu Hurayra</a> · <a href=\"https://profiles.wordpress.org/bosconiandynamics/\">Adam Bosco</a> · <a href=\"https://profiles.wordpress.org/adampickering/\">Adam Pickering</a> · <a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a> · <a href=\"https://profiles.wordpress.org/admwgn/\">Adam Wiltgen</a> · <a href=\"https://profiles.wordpress.org/zieladam/\">Adam Zielinski</a> · <a href=\"https://profiles.wordpress.org/addiestavlo/\">Addie</a> · <a href=\"https://profiles.wordpress.org/oztaser/\">Adil Öztaşer</a> · <a href=\"https://profiles.wordpress.org/aduth/\">aduth</a> · <a href=\"https://profiles.wordpress.org/aezazshek