">Virginie Garnier</a> · <a href=\"https://profiles.wordpress.org/vishalkakadiya/\">Vishal Kakadiya</a> · <a href=\"https://profiles.wordpress.org/vortfu/\">vortfu</a> · <a href=\"https://profiles.wordpress.org/webbeetle/\">webbeetle</a> · <a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a> · <a href=\"https://profiles.wordpress.org/whaze/\">whaze</a> · <a href=\"https://profiles.wordpress.org/whissi/\">Whissi</a> · <a href=\"https://profiles.wordpress.org/earnjam/\">William Earnhardt</a> · <a href=\"https://profiles.wordpress.org/williampatton/\">williampatton</a> · <a href=\"https://profiles.wordpress.org/withinboredom/\">withinboredom</a> · <a href=\"https://profiles.wordpress.org/woji29911/\">woji29911</a> · <a href=\"https://profiles.wordpress.org/yahil/\">Yahil Madakiya</a> · <a href=\"https://profiles.wordpress.org/yannielsen/\">Yan Knudtskov</a> · <a href=\"https://profiles.wordpress.org/collet/\">Yann</a> · <a href=\"https://profiles.wordpress.org/yoavf/\">Yoav Farhi</a> · <a href=\"https://profiles.wordpress.org/byohann6/\">Yohann Billard</a> · <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a> · <a href=\"https://profiles.wordpress.org/omaeyusuke/\">yuu</a> · <a href=\"https://profiles.wordpress.org/zaerl/\">zaerl</a> · <a href=\"https://profiles.wordpress.org/zebulan/\">Zebulan Stanphill</a> · <a href=\"https://profiles.wordpress.org/zenaulislam/\">Zenaul Islam</a> · <a href=\"https://profiles.wordpress.org/ziposc/\">ziposc</a> · <a href=\"https://profiles.wordpress.org/chesio/\">Česlav Przywara</a> · <a href=\"https://profiles.wordpress.org/shenyanzhi/\">沈唁</a></p>\n\n\n\n<p>Merci également à toutes celles et ceux qui ont traduit cette version en français&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/bonaldi\">Bonaldi</a>,&nbsp;<a href=\"https://profiles.wordpress.org/btpub\">Bruno Tritsch</a>,&nbsp;<a href=\"https://profiles.wordpress.org/chouby\">Chouby</a>,&nbsp;<a href=\"https://profiles.wordpress.org/wolforg\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/eddystile\">Eddy</a>,&nbsp;<a href=\"https://profiles.wordpress.org/emlebrun\">Emilie LEBRUN</a>, <a href=\"https://profiles.wordpress.org/fxbenard\">FX&nbsp;Bénard</a>,&nbsp;<a href=\"https://profiles.wordpress.org/florianv\">florianv</a>,&nbsp;<a href=\"https://profiles.wordpress.org/fred5550\">Frederic Nuyts</a>,&nbsp;<a href=\"https://profiles.wordpress.org/ggwptranslate\">Gilbert GAYRAUD</a>,&nbsp;<a href=\"https://profiles.wordpress.org/guillaumeturpin\">Guillaume TURPIN</a>,&nbsp;<a href=\"https://profiles.wordpress.org/ioanamuresan\">Ioana M.</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jaz_on\">Jason Rouet</a>, <a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>,&nbsp;<a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/loulou51\">Loulou51</a>, <a href=\"https://profiles.wordpress.org/lulucmy\">lulucmy</a>, <a href=\"https://profiles.wordpress.org/maecatnou\">maecatnou</a>,&nbsp;<a href=\"https://profiles.wordpress.org/oellin\">Magali</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nuryko\">Marianna</a>, <a href=\"https://profiles.wordpress.org/chaton666\">Marie Comet</a>, <a href=\"https://profiles.wordpress.org/marineevain\">Marine EVAIN</a>,&nbsp;<a href=\"https://profiles.wordpress.org/maxpertici\">Maxime Pertici</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nandow\">nandow</a>,&nbsp;<a href=\"https://profiles.wordpress.org/pasglop\">pasglop</a>,&nbsp;<a href=\"https://profiles.wordpress.org/larrach\">Rachel Peter</a>,&nbsp;<a href=\"https://profiles.wordpress.org/sebastienserre\">Sébastien SERRE</a>,&nbsp;<a href=\"https://profiles.wordpress.org/solaack\">solaack</a>,&nbsp;<a href=\"https://profiles.wordpress.org/stephanepoisson\">Stéphane POISSON</a>,&nbsp;<a href=\"https://profiles.wordpress.org/spaceshipone\">Timothée Brosille</a>,&nbsp;<a href=\"https://profiles.wordpress.org/translationsbyautomattic\">Translations by Automattic</a>,&nbsp;<a href=\"https://profiles.wordpress.org/virgar\">Virginie Garnier</a>,&nbsp;<a href=\"https://profiles.wordpress.org/virginienacci\">virginienacci</a>, <a href=\"https://profiles.wordpress.org/whaze\">whaze</a>,&nbsp;<a href=\"https://profiles.wordpress.org/whodunitagency\">Whodunit</a>,&nbsp;<a href=\"https://profiles.wordpress.org/wptranslationsorg\">WP-Translations</a>, et&nbsp;<a href=\"https://profiles.wordpress.org/wplmillet\">wplmillet</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://fr.wordpress.org/2022/11/02/wordpress-6-1-misha/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:77:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Guide des changements techniques de WordPress 6.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://fr.wordpress.org/2022/10/12/guide-des-changements-techniques-de-wordpress-6-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://fr.wordpress.org/2022/10/12/guide-des-changements-techniques-de-wordpress-6-1/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 12 Oct 2022 16:20:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:5:\"Guide\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2509\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"Tour d\'horizon des changements techniques apportés par WordPress 6.1, la prochaine version majeure du CMS.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:66:\"https://make.wordpress.org/design/files/2022/09/tt3_variations.mp4\";s:6:\"length\";s:6:\"996018\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:45796:\"\n<p>La version&nbsp;<em>Release Candidate</em>&nbsp;de&nbsp;<strong>WordPress&nbsp;6.1</strong>&nbsp;est sortie mardi 11 octobre. Il est donc temps de parcourir les différents changements techniques qu’apportera cette prochaine version majeure de notre CMS.</p>\n\n\n\n<p><strong>La sortie finale de cette nouvelle version est planifiée pour le 1<sup>er</sup>&nbsp;novembre 2022.</strong></p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" loading=\"lazy\" width=\"2328\" height=\"1158\" src=\"https://fr.wordpress.org/files/2022/10/wp61-guide.png\" alt=\"WordPress 6.1 : Guide des changements techniques\" class=\"wp-image-2472\" srcset=\"https://fr.wordpress.org/files/2022/10/wp61-guide.png 2328w, https://fr.wordpress.org/files/2022/10/wp61-guide-300x149.png 300w, https://fr.wordpress.org/files/2022/10/wp61-guide-1024x509.png 1024w, https://fr.wordpress.org/files/2022/10/wp61-guide-768x382.png 768w, https://fr.wordpress.org/files/2022/10/wp61-guide-1536x764.png 1536w, https://fr.wordpress.org/files/2022/10/wp61-guide-2048x1019.png 2048w\" sizes=\"(max-width: 2328px) 100vw, 2328px\" /></figure>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/6-1/\">L’équipe de direction de WP 6.1</a>&nbsp;et plusieurs centaines de contributeurs et contributrices ont travaillé sur plus de&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=6.1&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">120 améliorations et nouvelles fonctionnalités</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=6.1&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">241 correctifs</a>&nbsp;et&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=6.1&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">42 autres tâches variées</a>, ce qui représente plus de&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=6.1&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">400 tickets sur Trac</a>.</p>\n\n\n\n<p>À cela, il faut ajouter plus de&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56467\">50 pull requests</a>&nbsp;ayant permis de fusionner les différentes versions de Gutenberg dans le cœur du CMS. Du côté du projet Gutenberg il y a eu en tout 1684 pull requests apportant 425 nouvelles fonctionnalités et améliorations et 428&nbsp;correctifs de bugs, le reste concernant des tâches courantes de revue de qualité du code, de documentation ou d&rsquo;amélioration des outils de déploiement.</p>\n\n\n\n<p class=\"is-style-serif has-text-color\" style=\"color:#d95e43;font-size:18px\">En route pour un petit tour d’horizon des<br>nouveautés techniques de WordPress&nbsp;6.1&nbsp;<img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f680.png\" alt=\"🚀\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<span id=\"more-2509\"></span>\n\n\n\n<p>Tous les liens de cet article pointent vers des notes de développement rédigées en anglais.</p>\n\n\n\n<p>L’objectif est de fournir un panorama général des changements techniques apportés par cette version, en français, puis de diriger les personnes qui souhaitent en savoir plus vers les notes de développement en anglais.</p>\n\n\n\n<p class=\"has-text-color has-background\" style=\"color:#ac270c;background-color:#f4e3da\">À noter&nbsp;: certaines modifications listées ici vont nécessiter des actions de la part des auteurs et autrices de thèmes et d’extensions, qui devront adapter ou modifier leur code. Si vous êtes concerné·e, veuillez lire les notes de développement listées dans cet article consciencieusement afin de vous assurer que votre code fonctionnera avec WordPress&nbsp;6.1 lorsque cette version sortira le 1<sup>er</sup>&nbsp;novembre 2022.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Performances</h2>\n\n\n\n<p>Avec&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~performance&amp;milestone=6.1&amp;group=component&amp;col=id&amp;col=summary&amp;col=version&amp;col=focuses&amp;col=keywords&amp;order=priority\">45 tickets sur Trac</a>&nbsp;pour WP&nbsp;6.1, l’amélioration des performances et des temps de chargement de WordPress a été l’un des enjeux principaux de cette version. Les changements les plus significatifs portent sur les requêtes&nbsp;<code>WP_Query</code>&nbsp;et sur l’API REST, deux points qui impactent grandement les temps de chargement de votre site. L’un des changements les plus attendus concernait notamment la mise en cache des requêtes&nbsp;<code>WP_Query</code>, et c’est maintenant une réalité avec WP&nbsp;6.1.</p>\n\n\n\n<p>De nouveaux points de contrôle ont aussi été ajoutés dans l’écran de&nbsp;<em>Santé du site</em>, qui vous indiquera maintenant si la mise en cache des pages et le cache persistant fonctionnent correctement sur votre site.</p>\n\n\n\n<p>Plusieurs améliorations conséquentes sur l’API de mise en cache de WordPress ont également été mises en œuvre, et l’ordre d’exécution général des crochets d’action a été optimisé pour retarder le moins possible l’affichage des pages.</p>\n\n\n\n<p>L’enregistrement de blocs personnalisés pour l’éditeur à l’aide de fichiers&nbsp;<code>block.json</code>&nbsp;a aussi été rendu bien plus performant.</p>\n\n\n\n<p>Et ce n’est qu’une petite partie des améliorations de performances de WP 6.1. Pour en découvrir plus, voici un guide spécifique sur les performances dans cette nouvelle version de WP&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"qnD9kaPwLM\"><a href=\"https://make.wordpress.org/core/2022/10/11/performance-field-guide-for-wordpress-6-1/\">Performance Field Guide for WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Performance Field Guide for WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/11/performance-field-guide-for-wordpress-6-1/embed/#?secret=S9AxfZHdKy#?secret=qnD9kaPwLM\" data-secret=\"qnD9kaPwLM\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Accessibilité</h2>\n\n\n\n<p>Il s’agit du second focus principal de WordPress 6.1, avec&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~accessibility&amp;milestone=6.1&amp;group=component&amp;col=id&amp;col=summary&amp;col=focuses&amp;col=version&amp;col=keywords&amp;order=priority\">28 tickets sur Trac</a>, concernant 13 des principaux composants du CMS. De nombreuses améliorations ont été faites sur l’éditeur de blocs et sur la fonctionnalité d’édition complète du site, quelques éléments encore non conformes sur les différents écrans d’administration ont été corrigés, et beaucoup d’autres améliorations ont été faites pour faciliter l’utilisation de WordPress par toutes et tous.</p>\n\n\n\n<p>Une attention particulière a également été portée sur la gestion des champs requis sur les différents formulaires de l’interface d’administration&nbsp;: pour faciliter leur maintenance, une petite API a été créée afin de gérer de façon centralisée leur affichage. Celle-ci est publique et peut donc être utilisée par les personnes réalisant des développements sur mesure.</p>\n\n\n\n<p>Notons également qu’avec WordPress 6.1, les deux thèmes natifs&nbsp;<a href=\"https://core.trac.wordpress.org/changeset/54467\">Twenty Twenty-Three</a>&nbsp;(nous reparlerons de celui-là dans un article dédié&nbsp;!) et&nbsp;<a href=\"https://github.com/WordPress/wordpress-develop/pull/2324/files\">Twenty Twenty-Two</a>&nbsp;font leur entrée parmi les premiers&nbsp;<em>Block Themes</em>&nbsp;(ces thèmes entièrement modifiables avec l’éditeur de blocs) ayant obtenu le libellé&nbsp;<code>accessibility-ready</code>&nbsp;sur le répertoire de thèmes WordPress.org.</p>\n\n\n\n<p>Pour en savoir plus sur toutes ces améliorations concernant l’accessibilité de WordPress, consultez le guide spécifique proposé par l’équipe&nbsp;<em>Accessibility</em>&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"gOxSBctZIG\"><a href=\"https://make.wordpress.org/core/2022/10/11/wordpress-6-1-accessibility-improvements/\">WordPress 6.1 Accessibility Improvements</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 6.1 Accessibility Improvements&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/11/wordpress-6-1-accessibility-improvements/embed/#?secret=Rp2Ep8E3XI#?secret=gOxSBctZIG\" data-secret=\"gOxSBctZIG\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">L’éditeur de blocs</h2>\n\n\n\n<p>C’est évidemment encore et toujours un des axes concentrant le plus d’évolutions d’une version à une autre&nbsp;<img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/1f60a.png\" alt=\"😊\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>WordPress 6.1 embarque les versions&nbsp;<a href=\"https://make.wordpress.org/core/2022/04/28/whats-new-in-gutenberg-13-1-27-april/\">13.1</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/05/12/whats-new-in-gutenberg-13-2-may-11/\">13.2</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/05/26/whats-new-in-gutenberg-13-3-0-may-25/\">13.3</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/06/10/whats-new-in-gutenberg-13-4-8-june/\">13.4</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/06/22/whats-new-in-gutenberg-13-5-22-june/\">13.5</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/07/07/whats-new-in-gutenberg-13-6-6-july/\">13.6</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/07/20/whats-new-in-gutenberg-13-7-20-july/\">13.7</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/08/04/whats-new-in-gutenberg-13-8-3-august/\">13.8</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/08/17/whats-new-in-gutenberg-13-9-17-august/\">13.9</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2022/09/01/whats-new-in-gutenberg-14-0-31-august/\">14.0</a>, et&nbsp;<a href=\"https://make.wordpress.org/core/2022/09/16/whats-new-in-gutenberg-14-1-15-september/\">14.1</a>&nbsp;du projet Gutenberg.</p>\n\n\n\n<p>Parmi les nombreux changements de ces 10 versions de l’extension Gutenberg, un gros effort a été fait pour rendre les blocs et autres fonctionnalités de l’éditeur de plus en plus disponibles pour les thèmes «&nbsp;classiques&nbsp;», c’est à dire les thèmes qui ne prennent pas encore en charge l’édition complète du site à l’aide de blocs, une fonctionnalité introduite dans le CMS en 2022 avec WordPress&nbsp;5.9.</p>\n\n\n\n<p>L’objectif est de faciliter le travail des développeuses et des développeurs pour effectuer une transition de leurs thèmes «&nbsp;classiques&nbsp;» vers le principe du thème basé sur des blocs, que celui-ci soit entièrement ou partiellement modifiable dans l’éditeur. Nous espérons que cela poussera encore plus les personnes développant des thèmes WordPress à exploiter au maximum les fonctionnalités de l’éditeur.</p>\n\n\n\n<p>Par ailleurs, de nombreuses fonctionnalités utiles au quotidien ont été ajoutées dans cette version&nbsp;: filtrage des données du&nbsp;<code>theme.json</code>, nouveau système de gestion des préférences dans l’éditeur, possibilité de modifier et étendre le bloc «&nbsp;Boucle de requête&nbsp;», et bien plus encore.</p>\n\n\n\n<p>Vous trouverez ci-dessous les différentes notes de développement concernant l’éditeur de WordPress&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"dBrmxcR9rG\"><a href=\"https://make.wordpress.org/core/2022/10/12/block-api-changes-in-wordpress-6-1/\">Block API changes in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block API changes in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/12/block-api-changes-in-wordpress-6-1/embed/#?secret=yffoVF22CZ#?secret=dBrmxcR9rG\" data-secret=\"dBrmxcR9rG\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Fjn1oGyqWW\"><a href=\"https://make.wordpress.org/core/2022/10/07/create-block-scaffolding-tool-updates/\">Create-block scaffolding tool updates</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Create-block scaffolding tool updates&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/07/create-block-scaffolding-tool-updates/embed/#?secret=VtlSw1eM1t#?secret=Fjn1oGyqWW\" data-secret=\"Fjn1oGyqWW\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zyyLlU97ov\"><a href=\"https://make.wordpress.org/core/2022/10/10/extending-the-query-loop-block/\">Extending the Query Loop block</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Extending the Query Loop block&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/extending-the-query-loop-block/embed/#?secret=LIiTYZPDuG#?secret=zyyLlU97ov\" data-secret=\"zyyLlU97ov\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zexxXNky1n\"><a href=\"https://make.wordpress.org/core/2022/10/04/block-based-template-parts-in-traditional-themes/\">Block-based &#8220;template parts&#8221; in traditional themes</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block-based &#8220;template parts&#8221; in traditional themes&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/04/block-based-template-parts-in-traditional-themes/embed/#?secret=jGN0kLdfpO#?secret=zexxXNky1n\" data-secret=\"zexxXNky1n\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"TQjPI7jtgJ\"><a href=\"https://make.wordpress.org/core/2022/10/10/block-styles-generation-style-engine/\">Block styles generation (Style Engine)</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block styles generation (Style Engine)&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/block-styles-generation-style-engine/embed/#?secret=hpcPvjxOC0#?secret=TQjPI7jtgJ\" data-secret=\"TQjPI7jtgJ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"3JmOVCNc5n\"><a href=\"https://make.wordpress.org/core/2022/10/10/changes-to-block-editor-preferences-in-wordpress-6-1/\">Changes to block editor preferences in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Changes to block editor preferences in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/changes-to-block-editor-preferences-in-wordpress-6-1/embed/#?secret=71OVXmY0eo#?secret=3JmOVCNc5n\" data-secret=\"3JmOVCNc5n\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"vifHRi3Twr\"><a href=\"https://make.wordpress.org/core/2022/10/10/editor-components-updates-for-wordpress-6-1/\">Editor Components updates in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Editor Components updates in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/editor-components-updates-for-wordpress-6-1/embed/#?secret=qPmCZKf0U8#?secret=vifHRi3Twr\" data-secret=\"vifHRi3Twr\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"h3aDnp2W04\"><a href=\"https://make.wordpress.org/core/2022/10/11/simplified-data-access-with-new-react-hooks-in-wordpress-6-1/\">Simplified data access with new React hooks in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Simplified data access with new React hooks in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/11/simplified-data-access-with-new-react-hooks-in-wordpress-6-1/embed/#?secret=0IPHFMNGSf#?secret=h3aDnp2W04\" data-secret=\"h3aDnp2W04\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"bRnyzICqAu\"><a href=\"https://make.wordpress.org/core/2022/10/10/miscellaneous-editor-changes-for-wordpress-6-1/\">Miscellaneous editor changes for WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous editor changes for WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/miscellaneous-editor-changes-for-wordpress-6-1/embed/#?secret=5zY0ol61lV#?secret=bRnyzICqAu\" data-secret=\"bRnyzICqAu\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Par ailleurs, la note de développement suivante fournit un état des lieux très pratique des blocs natifs et de leurs différentes possibilités de formatage&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"wq78upcC0e\"><a href=\"https://make.wordpress.org/core/2022/10/11/roster-of-design-tools-per-block/\">Roster of design tools per block</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Roster of design tools per block&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/11/roster-of-design-tools-per-block/embed/#?secret=0coW6ckdnA#?secret=wq78upcC0e\" data-secret=\"wq78upcC0e\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Développement de thèmes WordPress</h2>\n\n\n\n<p>Les notes de développement suivantes présentent des changements qui concernent tout particulièrement les développeuses et développeurs de thèmes.</p>\n\n\n\n<p>Tout d’abord, l’entête&nbsp;<code>Update URI</code>&nbsp;qui doit être utilisé si vous développez des thèmes sur mesure n’ayant pas vocation à être déployés sur le répertoire WordPress.org. Cela évitera que votre site propose une mise à jour et écrase votre thème dans le cas où un thème du répertoire officiel porterait le même identifiant (slug) que le vôtre&nbsp;!</p>\n\n\n\n<p>Ensuite nous avons plusieurs notes de développement concernant les interactions entre les thèmes et l’éditeur de site. Et notamment la possibilité de créer des éléments de modèles basés sur des blocs au sein d’un thème classique, c’est à dire d’un thème ne proposant au départ pas de compatibilité avec l’édition complète de site (<em>full site editing</em>).</p>\n\n\n\n<p>Enfin, on notera l&rsquo;arrivée de la gestion fluide des polices typographiques, qui permettent de définir la taille de typo de façon à ce qu&rsquo;elle s&rsquo;adapte dynamiquement à la largeur de l&rsquo;écran.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"kTK0wJfy87\"><a href=\"https://make.wordpress.org/core/2022/10/06/introducing-update-uri-theme-header-in-wordpress-6-1/\">Introducing “Update URI” theme header in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing “Update URI” theme header in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/06/introducing-update-uri-theme-header-in-wordpress-6-1/embed/#?secret=qitshxDkLe#?secret=kTK0wJfy87\" data-secret=\"kTK0wJfy87\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zexxXNky1n\"><a href=\"https://make.wordpress.org/core/2022/10/04/block-based-template-parts-in-traditional-themes/\">Block-based &#8220;template parts&#8221; in traditional themes</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block-based &#8220;template parts&#8221; in traditional themes&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/04/block-based-template-parts-in-traditional-themes/embed/#?secret=jGN0kLdfpO#?secret=zexxXNky1n\" data-secret=\"zexxXNky1n\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"WzczIz4yg6\"><a href=\"https://make.wordpress.org/core/2022/10/03/fluid-font-sizes-in-wordpress-6-1/\">Fluid font sizes in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Fluid font sizes in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/03/fluid-font-sizes-in-wordpress-6-1/embed/#?secret=SLMWQp7RNK#?secret=WzczIz4yg6\" data-secret=\"WzczIz4yg6\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"z0vYQmLM5z\"><a href=\"https://make.wordpress.org/core/2022/09/27/navigation-block-fallback-behavior-in-wp-6-1-dev-note/\">Navigation Block Fallback Behavior in WP 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Navigation Block Fallback Behavior in WP 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/09/27/navigation-block-fallback-behavior-in-wp-6-1-dev-note/embed/#?secret=tx4090NC9A#?secret=z0vYQmLM5z\" data-secret=\"z0vYQmLM5z\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"GWWtPp4NS7\"><a href=\"https://make.wordpress.org/core/2022/10/10/styling-elements-in-block-themes/\">Styling elements in block themes</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Styling elements in block themes&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/styling-elements-in-block-themes/embed/#?secret=DNb1wiOY5K#?secret=GWWtPp4NS7\" data-secret=\"GWWtPp4NS7\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"iGV1yvHNkk\"><a href=\"https://make.wordpress.org/core/2022/10/10/updated-editor-layout-support-in-6-1-after-refactor/\">Updated editor layout support in 6.1 after refactor</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updated editor layout support in 6.1 after refactor&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/updated-editor-layout-support-in-6-1-after-refactor/embed/#?secret=ldKH3CQjOT#?secret=iGV1yvHNkk\" data-secret=\"iGV1yvHNkk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"90Yib2AXch\"><a href=\"https://make.wordpress.org/core/2022/10/10/filters-for-theme-json-data/\">Filters for theme.json data</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Filters for theme.json data&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/10/filters-for-theme-json-data/embed/#?secret=5Qfg0Q38Dk#?secret=90Yib2AXch\" data-secret=\"90Yib2AXch\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"PrZ6RePCEE\"><a href=\"https://make.wordpress.org/core/2022/10/07/introduction-of-presets-across-padding-margin-and-block-gap/\">Introduction of presets across padding, margin and block gap</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introduction of presets across padding, margin and block gap&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/07/introduction-of-presets-across-padding-margin-and-block-gap/embed/#?secret=9fmr75XcT7#?secret=PrZ6RePCEE\" data-secret=\"PrZ6RePCEE\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Twenty Twenty-Three, le nouveau thème natif</h2>\n\n\n\n<p><em>Twenty Twenty-Three</em>&nbsp;est le nouveau thème par défaut de WordPress.</p>\n\n\n\n<p>Comme son prédécesseur, il exploite à 100&nbsp;% les fonctionnalités de l’éditeur de site. Il va même beaucoup plus loin en intégrant nativement 10 variations de styles permettant de modifier complètement l’interface depuis l’administration.</p>\n\n\n\n<p>Ces 10 variations de styles ont été sélectionnées à l’aide d’un appel à contribution. L’objectif est de montrer par l’exemple comment se comportent les nouvelles fonctionnalités de l’éditeur de site, et notamment comment exploiter le fichier&nbsp;<code>theme.json</code>.</p>\n\n\n\n<p>Vous trouverez ci-dessous une vidéo balayant les 10 variations de styles de ce thème.</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://make.wordpress.org/design/files/2022/09/tt3_variations.mp4\"></video></figure>\n\n\n\n<p>Comme d’habitude, ce thème natif a été développé sur GitHub (où vous retrouverez l’historique du projet) puis intégré au cœur de WordPress pendant la phase de développement de la version 6.1.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Autres améliorations</h2>\n\n\n\n<h3 class=\"wp-block-heading\">API REST</h3>\n\n\n\n<p>L’API REST a vu l’arrivée d’améliorations concernant le point de terminaison&nbsp;<code>/search</code>&nbsp;ainsi que de l’affichage des réponses JSON pouvant être controlées via le filtre&nbsp;<code>rest_json_encode_options</code>. Toutes les améliorations de l’API sont décrites dans la note de développement suivante&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"wqhN6S07e4\"><a href=\"https://make.wordpress.org/core/2022/10/11/miscellaneous-rest-api-improvements-in-wordpress-6-1/\">Miscellaneous REST API improvements in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous REST API improvements in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/11/miscellaneous-rest-api-improvements-in-wordpress-6-1/embed/#?secret=99O3BHkhq9#?secret=wqhN6S07e4\" data-secret=\"wqhN6S07e4\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Page de connexion</h3>\n\n\n\n<p>Une nouvelle fonction attendue depuis plus de 10 ans a fait son entrée dans la boîte à outils des développeuses et développeurs&nbsp;:&nbsp;<code>is_login()</code>&nbsp;permet de déterminer si l’on se trouve sur la page de connexion ou non.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"T8g55XKRps\"><a href=\"https://make.wordpress.org/core/2022/09/11/new-is_login-function-for-determining-if-a-page-is-the-login-screen/\">New is_login() function for determining if a page is the login screen</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New is_login() function for determining if a page is the login screen&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/09/11/new-is_login-function-for-determining-if-a-page-is-the-login-screen/embed/#?secret=JQ3aBVlXl1#?secret=T8g55XKRps\" data-secret=\"T8g55XKRps\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Tableaux de listes de l’admin</h3>\n\n\n\n<p>Une nouvelle méthode fait son apparition, afin de pouvoir interagir et filtrer plus facilement les liens de visualisation présents dans ces tableaux.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"at2b0OL7mT\"><a href=\"https://make.wordpress.org/core/2022/10/09/introducing-wp_list_tableget_views_links-in-wordpress-6-1/\">Introducing WP_List_Table::get_views_links() in WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing WP_List_Table::get_views_links() in WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/09/introducing-wp_list_tableget_views_links-in-wordpress-6-1/embed/#?secret=iitc3BtHzA#?secret=at2b0OL7mT\" data-secret=\"at2b0OL7mT\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Médias</h3>\n\n\n\n<p>Avec la version 5.8, nous avons accueilli&nbsp;<a href=\"https://make.wordpress.org/core/2021/06/07/wordpress-5-8-adds-webp-support/\">la prise en charge du format WebP</a>&nbsp;et nous prévoyions initialement d’intégrer la génération automatique et par défaut d’images dans ce format dans WordPress 6.1, mais le&nbsp;<em>commit</em>&nbsp;associé a finalement été&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/54226\">annulé</a>&nbsp;avec la&nbsp;<a href=\"https://make.wordpress.org/core/2022/09/11/webp-in-core-for-6-1/\">recommandation</a>&nbsp;de plutôt intégrer cette fonctionnalité dans une&nbsp;<a href=\"https://make.wordpress.org/core/2022/09/11/canonical-plugins-revisited/\">extension canonique</a>.</p>\n\n\n\n<p>En revanche, la propriété&nbsp;<code>muted</code>&nbsp;est maintenant disponible pour les vidéos insérées dans l’éditeur, ce qui permet de rendre silencieuse les vidéos ayant vocation à être lancées automatiquement (propriété&nbsp;<code>autoplay</code>). Ceci est obligatoire pour les vidéos automatiques.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Autres changements techniques</h3>\n\n\n\n<p>WordPress 6.1 introduit de nombreuses nouvelles fonctions et crochets d’action ou filtres. Ces changements sont détaillés dans la note de développement suivante&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"eKrGcN1LRi\"><a href=\"https://make.wordpress.org/core/2022/10/11/miscellaneous-core-changes-for-wordpress-6-1/\">Miscellaneous Core changes for WordPress 6.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous Core changes for WordPress 6.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/10/11/miscellaneous-core-changes-for-wordpress-6-1/embed/#?secret=wygMCG7gVe#?secret=eKrGcN1LRi\" data-secret=\"eKrGcN1LRi\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>En plus de tous ces changements, on notera les évolutions suivantes, triées par composant du cœur WP&nbsp;:</p>\n\n\n\n<ul>\n<li><strong>Mots de passe d’applications :</strong>&nbsp;les super&nbsp;admins peuvent mettre en place un mot de passe d’application sur un site auquel ils n’ont pas été rattachés (<a href=\"https://core.trac.wordpress.org/ticket/53224\">#53224</a>)</li>\n\n\n\n<li><strong>Sauvegardes automatiques :</strong>&nbsp;les utilisateur·ices ayant un blocage via la fonctionnalité&nbsp;<code>post lock</code>&nbsp;pouvaient auparavant tricher en surchargeant les modifications via les sauvegardes automatiques&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/55659\">#55659</a>)</li>\n\n\n\n<li><strong>API de gestion du cache&nbsp;:&nbsp;</strong>ajout des fonctions&nbsp;<code>wp_cache_flush_group</code>&nbsp;et&nbsp;<code>wp_cache_supports</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/4476\">#4476</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56605\">#56605</a>)</li>\n\n\n\n<li><strong>Charset&nbsp;:</strong>&nbsp;ajout de l’échappement des caractères unicode NFD dans&nbsp;<code>remove_accents()</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/35951\">#35951</a>)</li>\n\n\n\n<li><strong>API Cron :</strong>&nbsp;ajout de la journalisation des erreurs et de crochets associés dans&nbsp;<code>wp-cron.php</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/56048\">#56048</a>)</li>\n\n\n\n<li><strong>Éditeur&nbsp;:</strong>&nbsp;clarification du fait que&nbsp;<code>get_page_template()</code>&nbsp;ne fonctionne pas sur les thèmes basés sur des blocs&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/56394\">#56394</a>)</li>\n\n\n\n<li><strong>Compositions de blocs :</strong>&nbsp;ajout d’une catégorie «&nbsp;Pieds de page&nbsp;»&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/56416\">#56416</a>)</li>\n\n\n\n<li><strong>Bibliothèque tierces :</strong>\n<ul>\n<li>Correction sur Thickbox pour la prise en charge des images WebP&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55786\">#55786</a></li>\n\n\n\n<li>Mise à jour de PHPMailer à la version 6.6.4&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55976\">#55976</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56016\">#56016</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56413\">#56413</a></li>\n\n\n\n<li>Mise à jour de Underscore à la version 6.1&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56030\">#56030</a></li>\n\n\n\n<li>Mise à jour de Moment à la version 6.1&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56031\">#56031</a></li>\n\n\n\n<li>Mise à jour de jQuery&nbsp;UI à la version 6.1&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56239\">#56239</a></li>\n\n\n\n<li>Mise à jour de mediaelement.js à la version 4.2.17&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56319\">#56319</a></li>\n\n\n\n<li>Mise à jour de jQuery à la version 3.6.1&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56451\">#56451</a></li>\n\n\n\n<li>Mise à jour de Sodium Compat à la version 1.19.0&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56564\">#56564</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56653\">#56653</a></li>\n\n\n\n<li>Mise à jour de GetID3 à la version 1.9.22&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56692\">#56692</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Formatage :</strong>\n<ul>\n<li>Suppression des accents combinés dans&nbsp;<code>remove_accents()</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/24661\">#24661</a></li>\n\n\n\n<li>Inversement de l’encapsulation de&nbsp;<code>sanitize_url()</code>&nbsp;et&nbsp;<code>esc_url_raw()</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55852\">#55852</a></li>\n\n\n\n<li>Correction de la valeur retournée par&nbsp;<code>safecss_filter_attr()</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55966\">#55966</a></li>\n\n\n\n<li>Autorisation de l’utilisation de propriétés CSS spécifiques à la mise en page dans le filtre&nbsp;<code>safe_style_css</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56122\">#56122</a></li>\n\n\n\n<li>Autorisation de l’utilisation de variables CSS dans&nbsp;<code>safecss_filter_attr</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56353\">#56353</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Général :</strong>\n<ul>\n<li>Mise à jour de&nbsp;<code>is_serialized</code>&nbsp;pour accepter les Enums&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/53299\">#53299</a></li>\n\n\n\n<li>Remplacement des appels à&nbsp;<code>phpversion()</code>&nbsp;par la constante PHP_VERSION&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55680\">#55680</a></li>\n\n\n\n<li>Suppression des doublons d’utilisation de&nbsp;<code>realpath()</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56636\">#56636</a></li>\n\n\n\n<li>Suppression des doublons d’utilisation de&nbsp;<code>file_get_contents</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56637\">#56637</a></li>\n\n\n\n<li>Suppression des appels à&nbsp;<code>file_exists()</code>&nbsp;sur les variables utilisant&nbsp;<code>realpath()</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56654\">#56654</a></li>\n\n\n\n<li>Suppression des doublons d’utilisation de&nbsp;<code>get_theme_file_path</code>&nbsp;dans&nbsp;<code>register_block_style_handle</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/56666\">#56666</a></li>\n\n\n\n<li>Correction du retour obtenu en utilisant&nbsp;<code>wp_rand( 0, 0)</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55194\">#55194</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Internationalisation :</strong>&nbsp;correction d’un bug conduisant&nbsp;<code>switch_to_locale()</code>&nbsp;à annuler le chargement des traductions des thèmes et des extensions&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/39210\">#39210</a></li>\n\n\n\n<li><strong>Page de connexion/inscription :</strong>\n<ul>\n<li>Les champs obligatoires de la page d’inscription sur les multisites n’avaient pas d’attribut&nbsp;<code>required</code>&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/54344\">#54344</a></li>\n\n\n\n<li>Ajout de description ARIA sur les champs d’erreur de connexion&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/54483\">#54483</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Médias :</strong>&nbsp;correction d’un bug sur l’interprétation de l’orientation des images via leurs données EXIF&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/54937\">#54937</a></li>\n\n\n\n<li><strong>Multisite :</strong>\n<ul>\n<li>Suppression complète des termes globaux <a href=\"https://core.trac.wordpress.org/ticket/21734\">#21734</a></li>\n\n\n\n<li>Utilisation de l’API&nbsp;des métadonnées pour les options du réseau <a href=\"https://core.trac.wordpress.org/ticket/37181\">#37181</a></li>\n\n\n\n<li>Stockage de l&rsquo;ID du site principal dans les options du réseau multisite <a href=\"https://core.trac.wordpress.org/ticket/55802\">#55802</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Chargement des scripts :</strong> mise en place des scripts en front-end via&nbsp;<code>viewScript</code> pour les blocs dynamiques <a href=\"https://core.trac.wordpress.org/ticket/56470\">#56470</a></li>\n\n\n\n<li><strong>Publications :</strong> correction de la vérification des publications non existantes dans&nbsp;<code>get_post_permalink()</code> <a href=\"https://core.trac.wordpress.org/ticket/45329\">#45329</a></li>\n\n\n\n<li><strong>Taxonomies :</strong>\n<ul>\n<li>Dans <code>wp_insert_term</code>, passage de <code>$args</code> en tant que paramètre additionnel pour les actions d’après-insertion (<code>create_term</code>, <code>created_term</code>, etc.)&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55441\">#55441</a></li>\n\n\n\n<li>Les liens d&rsquo;archives de catégories n&rsquo;incluent plus par défaut la description dans l&rsquo;attribut  <code>title</code> du lien&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55530\">#55530</a></li>\n\n\n\n<li>Les champs des termes sont maintenant associés avec leurs description dans l&rsquo;admin&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/55651\">#55651</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Mises à jour :</strong>\n<ul>\n<li>Ajout d&rsquo;un suivi de l&rsquo;usage des modules PHP installés sur les sites WP&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/48116\">#48116</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Widgets :</strong>\n<ul>\n<li>Suppression de requêtes inutiles vers la base de données&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/54677\">#54677</a></li>\n</ul>\n</li>\n</ul>\n\n\n\n<div style=\"height:40px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<p>Que vous développiez des thèmes ou des extensions, pensez à tester et retester votre code pour vous assurer de sa compatibilité avec ces changements. Vous pouvez utiliser&nbsp;<a rel=\"noreferrer noopener\" href=\"https://wordpress.org/plugins/wordpress-beta-tester/\" target=\"_blank\">l’extension Beta Tester</a>&nbsp;sur un site de test pour vérifier la compatibilité de vos développements avec WordPress 6.1&nbsp;RC&nbsp;1.&nbsp;Nous comptons sur vous pour vous assurer que votre code fonctionne correctement avec le cœur du CMS, pour le bien des millions d’utilisateurs et utilisatrices de WordPress&nbsp;<img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2665.png\" alt=\"♥\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<div style=\"height:40px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<p style=\"font-size:13px\">Ce guide en français a été rédigé par <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a> avec l’aide de <a href=\"https://profiles.wordpress.org/fxbenard\">FX Bénard</a> et <a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://fr.wordpress.org/2022/10/12/guide-des-changements-techniques-de-wordpress-6-1/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"Arrêt définitif des mises à jour de sécurité pour les versions de WordPress 3.7 à 4.0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:122:\"https://fr.wordpress.org/2022/09/07/arret-definitif-des-mises-a-jour-de-securite-pour-les-versions-de-wordpress-3-7-a-4-0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:131:\"https://fr.wordpress.org/2022/09/07/arret-definitif-des-mises-a-jour-de-securite-pour-les-versions-de-wordpress-3-7-a-4-0/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Sep 2022 13:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2445\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:147:\"À partir du 1er décembre 2022, l\'équipe de sécurité de WordPress ne fournira plus de mises à jour de sécurité pour les versions 3.7 à 4.0.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4398:\"\n<p>Jusqu&rsquo;à présent, l&rsquo;équipe de sécurité de WordPress proposait des correctifs de sécurité pour toutes les versions de WordPress reposant sur les versions 3.7 à la version actuelle (6.0, sachant que WordPress&nbsp;6.1 sortira cet automne). Cela faisait donc un grand nombre de versions à maintenir, alors qu&rsquo;elles ne représentent qu&rsquo;un nombre très minoritaire de sites (les statistiques sont disponibles publiquement <a href=\"https://fr.wordpress.org/about/stats/\">sur cette page</a>).</p>\n\n\n\n<p>À partir du 1<sup>er</sup> décembre 2022, l&rsquo;équipe dédiée à la sécurité de WordPress ne fournira plus de mises à jour de sécurité pour les versions 3.7 à 4.0.</p>\n\n\n\n<span id=\"more-2445\"></span>\n\n\n\n<p>Ces versions datant maintenant de 8 ans ou plus, il y a peu de chances que votre site soit concerné, mais vous pouvez vous en assurer en vous connectant à votre tableau de bord et en vérifiant la version de WordPress indiquée dans l’encart «&nbsp;D&rsquo;un coup d&rsquo;œil&nbsp;» (sur les versions les plus anciennes, cet encart est intitulé «&nbsp;Aujourd’hui&nbsp;»).</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2022/09/widget-wordpress-duncoupdoeil.png\"><img decoding=\"async\" loading=\"lazy\" width=\"1024\" height=\"300\" src=\"https://fr.wordpress.org/files/2022/09/widget-wordpress-duncoupdoeil-1024x300.png\" alt=\"\" class=\"wp-image-2448\" srcset=\"https://fr.wordpress.org/files/2022/09/widget-wordpress-duncoupdoeil-1024x300.png 1024w, https://fr.wordpress.org/files/2022/09/widget-wordpress-duncoupdoeil-300x88.png 300w, https://fr.wordpress.org/files/2022/09/widget-wordpress-duncoupdoeil-768x225.png 768w, https://fr.wordpress.org/files/2022/09/widget-wordpress-duncoupdoeil.png 1132w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Dans le cas où vous disposeriez d&rsquo;une installation tournant sur WordPress 4.0 ou inférieur, vous devrez faire une mise à jour vers une version plus récente (nous recommandons la dernière version disponible) afin de garder votre site sécurisé. Consultez notre <a href=\"https://fr.wordpress.org/support/article/updating-wordpress/\">documentation sur la mise à niveau de votre site WordPress</a> pour plus d&rsquo;informations.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2022/09/maj-wordpress-tableau-de-bord.png\"><img decoding=\"async\" loading=\"lazy\" width=\"1024\" height=\"564\" src=\"https://fr.wordpress.org/files/2022/09/maj-wordpress-tableau-de-bord-1024x564.png\" alt=\"\" class=\"wp-image-2452\" srcset=\"https://fr.wordpress.org/files/2022/09/maj-wordpress-tableau-de-bord-1024x564.png 1024w, https://fr.wordpress.org/files/2022/09/maj-wordpress-tableau-de-bord-300x165.png 300w, https://fr.wordpress.org/files/2022/09/maj-wordpress-tableau-de-bord-768x423.png 768w, https://fr.wordpress.org/files/2022/09/maj-wordpress-tableau-de-bord-1536x846.png 1536w, https://fr.wordpress.org/files/2022/09/maj-wordpress-tableau-de-bord-2048x1128.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Dans tous les cas, il est important de noter que <strong>la seule version de WordPress activement maintenue est la version courante</strong> (à ce jour, la version 6.0). Les versions plus anciennes ne font que bénéficier de correctifs de sécurité et ne reçoivent généralement aucun correctif de bug.</p>\n\n\n\n<p>Dans les prochains mois, l&rsquo;arrêt du support d&rsquo;un nouveau groupe d’anciennes versions de WordPress sera annoncé, selon un calendrier qui est en cours d&rsquo;élaboration au sein de l&rsquo;équipe de sécurité de WP.</p>\n\n\n\n<p>Pour plus d&rsquo;informations sur le processus d&rsquo;arrêt du support des anciennes versions de WordPress, vous pouvez consulter <a href=\"https://make.wordpress.org/security/?p=73\">cet article de l&rsquo;équipe de sécurité de WordPress (en anglais)</a>.</p>\n\n\n\n<p class=\"has-small-font-size\"><em>Article publié par <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a> de l&rsquo;équipe de sécurité de WP. Merci aux co-responsables du site fr.wordpress.org <a href=\"https://profiles.wordpress.org/wolforg/\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a> et <a href=\"https://profiles.wordpress.org/fxbenard/\">FX Bénard</a> pour la relecture.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:127:\"https://fr.wordpress.org/2022/09/07/arret-definitif-des-mises-a-jour-de-securite-pour-les-versions-de-wordpress-3-7-a-4-0/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"WordPress 6.0 « Arturo »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://fr.wordpress.org/2022/05/25/wordpress-6-0-arturo/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://fr.wordpress.org/2022/05/25/wordpress-6-0-arturo/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 25 May 2022 06:16:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2400\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:376:\"Bienvenue sur WordPress 6.0 «&#160;Arturo&#160;» Nous vous souhaitons la bienvenue sur WordPress 6.0, version inspirée par le musicien de jazz Arturo O’Farrill. Célèbre pour son influence sur le jazz latino contemporain, Arturo a publié plus de 15 albums sur 50 ans de carrière. Prenez le temps d’explorer WordPress 6.0. Cette version a été conçue afin [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jenny Dupuy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:54806:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2022/05/Main-image-News-post.png\"><img decoding=\"async\" loading=\"lazy\" width=\"1024\" height=\"694\" src=\"https://fr.wordpress.org/files/2022/05/Main-image-News-post-1024x694.png\" alt=\"\" class=\"wp-image-2401\" srcset=\"https://fr.wordpress.org/files/2022/05/Main-image-News-post-1024x694.png 1024w, https://fr.wordpress.org/files/2022/05/Main-image-News-post-300x203.png 300w, https://fr.wordpress.org/files/2022/05/Main-image-News-post-768x521.png 768w, https://fr.wordpress.org/files/2022/05/Main-image-News-post-1536x1042.png 1536w, https://fr.wordpress.org/files/2022/05/Main-image-News-post-2048x1389.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Bienvenue sur WordPress 6.0 «&nbsp;Arturo&nbsp;»</h2>\n\n\n\n<p>Nous vous souhaitons la bienvenue sur WordPress 6.0, version inspirée par le musicien de jazz <a href=\"https://en.wikipedia.org/wiki/Arturo_O\'Farrill\">Arturo O’Farrill</a>. Célèbre pour son influence sur le jazz latino contemporain, Arturo a publié plus de 15 albums sur 50 ans de carrière.</p>\n\n\n\n<p>Prenez le temps d’explorer WordPress 6.0. Cette version a été conçue afin de vous aider à développer votre inspiration créative et pour rendre l’expérience éditoriale encore plus intuitive. Pendant que vous découvrez les nouveautés de cette version, n’hésitez pas à lancer une liste de lecture comprenant les meilleures chansons d’Arturo&nbsp;!</p>\n\n\n\n<p>Avec presque 1 000 améliorations et corrections, la deuxième version majeure de l’année 2022 est là. <a href=\"https://fr.wordpress.org/latest-fr_FR.zip\">Cliquez ici pour télécharger WordPress 6.0 !</a></p>\n\n\n\n<span id=\"more-2400\"></span>\n\n\n\n<p>Les propriétaires de sites devraient mettre à jour leurs installations WordPress afin de profiter des avantages de sa stabilité, de ses améliorations de performances, et de ses améliorations en terme d&rsquo;ergonomie. Les personnes créant du contenu avec WordPress apprécieront toutes les nouvelles fonctionnalités améliorant l&rsquo;expérience éditoriale et de mise en page.</p>\n\n\n\n<div class=\"wp-block-buttons is-layout-flex\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"https://fr.wordpress.org/latest-fr_FR.zip\">Télécharger WordPress 6.0 en français – ZIP 22,5 Mo </a></div>\n</div>\n\n\n\n<h3 class=\"wp-block-heading\">Le contenu de WordPress 6.0</h3>\n\n\n\n<p>Pour en savoir plus sur le contenu technique de la version, lisez <a href=\"https://fr.wordpress.org/2022/05/04/guide-des-changements-techniques-de-wordpress-6-0/\" data-type=\"post\" data-id=\"2369\">le guide que nous avons publié il y a quelques semaines</a>.</p>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://i2.wp.com/wordpress.org/news/files/2022/05/Writing-Improvements-1.png?fit=1204%2C700&amp;ssl=1\" alt=\"Selecting multiple lines of text from two blocks\" class=\"wp-image-12887\" /></figure>\n\n\n\n<h4 class=\"wp-block-heading\">Une expérience d’édition améliorée</h4>\n\n\n\n<p>Les améliorations éditoriales ne manquent pas, que vous écriviez un tout nouvel article ou que vous ajoutiez des éléments à une page existante. Explorez les façons d’améliorer votre processus de création de contenu avec&nbsp;:</p>\n\n\n\n<ul>\n<li>Sélectionnez du texte à cheval sur plusieurs blocs pour le modifier en une seule fois.</li>\n\n\n\n<li>Saisissez deux crochets ouvrants&nbsp;<code>[[</code>&nbsp;pour accéder rapidement au gestionnaire de liens.</li>\n\n\n\n<li>Conservez les styles existants lorsque vous transformez des blocs d’un certain type en un autre type de bloc, par exemple lorsque vous transformez un bloc paragraphe en un bloc code.</li>\n\n\n\n<li>Créez des boutons personnalisés et tous les nouveaux boutons que vous créerez par la suite conserveront automatiquement ces styles personnalisés.</li>\n\n\n\n<li>Rendez les nuages d’étiquettes et les icônes de réseaux sociaux encore plus attrayants avec leurs nouveaux réglages. Un nouveau style de contour est aussi disponible pour le nuage d’étiquettes.</li>\n</ul>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2022/05/Style-switcher-big.gif?fit=1204%2C700&amp;ssl=1\" alt=\"Style variations of Twenty Twenty Two theme\" class=\"wp-image-12893\" /></figure>\n\n\n\n<h4 class=\"wp-block-heading\">Changements de styles</h4>\n\n\n\n<p>Les thèmes basés sur des blocs permettent désormais de multiples variations de style. Cela étend le nouveau système de gestion des styles et ajoute des raccourcis permettant de changer l’affichage de votre site avec un seul et même thème. Vous pouvez modifier les réglages disponibles, tels que la graisse de la police et autres options de mise en forme comme la palette de couleurs disponible par défaut. Vous pouvez modifier le rendu de votre site en quelques clics seulement.</p>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://i2.wp.com/wordpress.org/news/files/2022/05/Expanded-templates.png?fit=1204%2C700&amp;ssl=1\" alt=\"Popover listing available templates\" class=\"wp-image-12889\" /></figure>\n\n\n\n<h4 class=\"wp-block-heading\">Plus de choix de modèles</h4>\n\n\n\n<p>WordPress 6.0 inclut cinq nouveaux modèles pour les thèmes basés sur des blocs&nbsp;: auteur/autrice, date, catégorie, étiquette et taxonomie. Ces modèles additionnels offrent encore plus de flexibilité pour créer du contenu. Adaptez-les avec les outils que vous connaissez déjà ou bien en utilisant les nouvelles fonctionnalités de cette version&nbsp;:</p>\n\n\n\n<ul>\n<li>Les images mises en avant peuvent être utilisées dans le bloc bannière.</li>\n\n\n\n<li>Les nouveaux contrôles de la taille des images mises en avant vous permettent d’obtenir exactement ce que vous souhaitez.</li>\n\n\n\n<li>Lorsque vous modifiez un modèle, l’outil d’insertion rapide vous affiche les compositions et les éléments de modèles qui vous aideront à travailler plus rapidement et à découvrir de nouvelles options de mise en page.</li>\n\n\n\n<li>Le bloc Boucle de requête prend en charge le filtrage en fonction de multiples auteurs ou autrices, en fonction de taxonomies personnalisées, ainsi que la personnalisation de ce qui est affiché lorsqu’aucune publication n’est trouvée.</li>\n</ul>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://i1.wp.com/wordpress.org/news/files/2022/05/Integrated-Patterns.png?fit=1204%2C700&amp;ssl=1\" alt=\"Browsing footer patterns in the quick inserter\" class=\"wp-image-12890\" /></figure>\n\n\n\n<h4 class=\"wp-block-heading\">Compositions intégrées</h4>\n\n\n\n<p>Les compositions s’affichent désormais là où vous en avez besoin, comme dans l’outil d’insertion rapide ou lors de la création d’un nouvel en-tête ou pied de page. Si vous créez des thèmes basés sur des blocs, vous pouvez même&nbsp;<a href=\"https://make.wordpress.org/core/2022/05/02/new-features-for-working-with-patterns-and-themes-in-wordpress-6-0/\">déclarer des compositions provenant du répertoire de compositions via le fichier&nbsp;<code>theme.json</code></a>, ce qui vous permet de prioriser les compositions qui vous semblent les plus utiles pour les personnes utilisant votre thème.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Une vue en liste améliorée</h4>\n\n\n\n<p>De nouveaux raccourcis clavier vous permettent de sélectionner plusieurs blocs dans la vue en liste, de les modifier en une fois et de les glisser-déposer dans la liste. La vue en liste peut maintenant être ouverte et fermée plus facilement. Au départ, elle est en affichage réduit puis elle s’étend automatiquement à la sélection actuelle lorsque que vous sélectionnez un bloc.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Verrouillage des blocs</h4>\n\n\n\n<p>Vous pouvez dorénavant verrouiller vos blocs, ce qui permet de désactiver la possibilité de les déplacer ou de les retirer. Cela facilite la gestion de projet pour les pros, en permettant à leurs clientèle d’exprimer leur créativité au sein d’un cadre limitant les risques de casser leur site.</p>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://i1.wp.com/wordpress.org/news/files/2022/05/Block-Locking-Controls.png?fit=1204%2C700&amp;ssl=1\" alt=\"Unlocking the block in the block toolbar\" class=\"wp-image-12892\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">De nouveaux outils de design</h3>\n\n\n\n<p>Les outils de design deviennent plus puissants et intuitifs à chaque nouvelle version.<br>Parmi les principaux changements de la version 6.0, on trouvera&nbsp;:</p>\n\n\n\n<ul>\n<li>Un nouveau panneau de gestion des couleurs qui économise de la place sur l’éditeur, tout en montrant toutes les options en un coup d’œil.</li>\n\n\n\n<li>Les nouveaux contrôles des bordures offrent une façon plus simple de définir les bordures de vos conteneurs.</li>\n\n\n\n<li>Les niveaux de transparence vous permettent des choix colorimétriques encore plus créatifs.</li>\n\n\n\n<li>Contrôlez les espacements, les marges ou la typographie de vos blocs en une fois via le bloc groupe.</li>\n\n\n\n<li>Basculez entre les variations «&nbsp;empilé&nbsp;», «&nbsp;en ligne&nbsp;» ou «&nbsp;groupé&nbsp;» pour positionner des groupes de blocs avec une plus grande flexibilité de mise en page.</li>\n\n\n\n<li>Utilisez la fonctionnalité de gestion des espacements du bloc galerie pour créer toute une variété de mises en page en faisant varier l’espacement entre les images, ou tout simplement en le supprimant.</li>\n</ul>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2022/05/List-view.png?fit=1204%2C700&amp;ssl=1\" alt=\"Selecting multiple blocks in the list view\" class=\"wp-image-12891\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">De meilleures performances</h3>\n\n\n\n<p>Cette version comprend plusieurs améliorations des performances de WordPress. Elles portent sur le chargement des publications, la réduction du temps d’exécution des requêtes, la mise en cache, le chargement des menus de navigation et bien plus encore. Notre équipe dédiée aux performances travaille au quotidien pour améliorer l&rsquo;expérience d&rsquo;utilisation de votre site WordPress.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Une meilleure accessibilité</h3>\n\n\n\n<p>Rendre le web plus accessible fait partie des missions du CMS WordPress. Cette nouvelle version comprend plus de 50 améliorations de l’accessibilité de WP.</p>\n\n\n\n<h2 class=\"wp-block-heading\">En savoir plus sur WordPress 6.0</h2>\n\n\n\n<p>Découvrez WordPress 6.0 en action&nbsp;! Notre&nbsp;<a href=\"https://www.youtube.com/watch?v=oe452WcY7fA\">vidéo de présentation</a>&nbsp;propose une vue d’ensemble des principales fonctionnalités qui sont arrivées avec WordPress 6.0.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\n<iframe loading=\"lazy\" class=\"youtube-player\" width=\"612\" height=\"345\" src=\"https://www.youtube.com/embed/oe452WcY7fA?version=3&#038;rel=1&#038;showsearch=0&#038;showinfo=1&#038;iv_load_policy=1&#038;fs=1&#038;hl=fr-FR&#038;autohide=2&#038;wmode=transparent\" allowfullscreen=\"true\" style=\"border:0;\" sandbox=\"allow-scripts allow-same-origin allow-popups allow-presentation\"></iframe>\n</div></figure>\n\n\n\n<p>Nous invitons les développeurs et développeuses à explorer <a href=\"https://make.wordpress.org/core/2022/05/03/wordpress-6-0-field-guide/\">le guide de changements techniques de WordPress&nbsp;6.0</a>.</p>\n\n\n\n<p>N’hésitez aussi pas à lire le <a href=\"https://wordpress.org/support/wordpress-version/version-6-0/\">journal de version de WordPress 6.0</a> pour plus d&rsquo;informations sur les fichiers créés, modifiés et supprimés dans cette version.</p>\n\n\n\n<h2 class=\"wp-block-heading\">L’équipe de direction de WP 6.0</h2>\n\n\n\n<ul>\n<li>Directeur de la version&nbsp;: <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a>&nbsp;</li>\n\n\n\n<li>Coordinateur·ice·s de la version&nbsp;: <a href=\"https://profiles.wordpress.org/priethor/\">Héctor Prieto</a> et <a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a></li>\n\n\n\n<li>Directeur technique Cœur&nbsp;: <a href=\"https://profiles.wordpress.org/peterwilsoncc/\">Peter Wilson</a></li>\n\n\n\n<li>Directeurs techniques Éditeur&nbsp;: <a href=\"https://profiles.wordpress.org/zieladam/\">Adam Zieliński</a> et <a href=\"https://profiles.wordpress.org/gziolo/\">Greg Ziółkowski</a></li>\n\n\n\n<li>Responsables de projet Cœur&nbsp;: <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Chaion</a> et <a href=\"https://profiles.wordpress.org/costdev/\">Colin Stewart</a></li>\n\n\n\n<li>Responsable de projet Éditeur&nbsp;: <a href=\"https://profiles.wordpress.org/ndiego/\">Nick Diego</a></li>\n\n\n\n<li>Directeur·ice·s de la documentation&nbsp;: <a href=\"https://profiles.wordpress.org/bph/\">Birgit Pauli-Haack</a>, <a href=\"https://profiles.wordpress.org/milana_cap/\">Milana Cap</a> et <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a></li>\n\n\n\n<li>Responsable de la communication&nbsp;: <a href=\"https://profiles.wordpress.org/dansoschin/\">Dan Soschin</a></li>\n\n\n\n<li>Responsable des tests&nbsp;: <a href=\"https://profiles.wordpress.org/boniu91/\">Piotrek Boniu</a> et <a href=\"https://profiles.wordpress.org/ironprogrammer/\">Brian Alexander</a></li>\n\n\n\n<li>Responsable du design&nbsp;: <a href=\"https://profiles.wordpress.org/critterverse/\">Channing Ritter</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Merci aux plus de 500 contributeurs et contributrices&nbsp;!</h2>\n\n\n\n<p>La livraison de WordPress 6.0 n’aurait jamais été possible sans la participation de ces personnes provenant de plus de 58 pays différents&nbsp;!</p>\n\n\n\n<p><small><a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a> · <a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">Aaron Robertshaw</a> · <a href=\"https://profiles.wordpress.org/abdullahramzan/\">Abdullah Ramzan</a> · <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a> · <a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a> · <a href=\"https://profiles.wordpress.org/zieladam/\">Adam Zielinski</a> · <a href=\"https://profiles.wordpress.org/adi64bit/\">adi64bit</a> · <a href=\"https://profiles.wordpress.org/aadilali/\">Adil Ali</a> · <a href=\"https://profiles.wordpress.org/agepcom/\">agepcom</a> · <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Chaion</a> · <a href=\"https://profiles.wordpress.org/wildworks/\">Aki Hamano</a> · <a href=\"https://profiles.wordpress.org/atachibana/\">Akira Tachibana</a> · <a href=\"https://p