ranslationsorg\">WP-Translations</a> et&nbsp;<a href=\"https://profiles.wordpress.org/wplmillet\">wplmillet</a>.</p>\n\n\n\n<p class=\"has-text-align-right\"><small>Merci à <a href=\'https://profiles.wordpress.org/fxbenard/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>fxbenard</a> <a href=\'https://profiles.wordpress.org/wolforg/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>wolforg</a> et <a href=\'https://profiles.wordpress.org/em-m/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>em-m</a> pour la relecture de communiqué</small></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://fr.wordpress.org/2022/05/25/wordpress-6-0-arturo/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Guide des changements techniques de WordPress 6.0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://fr.wordpress.org/2022/05/04/guide-des-changements-techniques-de-wordpress-6-0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://fr.wordpress.org/2022/05/04/guide-des-changements-techniques-de-wordpress-6-0/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 May 2022 12:16:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2369\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:349:\"Maintenant que la première version Release Candidate de WordPress 6.0 est sortie, il est grand temps d&#8217;explorer les modifications apportées par cette future version, dont la sortie est prévue pour le 24 mai 2022. WordPress 6.0 est une version majeure de même niveau que WP 5.8 ou WP 5.9. Elle apportera le principe des variations [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:38078:\"\n<p>Maintenant que la première version <em>Release Candidate</em> de WordPress 6.0 est sortie, il est grand temps d&rsquo;explorer les modifications apportées par cette future version, dont la sortie est prévue pour le 24 mai 2022. WordPress 6.0 est une version majeure de même niveau que WP 5.8 ou WP 5.9. Elle apportera le principe des variations de styles, l’interface de verrouillage des blocs, plusieurs améliorations de l&rsquo;éditeur, encore plus d’outils de design, de nouveaux crochets et filtres, des mises à jour des différentes bibliothèques utilisées par WP, et bien plus encore&nbsp;!</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2022/05/wordpress-60-provisoire.png\"><img decoding=\"async\" loading=\"lazy\" width=\"1024\" height=\"702\" src=\"https://fr.wordpress.org/files/2022/05/wordpress-60-provisoire-1024x702.png\" alt=\"\" class=\"wp-image-2376\" srcset=\"https://fr.wordpress.org/files/2022/05/wordpress-60-provisoire-1024x702.png 1024w, https://fr.wordpress.org/files/2022/05/wordpress-60-provisoire-300x206.png 300w, https://fr.wordpress.org/files/2022/05/wordpress-60-provisoire-768x527.png 768w, https://fr.wordpress.org/files/2022/05/wordpress-60-provisoire.png 1446w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<span id=\"more-2369\"></span>\n\n\n\n<p>Au bas mot, ce seront au moins <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=6.0&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">97 améliorations et nouvelles fonctionnalités</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=6.0&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">131 corrections de bogues</a>, <a href=\"https://core.trac.wordpress.org/ticket/55567\">13 correctifs sur l’éditeur de bloc</a>, ainsi que <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=6.0&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">23 autres changements divers</a>, ce qui représente au total <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=6.0&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">231 tickets Trac</a>.</p>\n\n\n\n<p>La nouvelle équipe chargée des performances de WordPress a aussi travaillé dur pour améliorer diverses parties du CMS. De nombreuses requêtes ont été optimisées et certaines d&rsquo;entre elles ont été retirées, la gestion du cache a été perfectionnée, et de nombreux doublons de traductions ont été enlevés afin d&rsquo;améliorer la vitesse de chargement de WP sur les installations non anglophones.</p>\n\n\n\n<p class=\"is-style-plain has-medium-font-size\">C&rsquo;est parti pour un petit tour d’horizon des nouveautés de WordPress 6.0&nbsp;!</p>\n\n\n\n<p>Tous les liens de cet article pointent vers des notes de développement rédigées en anglais. L&rsquo;objectif est de fournir un panorama général des changements techniques apportés par cette version, en français.</p>\n\n\n\n<p class=\"has-text-color has-background\" style=\"color:#03517f;background-color:#cceaff\">À noter&nbsp;: certaines modifications listées ici vont nécessiter des actions des auteurs et autrices de thèmes et d’extensions, qui devront adapter ou modifier leur code. Si vous êtes concerné·e, veuillez lire les notes de développement listées dans cet article consciencieusement afin de vous assurer que votre code fonctionnera avec WordPress 6.0 lorsque cette version sortira le 24 mai 2022.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Accessibilité</h2>\n\n\n\n<p>De même que pour les performances, l’accessibilité de WordPress a été grandement améliorée. La note de développement suivante détaille les différentes améliorations effectuées.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"aylbLUKVvp\"><a href=\"https://make.wordpress.org/core/2022/04/20/wordpress-6-0-accessibility-improvements/\">WordPress 6.0 Accessibility Improvements</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 6.0 Accessibility Improvements&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/04/20/wordpress-6-0-accessibility-improvements/embed/#?secret=1ZIEsiLvDE#?secret=aylbLUKVvp\" data-secret=\"aylbLUKVvp\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">L’éditeur de blocs</h2>\n\n\n\n<p>L’éditeur a bien entendu reçu de nombreuses améliorations&nbsp;:</p>\n\n\n\n<ul>\n<li>Possibilité de construire de multiples variations de styles pour les thèmes basés sur des blocs&nbsp;;</li>\n\n\n\n<li>Possibilité de créer des compositions de contenu de pages que les rédacteurs et rédactrices pourront utiliser ou non pour construire leurs pages de contenu&nbsp;;</li>\n\n\n\n<li>Nouvelle propriété <code>ancestor</code> dans le fichier <code>block.json</code> afin de permettre la restriction des endroits où les rédacteurs et rédactrices peuvent placer leurs blocs&nbsp;;</li>\n\n\n\n<li>Une nouvelle interface de verrouillage des blocs à l&rsquo;aide de l&rsquo;attribut <code>lock</code>&nbsp;;</li>\n\n\n\n<li>Déclaration et enregistrement de blocs au sein des thèmes&nbsp;;</li>\n\n\n\n<li>Amélioration de la préservation des contenus non reconnus comme des blocs dans l’éditeur&nbsp;;</li>\n\n\n\n<li>Une fonctionnalité d&rsquo;exportation des blocs des thèmes plus robuste au sein de l’éditeur&nbsp;;</li>\n\n\n\n<li>Des mises à jour du balisage des blocs image, citation, liste et groupe&nbsp;;</li>\n\n\n\n<li>De nouveaux blocs tels que le bloc de commentaires de la publication, le bloc «&nbsp;Aucun résultat&nbsp;», et bien plus encore…</li>\n</ul>\n\n\n\n<p>À noter que si vous utilisez la version <em>extension</em> de Gutenberg (ce qui ne devrait être le cas que sur un site destiné à des expérimentations), vous devrez impérativement la mettre à jour vers sa toute dernière version <em>avant</em> de mettre à jour votre site avec la version 6.0 de WordPress.</p>\n\n\n\n<p>Sans plus attendre, voici les notes de développement liées à l’éditeur&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"O4MaN7Al9W\"><a href=\"https://make.wordpress.org/core/2022/05/03/page-creation-patterns-in-wordpress-6-0/\">Page creation patterns in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Page creation patterns in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/03/page-creation-patterns-in-wordpress-6-0/embed/#?secret=Vva1kiTUdO#?secret=O4MaN7Al9W\" data-secret=\"O4MaN7Al9W\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"yNgdvwFZyq\"><a href=\"https://make.wordpress.org/core/2022/05/03/global-styles-variations-in-wordpress-6-0/\">Global Styles variations in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Global Styles variations in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/03/global-styles-variations-in-wordpress-6-0/embed/#?secret=LouvK1NNRH#?secret=yNgdvwFZyq\" data-secret=\"yNgdvwFZyq\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"gEKvxlYKbw\"><a href=\"https://make.wordpress.org/core/2022/05/03/support-for-handling-resolution-errors-for-editor-data-module/\">Support for handling resolution errors for Editor data module</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Support for handling resolution errors for Editor data module&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/03/support-for-handling-resolution-errors-for-editor-data-module/embed/#?secret=ok7NQ4NnkH#?secret=gEKvxlYKbw\" data-secret=\"gEKvxlYKbw\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"yzhtIAVRNf\"><a href=\"https://make.wordpress.org/core/2022/05/03/block-markup-updates-for-image-quote-list-and-group-blocks/\">Block markup updates for image, quote, list and group blocks</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block markup updates for image, quote, list and group blocks&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/03/block-markup-updates-for-image-quote-list-and-group-blocks/embed/#?secret=udFFQ8yHBA#?secret=yzhtIAVRNf\" data-secret=\"yzhtIAVRNf\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"kC6j5E5zKf\"><a href=\"https://make.wordpress.org/core/2022/05/03/separator-block-updated-to-use-block-supports-color-settings/\">Separator block: Updated to use block supports color settings</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Separator block: Updated to use block supports color settings&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/03/separator-block-updated-to-use-block-supports-color-settings/embed/#?secret=EVWwVqSsK8#?secret=kC6j5E5zKf\" data-secret=\"kC6j5E5zKf\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"e8Tty8IzRp\"><a href=\"https://make.wordpress.org/core/2022/05/03/block-editor-miscellaneous-dev-notes-for-wordpress-6-0/\">Block Editor miscellaneous Dev Notes for WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block Editor miscellaneous Dev Notes for WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/03/block-editor-miscellaneous-dev-notes-for-wordpress-6-0/embed/#?secret=5wJqoOGfuk#?secret=e8Tty8IzRp\" data-secret=\"e8Tty8IzRp\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Processus de chargement de WordPress</h2>\n\n\n\n<p>Entre autres améliorations concernant les performances du logiciel, le processus de chargement de WordPress (le «&nbsp;bootstrap&nbsp;») a été amélioré afin de permettre aux développeurs et développeuses d’ignorer les requêtes non nécessaires avec le filtre <code>do_parse_request</code>.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"QGN6nyDZZx\"><a href=\"https://make.wordpress.org/core/2022/04/27/changes-to-do_parse_request-filter-in-wordpress-6-0/\">Changes to do_parse_request filter in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Changes to do_parse_request filter in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/04/27/changes-to-do_parse_request-filter-in-wordpress-6-0/embed/#?secret=JGyFNpM8Vw#?secret=QGN6nyDZZx\" data-secret=\"QGN6nyDZZx\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">API de gestion du cache</h2>\n\n\n\n<p>Avec WordPress 6.0, l’API <code>wp_cache_*_multiple</code> devient une API complètement CRUD (voir le <a href=\"https://fr.wikipedia.org/wiki/CRUD\">terme «&nbsp;CRUD&nbsp;» sur Wikipédia</a>). Par ailleurs, une option permettant de réinitialiser le temps d’exécution du cache sans réinitialiser l&rsquo;entièreté du cache persistant a été ajoutée.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"HixiB7GUbB\"><a href=\"https://make.wordpress.org/core/2022/04/29/caching-improvements-in-wordpress-6-0/\">Caching improvements in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Caching improvements in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/04/29/caching-improvements-in-wordpress-6-0/embed/#?secret=eSHwD0gV8N#?secret=HixiB7GUbB\" data-secret=\"HixiB7GUbB\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Médias</h2>\n\n\n\n<p>La gestion des médias a elle aussi reçu de nouveaux filtres et plusieurs améliorations d’interface&nbsp;:</p>\n\n\n\n<ul>\n<li>Activation de la modification des tailles d’images personnalisées à l’aide du filtre&nbsp;<code>edit_custom_thumbnail_sizes</code>&nbsp;qui permet aux développeuses et développeurs de modifier les tailles d’images personnalisées individuelles (<a href=\"https://core.trac.wordpress.org/ticket/28277\">Voir le ticket #28277</a>)&nbsp;;</li>\n\n\n\n<li>&nbsp;Ajout d’une fonction «&nbsp;copier l’URL dans le presse-papier&nbsp;» sur la vue en liste des médias (<a href=\"https://core.trac.wordpress.org/ticket/54426\">Voir le ticket #54426</a>).</li>\n</ul>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"yxx2tJKflU\"><a href=\"https://make.wordpress.org/core/2022/04/27/new-filter-to-modify-content-images-in-wordpress-6-0/\">New filter to modify content images in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New filter to modify content images in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/04/27/new-filter-to-modify-content-images-in-wordpress-6-0/embed/#?secret=8kaC2NHwuW#?secret=yxx2tJKflU\" data-secret=\"yxx2tJKflU\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Le composant Médias a par ailleurs lui aussi reçu des améliorations de performances&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"rzdrAmmrI6\"><a href=\"https://make.wordpress.org/core/2022/05/02/media-storing-file-size-as-part-of-metadata/\">Media: storing file size as part of metadata</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Media: storing file size as part of metadata&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/02/media-storing-file-size-as-part-of-metadata/embed/#?secret=7VfVtwQN76#?secret=rzdrAmmrI6\" data-secret=\"rzdrAmmrI6\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Types de publications</h2>\n\n\n\n<p>WordPress 6.0 introduit encore davantage de crochets et filtres dynamiques pour les types de publications et les taxonomies.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"WJDM87k4sz\"><a href=\"https://make.wordpress.org/core/2022/05/02/object-type-specific-registration-hooks-in-6-0/\">Object type specific registration hooks in 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Object type specific registration hooks in 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/02/object-type-specific-registration-hooks-in-6-0/embed/#?secret=wYXFAV3b98#?secret=WJDM87k4sz\" data-secret=\"WJDM87k4sz\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Taxonomies</h2>\n\n\n\n<p>Les taxonomies ont reçues des améliorations de performances, notamment à travers la mise en cache des requêtes sur les termes de taxonomies, et via l’ajout de limites aux requêtes concernant les taxonomies, mais aussi au niveau des éléments de menus de navigation.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"VtwOOxjJuQ\"><a href=\"https://make.wordpress.org/core/2022/04/28/taxonomy-performance-improvements-in-wordpress-6-0/\">Taxonomy performance improvements in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Taxonomy performance improvements in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/04/28/taxonomy-performance-improvements-in-wordpress-6-0/embed/#?secret=90lFxU7Wbk#?secret=VtwOOxjJuQ\" data-secret=\"VtwOOxjJuQ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Thèmes</h2>\n\n\n\n<p>Cette nouvelle version offre aux auteurs et autrices de thèmes une façon encore plus efficace de travailler avec les compositions de blocs, la prise en charge de multiples fichiers <code>theme.json</code> avec l’éditeur de site, et bien plus encore.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"pTkwNLfniL\"><a href=\"https://make.wordpress.org/core/2022/05/02/new-features-for-working-with-patterns-and-themes-in-wordpress-6-0/\">New features for working with patterns and themes in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New features for working with patterns and themes in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/02/new-features-for-working-with-patterns-and-themes-in-wordpress-6-0/embed/#?secret=z1ichmCsB3#?secret=pTkwNLfniL\" data-secret=\"pTkwNLfniL\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ZTyMFeyCFv\"><a href=\"https://make.wordpress.org/core/2022/05/02/theme-export-in-wordpress-6-0/\">Theme export in WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Theme export in WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/02/theme-export-in-wordpress-6-0/embed/#?secret=AIOHcWsoD9#?secret=ZTyMFeyCFv\" data-secret=\"ZTyMFeyCFv\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Les thèmes basés sur des blocs peuvent maintenant se passer du fichier&nbsp;index.php</h3>\n\n\n\n<p>Avec cette modification, il n&rsquo;est maintenant plus nécessaire d&rsquo;avoir un fichier modèle&nbsp;<code>index.php</code>. Jusqu&rsquo;à présent, il était nécessaire d&rsquo;en avoir un même s&rsquo;il n&rsquo;était pas utilisé. Dorénavant, ce fichier est remplacé par le fichier&nbsp;<code>templates/index.html</code>. <a href=\"https://core.trac.wordpress.org/ticket/54272\">Voir le ticket #54272</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Correction de la logique d’affichage des avertissements&nbsp;_doing_it_wrong()&nbsp;pour&nbsp;add_theme_support( &lsquo;html5&rsquo; )</h3>\n\n\n\n<ul>\n<li>Le fait d’appeler&nbsp;<code>add_theme_support( \'html5\' )</code>&nbsp;sans passer un tableau de types pris en charges affiche maintenant un avertissement&nbsp;<code>_doing_it_wrong()</code>&nbsp;: «&nbsp;Vous devez passer un tableau de types&nbsp;» ;</li>\n\n\n\n<li>Si le second paramètre n’est pas spécifié, un tableau contenant&nbsp;<code>comment-list</code>,&nbsp;<code>comment-form</code>, et&nbsp;<code>search-form</code>&nbsp;sera automatiquement passé en tant que solution de repli, pour assurer la rétrocompatibilité de la fonction&nbsp;;</li>\n\n\n\n<li>Si le second paramètre n’est pas un tableau, la fonction retournera&nbsp;<code>false</code>.</li>\n</ul>\n\n\n\n<p>Pour plus d&rsquo;informations, <a href=\"https://core.trac.wordpress.org/ticket/51657\">voir le ticket #51657</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Comptes</h2>\n\n\n\n<p>Avec WP 6.0, les installations comprenant plus de 10&nbsp;000 comptes ont reçu des améliorations de performances sur les requêtes concernant les comptes.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"BHtC3yStBd\"><a href=\"https://make.wordpress.org/core/2022/04/29/wp_user_query-now-accepts-fields-options-in-wordpress-6-0/\">WP_User_Query now accepts fields options in WordPress 6.0 </a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WP_User_Query now accepts fields options in WordPress 6.0 &#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/04/29/wp_user_query-now-accepts-fields-options-in-wordpress-6-0/embed/#?secret=YDNq2zqbDE#?secret=BHtC3yStBd\" data-secret=\"BHtC3yStBd\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"WrP1XxUcf7\"><a href=\"https://make.wordpress.org/core/2022/05/02/performance-increase-for-sites-with-large-user-counts-now-also-available-on-single-site/\">Performance increase for sites with large user counts (now also available on single site)</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Performance increase for sites with large user counts (now also available on single site)&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/02/performance-increase-for-sites-with-large-user-counts-now-also-available-on-single-site/embed/#?secret=xdlkVPVFnI#?secret=WrP1XxUcf7\" data-secret=\"WrP1XxUcf7\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Autres changements techniques</h2>\n\n\n\n<p>WordPress 6.0 apporte également&nbsp;: </p>\n\n\n\n<ul>\n<li>Un filtre destiné aux auteurs et autrices d’extensions qui leur permet de modifier la description de leur extension telle qu’elle est affichée sur l&rsquo;écran <strong>Extensions &gt; Ajouter</strong> et/ou sur l&rsquo;écran&nbsp;<strong>Administration du réseau&nbsp;&gt; Extensions &gt; Ajouter</strong>&nbsp;;</li>\n\n\n\n<li>La possibilité de filtrer l’ensemble de la notification e-mail envoyée par <code>retrieve_password</code>&nbsp;;</li>\n\n\n\n<li>La possibilité de retirer les icônes de sites sur les réseaux multisites.</li>\n</ul>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ET2xV9XcVa\"><a href=\"https://make.wordpress.org/core/2022/05/03/miscellaneous-dev-notes-for-wordpress-6-0/\">Miscellaneous Dev Notes for WordPress 6.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous Dev Notes for WordPress 6.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/05/03/miscellaneous-dev-notes-for-wordpress-6-0/embed/#?secret=Z0RAvcrbpa#?secret=ET2xV9XcVa\" data-secret=\"ET2xV9XcVa\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Et bien plus encore…</h2>\n\n\n\n<p>Plus de&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=6.0&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">131 corrections de bugs</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=6.0&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">97 améliorations et nouvelles fonctionnalité</a>, ainsi que&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=6.0&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">23 tâches diverses</a>&nbsp;ont été&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=6.0&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">ajoutés dans WordPress 6.0</a>.</p>\n\n\n\n<p>Voici quelques modifications qui méritent d’être soulignées&nbsp;:</p>\n\n\n\n<ul>\n<li><strong>Administration&nbsp;:</strong> ajout d’un filtre&nbsp;<code>media_date_column_time</code>&nbsp;à la colonne de date de l&rsquo;écran de liste des médias. De façon similaire au filtre existant <code>post_date_column_time</code>&nbsp;pour les publications, ce filtre permet de modifier l’affichage du contenu de la colonne «&nbsp;Date&nbsp;» (<a href=\"https://core.trac.wordpress.org/ticket/42942\">voir le ticket #42942</a>)&nbsp;;</li>\n\n\n\n<li><strong>Outils de <em>build</em> et de tests&nbsp;:</strong>\n<ul>\n<li>Mise à jour de webpack vers la version v5.x. Cela rapproche WordPress de la façon dont l’extension Gutenberg gère ses paquets&nbsp;;</li>\n\n\n\n<li>WordPress 6.0 active également la prise en charge de <em>«&nbsp;React Fast Refresh&nbsp;»</em> pour le développement de blocs avec <code>@wordpress/scripts</code>&nbsp;;</li>\n\n\n\n<li>Cette nouvelle version ajoute aussi la dernière version de&nbsp;<code>caniuse-lite</code>&nbsp;qui permet de s’assurer que les outils de <em>build</em> de WP ciblent la dernière version des navigateurs pris en charge par WordPress (voir les tickets <a href=\"https://core.trac.wordpress.org/ticket/51750\">#51750</a> et <a href=\"https://core.trac.wordpress.org/ticket/55505\">#55505</a>)&nbsp;;</li>\n\n\n\n<li>Un fichier <code>.git-blame-ignore-revs</code> a été ajouté au répertoire de développement de WP afin de rendre la fonctionnalité <code>git blame</code> plus efficace sur GitHub (<a href=\"https://core.trac.wordpress.org/ticket/55422\">voir le ticket #55422</a>)&nbsp;;</li>\n\n\n\n<li>La commande <code>npm install</code> a été corrigée pour les contributeurs et contributrices utilisant des appareils <em>«&nbsp;Apple M series silicone&nbsp;»</em> en mettant à jour la dépendance technique <code>grunt-contrib-qunit</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/52690\">voir le ticket #52690</a>)&nbsp;;</li>\n</ul>\n</li>\n\n\n\n<li><strong>Thèmes natifs&nbsp;:</strong> si vous rencontriez des soucis avec l’ordre des éléments dans le formulaire de commentaires du thème Twenty Nineteen, nous avons une bonne nouvelle&nbsp;: ceci a été corrigé dans le ticket <a href=\"https://core.trac.wordpress.org/ticket/46600\">#46600</a>&nbsp;; </li>\n\n\n\n<li><strong>URL canoniques&nbsp;:</strong> la fonction <code>redirect_guess_404_permalink()</code> inclue maintenant tous les états publics des publications, et pas uniquement l’état «&nbsp;publié&nbsp;» / <code>publish</code>, dans les redirections 404 de recherche (<a href=\"https://core.trac.wordpress.org/ticket/47911\">voir le ticket #47911</a>)&nbsp;;</li>\n\n\n\n<li><strong>Commentaires&nbsp;:</strong>&nbsp;accélération du chargement SQL du tableau de bord et de la modération des commentaires (<a href=\"https://core.trac.wordpress.org/ticket/19901\">voir le ticket #19901</a>)&nbsp;;</li>\n\n\n\n<li><strong>Emojis :</strong> mise à jour de la bibliothèque Twemoji vers la version 14.0.2. Cette version introduit la prise en charge des derniers Emojis ajoutés dans la version 14 (<a href=\"https://core.trac.wordpress.org/ticket/55395\">voir le ticket #55395</a>)&nbsp;;</li>\n\n\n\n<li><strong>Bibliothèques externes&nbsp;:</strong>\n<ul>\n<li>Mise à jour de Jcrop à la version 0.9.15 (<a href=\"https://core.trac.wordpress.org/ticket/54035\">ticket #54035</a>)&nbsp;;</li>\n\n\n\n<li>Mise à jour de jQuery Color à la version 2.2.0. Suppression de la version embarquée (qui existait toujours dans le cœur WP) en faveur de l&rsquo;amélioration du processus Grunt pour plutôt inclure le paquet depuis NPM (<a href=\"https://core.trac.wordpress.org/ticket/55016\">ticket #55016</a>)&nbsp;;</li>\n\n\n\n<li>Mise à jour de <code>random_compat</code> à la version 2.0.21. Cela améliore la compatibilité avec PHP 8.1 et corrige des bogues avec les plateformes Windows (<a href=\"https://core.trac.wordpress.org/ticket/55181\">ticket #55181</a>) ;</li>\n\n\n\n<li>Mise à niveau de PHPMailer à la version 6.5.4. Amélioration de compatibilité PHP et sécurisation contre les hébergeurs désactivant certaines fonctions de sécurité. <strong>Note aux hébergeurs&nbsp;: ne désactivez pas les fonctions&nbsp;<code>escapeshellarg()</code>&nbsp;et&nbsp;<code>escapeshellcmd()</code>, cela présente un risque de sécurité&nbsp;!</strong> (<a href=\"https://core.trac.wordpress.org/ticket/55187\">ticket #55187</a>)&nbsp;;</li>\n\n\n\n<li>Mise à niveau de PHPMailer à la version 6.6.0 (<a href=\"https://core.trac.wordpress.org/ticket/55277\">ticket #55277</a>)&nbsp;;</li>\n\n\n\n<li>Mise à jour de sodium_compat à la version 1.17.1. Amélioration de la compatibilité PHP 8.1 (<a href=\"https://core.trac.wordpress.org/ticket/55453\">ticket #55453</a>)</li>\n\n\n\n<li>Mise à jour de <code>backbone</code>&nbsp;de la version&nbsp;<code>1.4.0</code>&nbsp;à la version&nbsp;<code>1.4.1</code>&nbsp;;</li>\n\n\n\n<li>Mise à jour de <code>underscore</code>&nbsp;de la version&nbsp;<code>1.13.1</code>&nbsp;à la version&nbsp;<code>1.13.2</code>&nbsp;;</li>\n\n\n\n<li>Mise à jour de <code>clipboard</code>&nbsp;de la version&nbsp;<code>2.0.8</code>&nbsp;à la version&nbsp;<code>2.0.10</code> (<a href=\"https://core.trac.wordpress.org/ticket/55547\">ticket #55547</a>)&nbsp;;</li>\n</ul>\n</li>\n\n\n\n<li><strong>Formatage :</strong>\n<ul>\n<li>Ajout de la prise en charge des formatage de tailles PB, EB, ZB, and YB (<a href=\"https://core.trac.wordpress.org/ticket/40875\">ticket #40875</a>)</li>\n</ul>\n</li>\n\n\n\n<li><strong>KSES&nbsp;:</strong>\n<ul>\n<li>Prise en charge de l&rsquo;élément&nbsp;<code>&lt;ruby&gt;</code>&nbsp;et des autres éléments liés. Cela est particulièrement utile pour le contenu écrit en japonais ou chinois, via les éléments HTML&nbsp;<code>&lt;ruby&gt;</code>,&nbsp;<code>&lt;rt&gt;</code> et&nbsp;<code>&lt;rp&gt;</code>&nbsp;dans le&nbsp;<a href=\"https://html.spec.whatwg.org/multipage/text-level-semantics.html#the-ruby-element\">standard HTML</a>, ainsi que&nbsp;<code>&lt;rb&gt;</code>&nbsp;et&nbsp;<code>&lt;rtc&gt;</code>&nbsp;pour des options de formatage avancées (<a href=\"https://core.trac.wordpress.org/ticket/54698\">ticket #54698</a>)&nbsp;;</li>\n\n\n\n<li>Ajout global de la prise en charge des attributs&nbsp;<code>lang</code>,&nbsp;<code>xml:lang</code>,&nbsp;<code>dir</code>&nbsp;en tant qu’attributs utilisables sur n&rsquo;importe quel élément HTML, ce qui améliore considérablement les possibilités de produire du contenu accessible (<a href=\"https://core.trac.wordpress.org/ticket/54699\">ticket #54699</a>)&nbsp;;</li>\n\n\n\n<li>La fonction <code>get_the_author_link()</code> devient filtrable sur WordPress 6.0, via le filtre <code>get_the_author_link</code>, afin de permettre l&rsquo;altération de l’affichage du lien vers l’auteur/autrice de chaque publication (<a href=\"https://core.trac.wordpress.org/ticket/51859\">ticket #51859</a>)&nbsp;;</li>\n</ul>\n</li>\n\n\n\n<li><strong>Internationnalisation&nbsp;:</strong>\n<ul>\n<li>Le séparateur des éléments de liste est maintenant une propriété de <code>WP_Locale</code> (<a href=\"https://core.trac.wordpress.org/ticket/39733\">voir le ticket #39733</a>)&nbsp;;</li>\n\n\n\n<li>Les chemins de langues sont maintenant définissables dans la fonction  <code>register_block_type</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/54797\">ticket #54797</a>)&nbsp;;</li>\n</ul>\n</li>\n\n\n\n<li><strong>Médias&nbsp;:</strong> suppression du filtre&nbsp;<code>attachment_fields_to_save</code>&nbsp;filter et dépréciation de la fonction&nbsp;<code>image_attachment_fields_to_save()</code>. Cette fonction n’était plus utilisée par le cœur WP&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/39108\">ticket #39108</a>)&nbsp;;</li>\n\n\n\n<li><strong>Réseaux multisites&nbsp;:</strong> amélioration de la génération du cache des clés sur <code>WP_Site_Query</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/55462\">ticket #55462</a>)&nbsp;;</li>\n\n\n\n<li><strong>Extensions&nbsp;:</strong>\n<ul>\n<li>Ajout du filtre&nbsp;<code>plugin_install_description</code> (<a href=\"https://core.trac.wordpress.org/ticket/55480\">ticket #55480</a>)</li>\n\n\n\n<li>Conversion de&nbsp;<code>apply_filters()</code>&nbsp;en une vraie fonction variadique. Une fonction variadique est une fonction d&rsquo;arité indéfinie, c&rsquo;est-à-dire qu&rsquo;elle accepte un nombre variable de paramètres (<a href=\"https://core.trac.wordpress.org/ticket/53218\">voir le ticket #53218</a>)&nbsp;;</li>\n</ul>\n</li>\n\n\n\n<li><strong>Publications et types de publications&nbsp;:</strong> passage du paramètre <code>$update</code>&nbsp;aux filtres <code>wp_insert_post_data</code>&nbsp;et&nbsp;<code>wp_insert_attachment_data</code>. Cela facilite la détermination de l&rsquo;existence d&rsquo;une publication lors de sa mise à jour (<a href=\"https://core.trac.wordpress.org/ticket/46228\">ticket #46228</a>)&nbsp;;</li>\n\n\n\n<li><strong>Taxonomies :</strong> mutualisation de la traduction des libellés de taxonomies afin d&rsquo;améliorer les performances générales de l&rsquo;administration WordPress&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/26746\">ticket #26746</a>).</li>\n</ul>\n\n\n\n<p>Que vous développiez des thèmes ou des extensions, pensez à tester et retester votre code pour vous assurer de sa compatibilité avec ces changements. Vous pouvez utiliser&nbsp;<a rel=\"noreferrer noopener\" href=\"https://wordpress.org/plugins/wordpress-beta-tester/\" target=\"_blank\">l’extension Beta Tester</a>&nbsp;sur un site de test pour vérifier la compatibilité de vos développements avec WordPress 6.0 RC1.&nbsp;Nous comptons sur vous pour vous assurer que votre code fonctionne correctement avec le cœur du CMS, pour le bien des millions d’utilisateurs et utilisatrices de WordPress&nbsp;<img src=\"https://s.w.org/images/core/emoji/14.0.0/72x72/2665.png\" alt=\"♥\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p class=\"has-small-font-size\"><em>Rédigé par <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a> d&rsquo;après le <a href=\"https://make.wordpress.org/core/2022/05/03/wordpress-6-0-field-guide/\">Field Guide en anglais</a>. Merci à <a href=\"https://profiles.wordpress.org/valer1e/\">Valérie Galassi</a>, <a href=\"https://profiles.wordpress.org/fxbenard/\">FX Bénard</a> et <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a> pour la relecture.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://fr.wordpress.org/2022/05/04/guide-des-changements-techniques-de-wordpress-6-0/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"WordPress 5.9 « Joséphine »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://fr.wordpress.org/2022/01/25/wordpress-5-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://fr.wordpress.org/2022/01/25/wordpress-5-9/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Jan 2022 21:05:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2330\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:450:\"Bienvenue sur WordPress 5.9 «&#160;Joséphine&#160;»&#160;! Nous vous présentons WordPress 5.9, nommée «&#160;Joséphine&#160;» en l’honneur de la chanteuse internationale de jazz Joséphine Baker. Vous pouvez&#160;télécharger cette version ici&#160;ou effectuer la mise à jour directement depuis votre tableau de bord. En tant que militante des droits civiques depuis toujours, Joséphine Baker pensait que tout le monde pouvait [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:62335:\"\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" loading=\"lazy\" width=\"1024\" height=\"682\" src=\"https://fr.wordpress.org/files/2022/01/5-9-josephine-1024x682.png\" alt=\"\" class=\"wp-image-2341\" srcset=\"https://fr.wordpress.org/files/2022/01/5-9-josephine-1024x682.png 1024w, https://fr.wordpress.org/files/2022/01/5-9-josephine-300x200.png 300w, https://fr.wordpress.org/files/2022/01/5-9-josephine-768x512.png 768w, https://fr.wordpress.org/files/2022/01/5-9-josephine.png 1264w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"bienvenue-sur-wordpress-5-9-josephine\">Bienvenue sur WordPress 5.9 «&nbsp;Joséphine&nbsp;»&nbsp;!</h2>\n\n\n\n<p>Nous vous présentons WordPress 5.9, nommée «&nbsp;Joséphine&nbsp;» en l’honneur de la chanteuse internationale de jazz Joséphine Baker. Vous pouvez&nbsp;<a href=\"https://wordpress.org/download/\">télécharger cette version ici</a>&nbsp;ou effectuer la mise à jour directement depuis votre tableau de bord.</p>\n\n\n\n<p>En tant que militante des droits civiques depuis toujours, Joséphine Baker pensait que tout le monde pouvait vivre en harmonie ensemble, tout comme les différents instruments d&rsquo;un groupe de jazz se mélangent pour former un morceau complet. Mentionnons également que Joséphine Baker était naturalisée française et est d&rsquo;ailleurs entrée au Panthéon l’année dernière, en 2021.</p>\n\n\n\n<p>Activez donc une liste de lecture de votre service de musique préféré et profitez de ses célèbres interprétations de <em>« You are the greatest love »</em>, <em>« Sans Amour »</em> et <em>« Love is a dreamer »</em> tout en découvrant les fonctionnalités de cette toute nouvelle version de WordPress.</p>\n\n\n\n<span id=\"more-2330\"></span>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2 class=\"wp-block-heading\" id=\"l-edition-complete-de-votre-site-est-la\">L’édition complète de votre site est là.</h2>\n\n\n\n<p>Cela vous donne le contrôle sur l’ensemble de votre site, directement depuis votre administration WordPress.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/01/5-9-release-1.png\" alt=\"\" class=\"wp-image-12101\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"decouvrez-twenty-twenty-two\">Découvrez Twenty Twenty-Two</h3>\n\n\n\n<p>Et saluez l’arrivée du premier thème natif basé sur des blocs dans l’histoire de WordPress. Cela représente bien plus qu’un thème natif&nbsp;: c’est une toute nouvelle façon de travailler avec les thèmes WordPress.</p>\n\n\n\n<p>Les <a href=\"https://fr.wordpress.org/support/article/block-themes/\">thèmes basés sur des blocs</a> placent un large choix de conception dans vos mains, des jeux de couleurs aux combinaisons typographiques, en passant par les modèles de pages et les filtres d’images. Tout cela est compris sur <a href=\"https://fr.wordpress.org/support/article/site-editor/\">la nouvelle interface d’édition de site</a>. En un seul et même endroit, vous trouverez tout ce qu’il faut pour donner votre touche graphique à <em>Twenty Twenty‑Two</em>, et vous pourrez donner un nouveau départ à votre site.</p>\n\n\n\n<p>Le thème Twenty Twenty‑Two est déjà sans doute disponible sur votre site si vous l’avez mis à jour vers WP 5.9. Il a été installé en même temps que WordPress 5.9. Vous le trouverez avec&nbsp;les autres thèmes que vous avez installés.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/01/5-9-release-2.png\" alt=\"\" class=\"wp-image-12102\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"votre-palette-de-peinture-vous-attend\">Votre palette de peinture vous attend</h3>\n\n\n\n<p>D’autres thèmes basés sur des blocs et implémentant des fonctionnalités d’édition de site sont disponibles dans le répertoire officiel des thèmes, aux côtés de Twenty Twenty‑Two. Ils attendent simplement d’être essayés. Et bien d’autres viendront avec le temps&nbsp;!</p>\n\n\n\n<p>Lorsque vous utiliserez l’un de ces nouveaux thèmes, vous n’aurez plus besoin de l’outil de personnalisation. À la place, vous découvrirez la puissance de l’interface de gestion des styles globaux comprise dans l’éditeur de site. Tout comme avec Twenty Twenty‑Two, vous pourrez y bâtir l’apparence de votre site avec des outils prêts à l’emploi et une interface fluide et dynamique.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/01/5-9-release-3.png\" alt=\"\" class=\"wp-image-12103\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"le-bloc-navigation\">Le bloc navigation</h3>\n\n\n\n<p>Les blocs font leur entrée dans les menus de navigation, le cœur de l’expérience de visite de votre site.</p>\n\n\n\n<p>Le nouveau bloc Navigation vous donne la possibilité de choisir&nbsp;: un menu fluide ou plutôt un menu adapté à la taille d’écran de l’internaute. Qu’importe le menu que vous créez, vous pourrez le réutiliser partout où vous le souhaitez, que ce soit dans un nouveau modèle de page ou même après avoir changé de thème.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"encore-plus-d-ameliorations-et-de-mises-a-jour\">Encore plus d’améliorations et de mises à jour</h2>\n\n\n\n<p>Vous aimez bloguer ou produire de contenu&nbsp;? De nouveaux ajustements aideront votre expérience éditoriale et la rendront plus efficace.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/01/5-9-release-4.png\" alt=\"\" class=\"wp-image-12104\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"de-meilleurs-outils-de-controle-pour-les-blocs\">De meilleurs outils de contrôle pour les blocs</h3>\n\n\n\n<p>WordPress 5.9 contient de nouveaux outils typographiques et vous permet de contrôler votre mise en page, comme par exemple sur des détails tels que les espacements, les bordures, et bien plus encore. Cela vous aidera à apporter autant de soin à l’apparence générale de votre site qu’aux détails des contenus de vos pages.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/01/5-9-release-5.png\" alt=\"\" class=\"wp-image-12105\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"le-pouvoir-des-compositions\">Le pouvoir des compositions</h3>\n\n\n\n<p>Le répertoire de compositions de WordPress contient un grand nombre de compositions de blocs construites pour vous faire gagner du temps. Vous pouvez les utiliser et les modifier autant que vous le souhaitez. Vous voulez un en-tête ou un pied de page différent pour votre site&nbsp;? Vous pourrez en installer de nouveaux en quelques clics.</p>\n\n\n\n<p>Avec sa vue en grande largeur qui vous montre tous les détails de chaque élément, l’outil d’exploration de compositions vous permet de comparer les compositions entre elles et de choisir la plus adaptée pour votre site.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/01/5-9-release-6.png\" alt=\"\" class=\"wp-image-12106\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"une-refonte-de-la-vue-en-liste\">Une refonte de la vue en liste</h3>\n\n\n\n<p>Dans WP 5.9, la vue en liste vous permet de glisser-déposer votre contenu exactement où vous le souhaitez. Gérer des documents complexes est encore plus simple&nbsp;: des boutons vous permettent de déplier-replier les sections pendant que vous bâtissez votre site, et d’ajouter des ancres à vos blocs pour aider les internautes à naviguer dans la page.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-full\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2022/01/5-9-release-7.png\" alt=\"\" class=\"wp-image-12107\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"un-meilleur-bloc-galerie\">Un meilleur bloc galerie</h3>\n\n\n\n<p>Manipulez chaque image de vos blocs galeries de la même façon que vous manipuleriez un bloc image indépendant.</p>\n\n\n\n<p>Mettez en forme chaque image de votre galerie de façon indépendante des autres (par exemple avec un recadrage différent ou un filtre duotone), ou faites-les toutes se ressembler. Vous pourrez ensuite modifier la mise en page de la galerie avec un simple glisser-déposer.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2 class=\"wp-block-heading\" id=\"wordpress-5-9-pour-les-developpeurs-et-les-developpeuses\">WordPress 5.9 pour les développeurs et les développeuses</h2>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"le-fichier-theme-json-pour-les-themes-enfants\">Le fichier theme.json pour les thèmes enfants</h3>\n\n\n\n<p>Avec WP 5.9, le fichier <code>theme.json</code> prendra maintenant en charge les thèmes enfants. Cela signifie que vous pourrez construire un thème enfant directement depuis l’interface d’administration de WordPress, sans écrire la moindre ligne de code.&nbsp;</p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/\">Voir la note de développement sur la fonctionnalité theme.json pour les thèmes enfants (en anglais)</a></p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"verrouillage-des-blocs\">Verrouillage des blocs</h3>\n\n\n\n<p>Vous pouvez maintenant verrouiller tout ou partie des blocs au sein d’une composition, juste en ajoutant un attribut de verrouillage dans ses réglages au sein du fichier block.json. Laissez les rédacteur·ice·s libres de modifier le reste de la composition pour adapter son contenu.</p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/\">Voir la note de développement sur la fonctionnalité de verrouillage des blocs (en anglais)</a></p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"plusieurs-feuilles-de-styles-pour-chaque-bloc\">Plusieurs feuilles de styles pour chaque bloc</h3>\n\n\n\n<p>Vous pouvez maintenant déclarer plus qu’une seule feuille de style par bloc. Cela vous permet de partager des styles entre différents blocs que vous avez créés, ou pour charger des styles pour des blocs individuels, ce qui fait que vos styles ne sont chargés que lorsque le bloc est utilisé. Pour en savoir plus, apprenez à&nbsp;<a href=\"https://make.wordpress.org/core/2021/12/15/using-multiple-stylesheets-per-block/\">charger plusieurs feuilles de styles sur un bloc (en anglais)</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"un-bloc-galerie-remodele-de-a-a-z\">Un bloc galerie remodelé de A à Z</h3>\n\n\n\n<p>Les modifications du bloc galerie listées ci-dessus sont le résultat d’un remodelage complet. Si vous avez construit un thème ou une extension qui l’utilise, assurez-vous de lire la&nbsp;<a href=\"https://make.wordpress.org/core/2021/08/20/gallery-block-refactor-dev-note/\">note technique de compatibilité du bloc galerie (en anglais)</a>.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h3 class=\"wp-block-heading\" id=\"en-savoir-plus-sur-les-fonctionnalites-de-wp-5-9\">En savoir plus sur les fonctionnalités de WP&nbsp;5.9</h3>\n\n\n\n<p>Vous voulez plonger dans 5.9 mais ne savez pas par où commencer&nbsp;? Rendez-vous sur&nbsp;<a href=\"https://learn.wordpress.org/\">learn.wordpress.org</a>&nbsp;pour consulter des ressources sur les nouvelles fonctionnalités de WordPress 5.9.</p>\n\n\n\n<p>Si vous cherchez des ressources en français, nous vous conseillons aussi de <a href=\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/\" data-type=\"post\" data-id=\"2304\">consulter la documentation produite par l&rsquo;équipe de traduction de WordPress en français tout spécialement pour WordPress&nbsp;5.9</a>.</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h3 class=\"wp-block-heading\" id=\"consultez-le-guide-de-la-version-pour-en-savoir-plus\">Consultez le guide de la version pour en savoir plus&nbsp;!</h3>\n\n\n\n<p>Consultez le guide des changements techniques de WordPress&nbsp;5.9. Il met en avant les notes de développement pour chaque modification que vous souhaiteriez approfondir&nbsp;:&nbsp;<a href=\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/\" data-type=\"post\" data-id=\"2264\">guide des changements techniques de WordPress 5.9 en français</a></p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"l-equipe-de-direction-de-wordpress-5-9\"><strong>L’équipe de direction de WordPress&nbsp;5.9</strong></h2>\n\n\n\n<p>La version 5.9 de WordPress 5.9 a été dirigée par <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a>, avec l’assistance de l’équipe de direction suivante&nbsp;:</p>\n\n\n\n<ul><li>Directeur de la version&nbsp;: <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a></li><li>Directrice technique et coordinatrice de la version&nbsp;: <a href=\"https://profiles.wordpress.org/hellofromtonya/\">Tonya Mork</a></li><li>Responsables projet&nbsp;: <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a> et <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Chaion</a></li><li>Responsables techniques côté éditeur/Gutenberg&nbsp;: <a href=\"https://profiles.wordpress.org/noisysocks/\">Robert Anderson</a> et <a href=\"https://profiles.wordpress.org/mamaduka/\">George Mamadashvili</a></li><li>Responsables du nouveau thème&nbsp;: <a href=\"https://profiles.wordpress.org/kjellr/\">Kjell Reigstad</a> et <a href=\"https://profiles.wordpress.org/jffng/\">Jeff Ong</a></li><li>Rédacteur technique&nbsp;: <a href=\"https://profiles.wordpress.org/psykro/\">Jonathan Bossenger</a></li><li>Responsables de la documentation&nbsp;: <a href=\"https://profiles.wordpress.org/mkaz/\">Marcus Kazmierczak</a> et <a href=\"https://profiles.wordpress.org/milana_cap/\">Milana Cap</a></li><li>Responsables marketing &amp; communications&nbsp;: <a href=\"https://profiles.wordpress.org/marybaum/\">Mary Baum</a> et <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a></li><li>Responsables des tests&nbsp;: <a href=\"https://profiles.wordpress.org/boniu91/\">Piotrek Boniu</a> et <a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a></li></ul>\n\n\n\n<p>WordPress 5.9 reflète l’impressionnant travail accompli par of 624 contributrices et contributeurs bénévoles. Cela a abouti à <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.9&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">370 tickets sur Trac</a> et plus de <a href=\"https://github.com/WordPress/gutenberg/compare/v10.8.0...v11.9.0\">1900 <em>pull requests</em> sur GitHub</a>. Merci à toutes et à tous&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/2linctools/\">2linctools</a>, <a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>, <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">Aaron Robertshaw</a>, <a href=\"https://profiles.wordpress.org/abesell132/\">abesell132</a>, <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a>, <a href=\"https://profiles.wordpress.org/acosmin/\">acosmin</a>, <a href=\"https://profiles.wordpress.org/wpmudev-support8/\">Adam &#8211; WPMU DEV Support</a>, <a href=\"https://profiles.wordpress.org/bosconiandynamics/\">Adam Bosco</a>, <a href=\"https://profiles.wordpress.org/adam3128/\">Adam Morgan</a>, <a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a>, <a href=\"https://profiles.wordpress.org/zieladam/\">Adam Zielinski</a>, <a href=\"https://profiles.wordpress.org/addiestavlo/\">Addie</a>, <a href=\"https://profiles.wordpress.org/aadilali/\">Adil Ali</a>, <a href=\"https://profiles.wordpress.org/aduth/\">aduth</a>, <a href=\"https://profiles.wordpress.org/aezazshekh/\">Aezaz Shekh</a>, <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Chaion</a>, <a href=\"https://profiles.wordpress.org/ajotka/\">ajotka</a>, <a href=\"https://profiles.wordpress.org/soniakash/\">Akash Soni</a>, <a href=\"https://profiles.wordpress.org/atachibana/\">Akira Tachibana</a>, <a href=\"https://profiles.wordpress.org/schlessera/\">Alain Schlesser</a>, <a href=\"https://profiles.wordpress.org/alanjacobmathew/\">Alan Jacob Mathew</a>, <a href=\"https://profiles.wordpress.org/xknown/\">Alex Concha</a>, <a href=\"https://profiles.wordpress.org/ajlende/\">Alex Lende</a>, <a href=\"https://profiles.wordpress.org/alexvorn2/\">Alexandru Vornicescu</a>, <a href=\"https://profiles.wordpress.org/alexeydemidov/\">alexeydemidov</a>, <a href=\"https://profiles.wordpress.org/alexislloyd/\">Alexis Lloyd</a>, <a href=\"https://profiles.wordpress.org/alexstine/\">alexstine</a>, <a href=\"https://profiles.wordpress.org/algala/\">AlGala</a>, <a href=\"https://profiles.wordpress.org/firewatch/\">allilevine</a>, <a href=\"https://profiles.wordpress.org/almendron/\">almendron</a>, <a href=\"https://profiles.wordpress.org/amandariu/\">Amanda Riu</a>, <a href=\"https://profiles.wordpress.org/anandau14/\">Anand Upadhyay</a>, <a href=\"https://profiles.wordpress.org/nosolosw/\">André</a>, <a href=\"https://profiles.wordpr