o_Unit (Hiroshi Urabe)</a>, <a href=\"https://profiles.wordpress.org/zodiac1978/\">Torsten Landsiedel</a>, <a href=\"https://profiles.wordpress.org/sierratr/\">Tracy</a>, <a href=\"https://profiles.wordpress.org/travisnorthcutt/\">Travis Northcutt</a>, <a href=\"https://profiles.wordpress.org/tubys/\">tubys</a>, <a href=\"https://profiles.wordpress.org/dinhtungdu/\">Tung Du</a>, <a href=\"https://profiles.wordpress.org/twstokes/\">twstokes</a>, <a href=\"https://profiles.wordpress.org/desaiuditd/\">Udit Desai</a>, <a href=\"https://profiles.wordpress.org/umesh84/\">umesh84</a>, <a href=\"https://profiles.wordpress.org/devutpol/\">Utpol Deb Nath</a>, <a href=\"https://profiles.wordpress.org/webulous/\">Venkat Raj</a>, <a href=\"https://profiles.wordpress.org/versusbassz/\">versusbassz</a>, <a href=\"https://profiles.wordpress.org/bartoszgrzesik/\">verybg</a>, <a href=\"https://profiles.wordpress.org/vcanales/\">Vicente Canales</a>, <a href=\"https://profiles.wordpress.org/szepeviktor/\">Viktor Szépe</a>, <a href=\"https://profiles.wordpress.org/vishitshah/\">Vishit Shah</a>, <a href=\"https://profiles.wordpress.org/vladytimy/\">Vlad T</a>, <a href=\"https://profiles.wordpress.org/vondelphia/\">Vondelphia.com</a>, <a href=\"https://profiles.wordpress.org/vortfu/\">vortfu</a>, <a href=\"https://profiles.wordpress.org/wb1234/\">wb1234</a>, <a href=\"https://profiles.wordpress.org/webmandesign/\">WebMan Design | Oliver Juhas</a>, <a href=\"https://profiles.wordpress.org/west7/\">Wes Theron</a>, <a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a>, <a href=\"https://profiles.wordpress.org/wfmattr/\">WFMattR</a>, <a href=\"https://profiles.wordpress.org/skorasaurus/\">Will Skora</a>, <a href=\"https://profiles.wordpress.org/earnjam/\">William Earnhardt</a>, <a href=\"https://profiles.wordpress.org/williampatton/\">williampatton</a>, <a href=\"https://profiles.wordpress.org/wojsmol/\">wojsmol</a>, <a href=\"https://profiles.wordpress.org/woodyhayday/\">woodyhayday</a>, <a href=\"https://profiles.wordpress.org/wp_kc/\">wp_kc</a>, <a href=\"https://profiles.wordpress.org/wpnomad/\">wpnomad a11n</a>, <a href=\"https://profiles.wordpress.org/wpweaver/\">wpweaver</a>, <a href=\"https://profiles.wordpress.org/yagniksangani/\">Yagnik Sangani</a>, <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>, <a href=\"https://profiles.wordpress.org/yvettesonneveld/\">Yvette Sonneveld</a>, <a href=\"https://profiles.wordpress.org/zebulan/\">Zebulan Stanphill</a>, and <a href=\"https://profiles.wordpress.org/zoiec/\">zoiec</a>.</p>\n\n\n\n<p>Lors de la publication de ce communiqué de presse officiel, WordPress 5.9 est déjà disponible dans 71 langues ayant traduit 90&nbsp;% ou plus de la version. Les traductrices et traducteurs de la communauté travaillent dur pour vous permettre d’utiliser WordPress dans votre langue natale.</p>\n\n\n\n<p>Merci en particulier à toutes les personnes qui ont aidé à traduire WordPress 5.9 en français&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/fxbenard\">FX Bénard</a>, <a href=\"https://profiles.wordpress.org/wolforg\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/arpe5\">Arpe5</a>,&nbsp;<a href=\"https://profiles.wordpress.org/btpub\">Bruno Tritsch</a>,&nbsp;<a href=\"https://profiles.wordpress.org/chouby\">Chouby</a>,&nbsp;<a href=\"https://profiles.wordpress.org/clementpolito\">Clément Polito</a>,&nbsp;<a href=\"https://profiles.wordpress.org/eddystile\">Eddy</a>,&nbsp;<a href=\"https://profiles.wordpress.org/emlebrun\">Emilie LEBRUN</a>,&nbsp;<a href=\"https://profiles.wordpress.org/guerneves\">guerneves</a>,&nbsp;<a href=\"https://profiles.wordpress.org/juliobox\">Julio Potier</a>,&nbsp;<a href=\"https://profiles.wordpress.org/webaxones\">Loïc Antignac</a>,&nbsp;<a href=\"https://profiles.wordpress.org/oellin\">Magali</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nuryko\">Marianna</a>,&nbsp;<a href=\"https://profiles.wordpress.org/chaton666\">Marie Comet</a>,&nbsp;<a href=\"https://profiles.wordpress.org/marineevain\">Marine EVAIN</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nicolasricher\">Nicolas Richer</a>,&nbsp;<a href=\"https://profiles.wordpress.org/larrach\">Rachel Peter</a>,&nbsp;<a href=\"https://profiles.wordpress.org/sebastienserre\">Sébastien SERRE</a>,&nbsp;<a href=\"https://profiles.wordpress.org/spaceshipone\">Timothée Brosille</a>,&nbsp;<a href=\"https://profiles.wordpress.org/valer1e\">valer1e</a>,&nbsp;<a href=\"https://profiles.wordpress.org/weartdevelopment\">WeArt Development</a>, et&nbsp;<a href=\"https://profiles.wordpress.org/wplmillet\">wplmillet</a>.</p>\n\n\n\n<p>Merci également aux personnes qui contribuent bénévolement aux <a href=\"https://wordpress.org/support/\">forums de support officiels</a>. Elles répondent aux questions que se posent les gens qui utilisent WordPress partout dans le monde. Cela entretien le succès de WordPress depuis la toute première version sortie en 2003.</p>\n\n\n\n<p><em>Si vous souhaitez contribuer à WordPress, nous vous invitons à découvrir le fonctionnement de ce CMS open source sur le site <a href=\"https://make.wordpress.org/\">Make WordPress</a> et à en savoir plus sur le fonctionnement de l’équipe cœur de WP sur son <a href=\"https://make.wordpress.org/core/\">blog de développement</a>.</em></p>\n\n\n\n<p>Bonne mise à jour&nbsp;!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://fr.wordpress.org/2022/01/25/wordpress-5-9/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WordPress 5.9 : documentation en français des fonctionnalités de l’éditeur de site\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:125:\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 17 Jan 2022 15:40:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2304\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:374:\"À quelques jours de la sortie de WordPress 5.9 (prévue mardi 25 janvier 2022), l’équipe de documentation de WordPress en français vient de publier de nouveaux contenus afin de documenter les nouveautés de cette version. Ces pages de documentation sont enrichies de nombreuses captures d’écran et de quelques vidéos, et sont en particulier destinées aux [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jenny Dupuy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3539:\"\n<p>À quelques jours de la sortie de WordPress 5.9 (prévue mardi 25 janvier 2022), l’équipe de documentation de WordPress en français vient de publier de nouveaux contenus afin de documenter les nouveautés de cette version.</p>\n\n\n\n<span id=\"more-2304\"></span>\n\n\n\n<p>Ces pages de documentation sont enrichies de nombreuses captures d’écran et de quelques vidéos, et sont en particulier destinées aux profils de webmasters.</p>\n\n\n\n<p>Si vous avez un profil plus technique nous vous conseillons également la lecture de <a href=\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/\" data-type=\"post\" data-id=\"2264\">cet article détaillant les changements techniques à venir sur WordPress 5.9</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"la-fonctionnalite-d-edition-complete-de-site-full-site-editing\">La fonctionnalité d’édition complète de site (<em>full site editing</em>)</h2>\n\n\n\n<p>Avec WordPress 5.9, de nouvelles fonctionnalités font leur apparition dans votre éditeur et vont vous permettre de modifier l’apparence et la mise en page de l’ensemble de votre site (vous retrouverez souvent ce concept sous son appellation anglophone <em>full site editing</em>), de l’en-tête au pied de page, en passant par la création de vos propres modèles de pages personnalisés.</p>\n\n\n\n<p>Avec ces nouvelles pages de documentation, vous pourrez avoir une connaissance plus précise de ce que propose l’<a href=\"https://fr.wordpress.org/support/article/site-editor/\">éditeur de site</a>, de ce que sont les <a href=\"https://fr.wordpress.org/support/article/theme-base-sur-des-blocs/\">thèmes basés sur des blocs</a>, mais aussi avoir une <a href=\"https://fr.wordpress.org/support/article/styles-overview/\">vue d’ensemble des styles globaux</a>, de comprendre comment utiliser <a href=\"https://fr.wordpress.org/support/article/template-editor/\">l’éditeur de modèles</a>, et de prendre en main les nouveaux blocs avancés&nbsp;: le <a href=\"https://fr.wordpress.org/support/article/navigation-block/\">bloc Navigation</a>, le <a href=\"https://fr.wordpress.org/support/article/template-part-block/\">bloc Élément de modèle</a>, ou encore le <a href=\"https://fr.wordpress.org/support/article/query-loop-block/\">bloc Boucle de requête</a>.</p>\n\n\n\n<p>Vous retrouverez toutes ces pages dans la nouvelle catégorie <a href=\"https://fr.wordpress.org/support/category/editeur-de-site/\">Éditeur de site</a> au sein de la documentation officielle de WordPress en français.</p>\n\n\n\n<p>Merci à toutes les personnes qui ont contribué à l’écriture ou à la relecture de ces nouvelles pages de documentation&nbsp;: <a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/pasglop\">Patrick Olivaud</a>, <a href=\"https://profiles.wordpress.org/chaton666\">Marie Comet</a>, <a href=\"https://profiles.wordpress.org/wolforg\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/webaxones\">Loïc Antignac</a> et <a href=\"https://profiles.wordpress.org/valer1e/\">Valérie Galassi</a>.</p>\n\n\n\n<p>Si vous avez des suggestions d’améliorations et de corrections, vous pouvez rejoindre l’équipe de documentation de WordPress en français sur le <a href=\"https://wpfr.net/slack\">Slack WordPress francophone</a>, canal <code>#documentation-fr</code>.</p>\n\n\n\n<p class=\"has-text-align-right has-small-font-size\">Communiqué co-rédigé par Jenny Dupuy et Jb Audras</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"https://fr.wordpress.org/2022/01/17/wordpress-5-9-documentation-en-francais-des-fonctionnalites-de-lediteur-de-site/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"Guide des changements techniques à venir sur WordPress 5.9\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 12 Jan 2022 08:15:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2264\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:353:\"La sortie de WordPress 5.9 est prévue pour le 25 janvier 2022. WordPress 5.9 offrira la possibilité de construire l’ensemble de votre site en utilisant des blocs. Cette nouvelle version majeure apportera en effet des outils de conception avancés pour vous permettre de créer des mises en page personnalisées pour votre thème, et de les [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:33106:\"\n<figure class=\"wp-block-image size-full\"><a href=\"https://fr.wordpress.org/files/2022/01/wordpress-59.png\"><img decoding=\"async\" loading=\"lazy\" width=\"1000\" height=\"600\" src=\"https://fr.wordpress.org/files/2022/01/wordpress-59.png\" alt=\"WordPress 5.9\" class=\"wp-image-2265\" srcset=\"https://fr.wordpress.org/files/2022/01/wordpress-59.png 1000w, https://fr.wordpress.org/files/2022/01/wordpress-59-300x180.png 300w, https://fr.wordpress.org/files/2022/01/wordpress-59-768x461.png 768w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" /></a></figure>\n\n\n\n<p class=\"has-text-align-center\" style=\"font-size:24px\">La sortie de WordPress 5.9 est prévue <br>pour le 25 janvier 2022.</p>\n\n\n\n<p>WordPress 5.9 offrira la possibilité de construire l’ensemble de votre site en utilisant des blocs. Cette nouvelle version majeure apportera en effet des outils de conception avancés pour vous permettre de créer des mises en page personnalisées pour votre thème, et de les mettre en forme selon vos préférences.</p>\n\n\n\n<p>Découvrez dans ce guide les nouveautés techniques majeures qui vous attendent pour cette nouvelle version de l’outil qui propulse plus de 43% du web !</p>\n\n\n\n<span id=\"more-2264\"></span>\n\n\n\n<p>Cette version majeure 5.9 corrige plus de <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">100 bugs</a>, apporte <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">99 améliorations</a>, répond à <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">5 demandes de nouvelles fonctionnalités</a> et prend en charge <a href=\"https://core.trac.wordpress.org/query?milestone=5.9&amp;group=type&amp;page=4&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">51 tâches de maintenance</a>. Voici la <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.9&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\" data-type=\"URL\">liste complète des tickets fermés lors du développement de WordPress 5.9</a>.</p>\n\n\n\n<p>Vous pouvez d’ores et déjà tester cette nouvelle version en installant la <a href=\"https://wordpress.org/news/2022/01/wordpress-5-9-rc-2/\">version Release Candidate 2</a> sur un site de test. La version finale est prévue pour le 25 janvier 2022.</p>\n\n\n\n<p>Pour chaque composant de WordPress concerné par un changement majeur, vous trouverez un paragraphe introductif en français suivi des notes de développement et autres ressources publiées par l’équipe de développement de WordPress, en anglais.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"editeur-de-blocs-arrivee-de-l-edition-complete-de-votre-site-a-l-aide-de-blocs-gutenberg\">Éditeur de blocs&nbsp;: arrivée de l’édition complète de votre site à l’aide de blocs Gutenberg</h2>\n\n\n\n<p>WordPress 5.9 est la version qui apporte le plus de changements à l’éditeur depuis le lancement de Gutenberg sur WP 5.0.</p>\n\n\n\n<p>Cette nouvelle version majeure apporte une suite complète d’outils permettant à l’éditeur de blocs de proposer bien plus que la seule écriture des pages et articles de votre site. Cela comprend une nouvelle façon de construire des thèmes, de créer des modèles et de mettre en forme votre site. En plus de cela, une dizaine de nouveaux blocs proposent le chargement de contenus dynamiques pour créer les modèles de pages de votre site.</p>\n\n\n\n<p>Le nouveau thème natif <strong>Twenty Twenty-Two</strong> est quant à lui chargé de faire la démonstration de toutes ces nouvelles fonctionnalités.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://make.wordpress.org/core/files/2021/10/Example-Pages-scaled.jpg\"><img decoding=\"async\" src=\"https://make.wordpress.org/core/files/2021/10/Example-Pages-1024x701.jpg\" alt=\"\" class=\"wp-image-91525\" /></a></figure>\n\n\n\n<p>Pour en savoir plus sur les thèmes basés sur des blocs et pour apprendre à construire le vôtre, consultez la note de développement dédiée&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"SWXSKzm4tM\"><a href=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/\">Block themes, a new way to build themes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block themes, a new way to build themes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/block-themes-a-new-way-to-build-themes-in-wordpress-5-9/embed/#?secret=c4fiUtwbS1#?secret=SWXSKzm4tM\" data-secret=\"SWXSKzm4tM\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p><a href=\"https://developer.wordpress.org/block-editor/contributors/versions-in-wordpress/\">WordPress 5.9 comprend tous les changements ayant eu lieu sur l’extension Gutenberg</a> depuis la dernière version de WordPress, jusqu’au gel du développement de nouvelles fonctionnalités intervenu avec la version 11.9 de Gutenberg. Pour connaître le contenu de chaque version de l’extension Gutenberg, consultez leur article dédié&nbsp;: <a href=\"https://make.wordpress.org/core/2021/06/10/whats-new-in-gutenberg-10-8-9-june/\" data-type=\"post\" data-id=\"89357\">10.8</a>, <a href=\"https://make.wordpress.org/core/2021/06/24/whats-new-in-gutenberg-10-9-23-june/\" data-type=\"post\" data-id=\"89686\">10.9</a>, <a href=\"https://make.wordpress.org/core/2021/07/09/whats-new-in-gutenberg-11-0-0-9-july/\" data-type=\"post\" data-id=\"89923\">11.0</a>, <a href=\"https://make.wordpress.org/core/2021/07/21/whats-new-in-gutenberg-11-1-0-21-july/\" data-type=\"post\" data-id=\"90206\">11.1</a>, <a href=\"https://make.wordpress.org/core/2021/08/05/whats-new-in-gutenberg-11-2-0-4-august/\" data-type=\"post\" data-id=\"90397\">11.2</a>, <a href=\"https://make.wordpress.org/core/2021/08/18/whats-new-in-gutenberg-11-3-18-august/\" data-type=\"post\" data-id=\"90589\">11.3</a>, <a href=\"https://make.wordpress.org/core/2021/09/01/whats-new-in-gutenberg-11-4-1-september/\" data-type=\"post\" data-id=\"90781\">11.4</a>, <a href=\"https://make.wordpress.org/core/2021/09/17/whats-new-in-gutenberg-11-5-16-september/\" data-type=\"post\" data-id=\"91161\">11.5</a>, <a href=\"https://make.wordpress.org/core/2021/10/01/whats-new-in-gutenberg-11-6-29-september/\" data-type=\"post\" data-id=\"91369\">11.6</a>, <a href=\"https://make.wordpress.org/core/2021/10/14/whats-new-in-gutenberg-11-7-october-13th/\" data-type=\"post\" data-id=\"91649\">11.7</a>, <a href=\"https://make.wordpress.org/core/2021/10/28/whats-new-in-gutenberg-11-8-0-27-october/\" data-type=\"post\" data-id=\"91867\">11.8</a>, <a href=\"https://make.wordpress.org/core/2021/11/12/whats-new-in-gutenberg-11-9-0-10-november/\" data-type=\"post\" data-id=\"92148\">11.9</a>.</p>\n\n\n\n<p>Vous trouverez ci-après les principaux changements intervenus sur Gutenberg, avec des liens vers les notes de développement associées.</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"mise-a-jour-des-reglages-des-styles-et-du-fichier-theme-json\">Mise à jour des réglages, des styles et du fichier theme.json</h3>\n\n\n\n<p>La note de développement suivante décrit les changements notamment apportés au fichier theme.json.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"svOvwF6t4G\"><a href=\"https://make.wordpress.org/core/2022/01/08/updates-for-settings-styles-and-theme-json/\">Updates for Settings, Styles, and theme.json</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updates for Settings, Styles, and theme.json&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/08/updates-for-settings-styles-and-theme-json/embed/#?secret=EZ9WXFA1VZ#?secret=svOvwF6t4G\" data-secret=\"svOvwF6t4G\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"refactorisation-du-bloc-galerie\">Refactorisation du bloc Galerie</h3>\n\n\n\n<p>Auparavant, le bloc galerie fonctionnait comme un bloc unique qui permettait de choisir des images à intégrer au bloc. À partir de WordPress 5.9, il devient un bloc «&nbsp;conteneur&nbsp;» et les images qu’il contient seront tout simplement des blocs intégrés au sein de celui-ci. Par ailleurs, il sera également possible d’y intégrer d’autres types de blocs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ODDpuDSnAc\"><a href=\"https://make.wordpress.org/core/2021/08/20/gallery-block-refactor-dev-note/\">Gallery Block Refactor Dev Note</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Gallery Block Refactor Dev Note&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/08/20/gallery-block-refactor-dev-note/embed/#?secret=S0lJLeqvqn#?secret=ODDpuDSnAc\" data-secret=\"ODDpuDSnAc\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"le-nouveau-bloc-navigation\">Le nouveau bloc Navigation</h3>\n\n\n\n<p>Le nouveau bloc de navigation s’intègre pleinement dans l’objectif d’édition complète de votre site via l’éditeur de blocs. Celui-ci permet de créer et gérer vos menus de navigation au sein de l’éditeur.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ZLBgTGrRWl\"><a href=\"https://make.wordpress.org/core/2022/01/07/the-new-navigation-block/\">The new Navigation block</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;The new Navigation block&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/07/the-new-navigation-block/embed/#?secret=7VIz3HSob6#?secret=ZLBgTGrRWl\" data-secret=\"ZLBgTGrRWl\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"encore-plus-de-controle-sur-les-blocs-pouvant-en-contenir-d-autres\">Encore plus de contrôle sur les blocs pouvant en contenir d’autres</h3>\n\n\n\n<p>La manière d’utiliser le composant <code>&lt;InnerBlocks /&gt;</code> a évolué. Cette note de développement vous permettra de mieux l’intégrer à vos projets de développements basés sur des blocs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"hQlv4ca8wR\"><a href=\"https://make.wordpress.org/core/2021/12/28/take-more-control-over-inner-block-areas-as-a-block-developer/\">Take more control over Inner Block Areas (as a block developer)</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Take more control over Inner Block Areas (as a block developer)&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/28/take-more-control-over-inner-block-areas-as-a-block-developer/embed/#?secret=e3ut65A9Ce#?secret=hQlv4ca8wR\" data-secret=\"hQlv4ca8wR\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"possibilite-de-declarer-plusieurs-feuilles-de-styles-par-bloc\">Possibilité de déclarer plusieurs feuilles de styles par bloc</h3>\n\n\n\n<p>Le fichier <code>block.json</code> permet dorénavant de déclarer une ou plusieurs feuilles de styles pour un seul et même bloc, et de charger des styles provenant d’autres blocs si besoin. Les thèmes pourront donc ajouter des styles blocs par blocs au lieu d’utiliser des feuilles de styles très lourdes contenant des styles pour l’ensemble du site, et qui sont donc constamment chargées pour toutes les pages.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"TWCV3clxxI\"><a href=\"https://make.wordpress.org/core/2021/12/15/using-multiple-stylesheets-per-block/\">Using multiple stylesheets per block</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Using multiple stylesheets per block&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/15/using-multiple-stylesheets-per-block/embed/#?secret=SO4kaonk5W#?secret=TWCV3clxxI\" data-secret=\"TWCV3clxxI\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"une-nouvelle-api-permettant-d-acceder-aux-styles-et-reglages-globaux-du-site\">Une nouvelle API permettant d’accéder aux styles et réglages globaux du site</h3>\n\n\n\n<p>Un jeu de fonctions, de crochets d’action et de filtres permet d’accéder au fichier <code>theme.json</code> et d’en modifier les réglages.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"pImnyM4YOk\"><a href=\"https://make.wordpress.org/core/2022/01/04/new-api-to-access-global-settings-styles/\">New API to access global settings &amp; styles</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New API to access global settings &amp; styles&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/new-api-to-access-global-settings-styles/embed/#?secret=IeKJQ3tIxp#?secret=pImnyM4YOk\" data-secret=\"pImnyM4YOk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"verrouillage-des-blocs\">Verrouillage des blocs</h3>\n\n\n\n<p>WordPress 5.9 apporte la possibilité de verrouiller certains blocs individuels au sein de compositions de blocs, afin d’empêcher leur modification dans l’éditeur. Ceci est particulièrement utile pour contraindre la mise en page et la mise en forme de certaines compositions par rapport à votre charte graphique.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"m9aKusEXIo\"><a href=\"https://make.wordpress.org/core/2022/01/08/locking-blocks-in-wordpress-5-9/\">Locking Blocks in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Locking Blocks in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/08/locking-blocks-in-wordpress-5-9/embed/#?secret=K3JEnG3aho#?secret=m9aKusEXIo\" data-secret=\"m9aKusEXIo\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"autres-modifications-concernant-l-editeur-de-blocs-sur-wp-5-9\">Autres modifications concernant l’éditeur de blocs sur WP 5.9</h3>\n\n\n\n<p>La note de développement suivante liste diverses autres améliorations et d’autres changements sur l’éditeur de blocs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zcz3Iu1aJ3\"><a href=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-block-editor-changes-in-wordpress-5-9/\">Miscellaneous block editor changes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous block editor changes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-block-editor-changes-in-wordpress-5-9/embed/#?secret=hwR7A5kJf5#?secret=zcz3Iu1aJ3\" data-secret=\"zcz3Iu1aJ3\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"performances\">Performances</h2>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"coup-d-oeil-sur-les-ameliorations-generales-des-performances-de-wordpress\">Coup d’œil sur les améliorations générales des performances de WordPress</h3>\n\n\n\n<p>La version 5.9 de WordPress apporte un grand nombre d’améliorations de performances. Cet article les détaille de façon précise.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"5UGWFL9jjs\"><a href=\"https://make.wordpress.org/core/2022/01/05/wordpress-5-9-performance-improvements/\">WordPress 5.9 Performance Improvements</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 5.9 Performance Improvements&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/05/wordpress-5-9-performance-improvements/embed/#?secret=N0dmvbpkZN#?secret=5UGWFL9jjs\" data-secret=\"5UGWFL9jjs\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"ameliorations-du-chargement-differe-des-medias-sur-wordpress-5-9\">Améliorations du chargement différé des médias sur WordPress 5.9</h3>\n\n\n\n<p>Présent depuis WordPress 5.5 pour les images et 5.7 pour les iframes, le chargement différé (en anglais <em>lazy loading</em>) permet de ne charger un élément que lorsque l’on a besoin de l’afficher à la personne qui visite le site. Mais tous les médias ne doivent pas tout le temps être chargés en différé. WordPress 5.9 améliore cela en évitant le chargement différé des premiers éléments médias du site, ceux qui sont généralement situés au dessus de la ligne de flottaison de l’écran. Si vous développez des sites web avec WordPress, vous pouvez paramétrer ces réglages précisément pour vos projets.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"JgXt1vowJf\"><a href=\"https://make.wordpress.org/core/2021/12/29/enhanced-lazy-loading-performance-in-5-9/\">Enhanced lazy-loading performance in 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Enhanced lazy-loading performance in 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/29/enhanced-lazy-loading-performance-in-5-9/embed/#?secret=9dEgcoZp6L#?secret=JgXt1vowJf\" data-secret=\"JgXt1vowJf\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"api-du-coeur-wordpress\">API du cœur WordPress</h2>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"changements-concernant-les-publications-les-types-de-publications-ainsi-que-les-taxonomies\">Changements concernant les publications, les types de publications, ainsi que les taxonomies</h3>\n\n\n\n<p>De nouvelles fonctions, crochets d’action et filtres ont été ajoutés pour faciliter le travail des développeurs et des développeuses WordPress. Découvrez-les dans cette note de développement.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"w6AClHbkTk\"><a href=\"https://make.wordpress.org/core/2021/12/13/posts-post-types-and-taxonomy-changes-in-wordpress-5-9/\">Posts, Post types and Taxonomy changes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Posts, Post types and Taxonomy changes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/13/posts-post-types-and-taxonomy-changes-in-wordpress-5-9/embed/#?secret=Y8kbbhiT7Z#?secret=w6AClHbkTk\" data-secret=\"w6AClHbkTk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"une-nouvelle-facon-de-faire-des-requetes-sur-les-permissions-des-comptes\">Une nouvelle façon de faire des requêtes sur les permissions des comptes</h3>\n\n\n\n<p>WordPress 5.9 apporte des améliorations à l’API permettant de récupérer des comptes en fonction de leurs permissions.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"YO1jgxzWku\"><a href=\"https://make.wordpress.org/core/2022/01/05/new-capability-queries-in-wordpress-5-9/\">New Capability Queries in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New Capability Queries in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/05/new-capability-queries-in-wordpress-5-9/embed/#?secret=fFgZih7glT#?secret=YO1jgxzWku\" data-secret=\"YO1jgxzWku\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"internationalisation\">Internationalisation</h2>\n\n\n\n<p>Vous le verrez la prochaine fois que vous vous connecterez à votre site s’il dispose de plusieurs langues installées dans l’administration&nbsp;: un sélecteur de langue a été ajouté à la page de connexion de WordPress, ce qui permet aux utilisateurs et utilisatrices disposant d’un compte sur votre site d’afficher la page de connexion dans leur langue de préférence. Cela est particulièrement utile pour les sites multilingue, multisite ou comprenant un grand nombre de comptes.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"cUWtWUTV8P\"><a href=\"https://make.wordpress.org/core/2021/12/20/introducing-new-language-switcher-on-the-login-screen-in-wp-5-9/\">Introducing new language switcher on the login screen in WP 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing new language switcher on the login screen in WP 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/12/20/introducing-new-language-switcher-on-the-login-screen-in-wp-5-9/embed/#?secret=MICZjoa8az#?secret=cUWtWUTV8P\" data-secret=\"cUWtWUTV8P\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"themes-et-outil-de-personnalisation\">Thèmes et outil de personnalisation</h2>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"changement-concernant-le-developpement-de-themes\">Changement concernant le développement de thèmes</h3>\n\n\n\n<p>WordPress 5.9 introduit des changements concernant le développement de thèmes, mais aussi de nouveaux filtres pour aider les développeurs et développeuses.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ez8hcRzofd\"><a href=\"https://make.wordpress.org/core/2022/01/07/theme-focused-changes-and-filters-in-wordpress-5-9/\">Theme-focused changes and filters in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Theme-focused changes and filters in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/07/theme-focused-changes-and-filters-in-wordpress-5-9/embed/#?secret=9vlpnajCDf#?secret=ez8hcRzofd\" data-secret=\"ez8hcRzofd\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"mises-a-jour-sur-les-themes-natifs\">Mises à jour sur les thèmes natifs</h3>\n\n\n\n<p>WordPress 5.9 vient aussi avec un certain nombre de modifications concernant les thèmes natifs autres que Twenty Twenty-Two. Si vous utilisez ces thèmes natifs (ou un thème enfant basé sur ces thèmes), nous vous recommandons de prendre connaissance de cette note de développement.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"urRKh3rve8\"><a href=\"https://make.wordpress.org/core/2022/01/05/bundled-theme-updates-with-wordpress-5-9/\">Bundled theme updates with WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Bundled theme updates with WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/05/bundled-theme-updates-with-wordpress-5-9/embed/#?secret=zLDNcqhiAw#?secret=urRKh3rve8\" data-secret=\"urRKh3rve8\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"evolution-du-statut-de-l-outil-de-personnalisation\">Évolution du statut de l’outil de personnalisation</h3>\n\n\n\n<p>Avec les thèmes basés sur des blocs et l’édition complète de site (<em>full site editing</em> en anglais), l’outil de personnalisation perd un peu de son intérêt. Mais il reste utile pour les thèmes classiques&nbsp;!</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"xCZdOct8zV\"><a href=\"https://make.wordpress.org/core/2022/01/07/state-of-the-customizer-with-block-themes-in-wordpress-5-9/\">State of the Customizer with block themes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;State of the Customizer with block themes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/07/state-of-the-customizer-with-block-themes-in-wordpress-5-9/embed/#?secret=CHW5jm647u#?secret=xCZdOct8zV\" data-secret=\"xCZdOct8zV\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"php-8-0-et-8-1\">PHP 8.0 et 8.1</h2>\n\n\n\n<p>Cette note de développement fait le point sur l’état de la compatibilité de WordPress avec les versions 8.0 et 8.1 de PHP.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"8HBIk3Ijni\"><a href=\"https://make.wordpress.org/core/2022/01/10/wordpress-5-9-and-php-8-0-8-1/\">WordPress 5.9 and PHP 8.0-8.1</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 5.9 and PHP 8.0-8.1&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/10/wordpress-5-9-and-php-8-0-8-1/embed/#?secret=PDGYoJaxp8#?secret=8HBIk3Ijni\" data-secret=\"8HBIk3Ijni\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"outils-de-tests-unitaires-du-coeur-wordpress\">Outils de tests unitaires du cœur WordPress</h2>\n\n\n\n<p>Cet article fait le point sur les changements ayant eu lieu sur les tests unitaires dont fait l’objet chaque ligne de code introduite dans le code source du CMS.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"6ihNzPxnfm\"><a href=\"https://make.wordpress.org/core/2021/09/27/changes-to-the-wordpress-core-php-test-suite/\">Changes to the WordPress Core PHP Test Suite</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Changes to the WordPress Core PHP Test Suite&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/09/27/changes-to-the-wordpress-core-php-test-suite/embed/#?secret=Rbh1GTGYFP#?secret=6ihNzPxnfm\" data-secret=\"6ihNzPxnfm\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"autres-changements-techniques\">Autres changements techniques</h2>\n\n\n\n<p>Mais ce n’est pas tout&nbsp;!</p>\n\n\n\n<p>Cette dernière note de développement rassemble divers autres changements ayant eu lieu sur WordPress 5.9&nbsp;:</p>\n\n\n\n<ul><li>Le champ de message des commentaires est maintenant mentionné comme étant obligatoire.</li><li>Deux nouveaux fournisseurs oEmbed font leur apparition&nbsp;: Pinterest ainsi que l’outil de représentation mathématique Wolfram Notebook.</li><li>Une nouvelle option pour restreindre les balises autorisées dans l’éditeur en fonction de leurs attributs.</li><li>Les PDF peuvent dorénavant être embarqués via la balise <code>object</code>.</li><li>Suppression de l’attribut redondant <code>role=\"navigation\"</code> des balises <code>nav</code> générées par WordPress.</li><li>Le nouveau filtre <code>wp_http_validate_url</code> permet de déclarer les ports utilisables pour des requêtes externes.</li><li>Le crochet d’action&nbsp;<code>wp_mail_succeeded</code>&nbsp;a été ajouté à la fonction&nbsp;<code>wp_mail()</code>.</li><li>La variable globale <code>post</code> est à présent utilisée par défaut sur la fonction&nbsp;<code>wp_get_post_parent_id()</code>.</li><li><code>wp_register_script()</code>&nbsp;peut dorénavant être appelé après&nbsp;<code>wp_enqueue_script()</code>.</li><li>Les fonctions&nbsp;<code>get_*_*_link()</code>&nbsp;et&nbsp;<code>edit_term_link()</code>&nbsp;acceptent désormais un «&nbsp;term ID&nbsp;» ou un objet&nbsp;<code>WP_Term</code>.</li></ul>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"boNv6pFAzh\"><a href=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-core-changes-in-wordpress-5-9/\">Miscellaneous Core changes in WordPress 5.9</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous Core changes in WordPress 5.9&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2022/01/04/miscellaneous-core-changes-in-wordpress-5-9/embed/#?secret=Km2rn2BKZN#?secret=boNv6pFAzh\" data-secret=\"boNv6pFAzh\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p class=\"has-text-align-right has-small-font-size\">Rédigé par <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a>, relu et corrigé par <a href=\'https://profiles.wordpress.org/fxbenard/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>fxbenard</a> et <a href=\'https://profiles.wordpress.org/jdy68/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jdy68</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://fr.wordpress.org/2022/01/12/guide-des-changements-techniques-a-venir-sur-wordpress-5-9/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"« State of the Word 2021 », le bilan annuel du projet WordPress en vidéo sous-titrée en français\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:128:\"https://fr.wordpress.org/2021/12/22/state-of-the-word-2021-le-bilan-annuel-du-projet-wordpress-en-video-sous-titree-en-francais/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:136:\"https://fr.wordpress.org/2021/12/22/state-of-the-word-2021-le-bilan-annuel-du-projet-wordpress-en-video-sous-titree-en-francais/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 22 Dec 2021 20:23:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2239\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:372:\"Le « State of the Word » est la conférence annuelle du cofondateur de WordPress Matt Mullenweg. Cette année, elle s’est déroulée le 14 décembre 2021 à New York devant une petite audience de personnes. Une diffusion vidéo était également proposée pour que tout le monde puisse suivre cette conférence en direct. Il s’agit toujours d’un moment [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5944:\"\n<p>Le « State of the Word » est la conférence annuelle du cofondateur de WordPress Matt Mullenweg. Cette année, elle s’est déroulée le 14 décembre 2021 à New York devant une petite audience de personnes. Une diffusion vidéo était également proposée pour que tout le monde puisse suivre cette conférence en direct. Il s’agit toujours d’un moment important pour la communauté. Plus de 30 communautés locales ont même réuni en tout plus de 300 personnes lors de meetups locaux pour assister ensemble à la conférence, comme à Séville en Espagne.</p>\n\n\n\n<span id=\"more-2239\"></span>\n\n\n\n<p>Vous pouvez voir ou revoir cette conférence en utilisant le lecteur ci-dessous ou <a href=\"https://wordpress.tv/2021/12/15/matt-mullenweg-2021-state-of-the-word/\">en vous rendant sur WordPress.tv</a>.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-video is-provider-videopress wp-block-embed-videopress wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\n<iframe title=\"Matt Mullenweg: 2021 State of the Word\" width=\'612\' height=\'344\' src=\'https://video.wordpress.com/embed/Io14KzZ3?hd=1&amp;cover=1\' frameborder=\'0\' allowfullscreen ></iframe><script src=\'https://v0.wordpress.com/js/next/videopress-iframe.js?m=1633526814\'></script>\n</div></figure>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-full is-resized\"><a href=\"https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress.png\"><img decoding=\"async\" loading=\"lazy\" src=\"https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress.png\" alt=\"\" class=\"wp-image-2241\" width=\"108\" height=\"97\" srcset=\"https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress.png 433w, https://fr.wordpress.org/files/2021/12/video-subtitles-sotw-wordpress-300x268.png 300w\" sizes=\"(max-width: 108px) 100vw, 108px\" /></a></figure></div>\n\n\n\n<p>Pour activer les sous-titres en français, lancez la vidéo puis sélectionnez sur le troisième bouton à droite, cliquez sur «&nbsp;Subtitles : On/Off&nbsp;» et sélectionnez «&nbsp;Français&nbsp;».</p>\n\n\n\n<p>Comme d’habitude, Matt a couvert un grand nombre de sujets. Le passé, le présent et le futur de WordPress ont été abordés, en soulignant notamment l’augmentation du nombre de contributeurs et contributrices, de traductions de WP dans d’autres langues que l’anglais, les différents jalons atteints par les dernières versions de WordPress, ou encore les initiatives en matière de contenus d’apprentissage et de documentation.</p>\n\n\n\n<p>Des démonstrations des nouvelles fonctionnalités qui arrivent avec la prochaine version majeure 5.9 ont été présentées&nbsp;: édition complète du site, compositions de blocs, options de styles globaux, contrôles d’images avancés…</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites.png\"><img decoding=\"async\" loading=\"lazy\" width=\"1024\" height=\"575\" src=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-1024x575.png\" alt=\"\" class=\"wp-image-2246\" srcset=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-1024x575.png 1024w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-300x168.png 300w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-768x431.png 768w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-1536x862.png 1536w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-fonctionnalites-2048x1149.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Matt en a profité pour féliciter la communauté d&rsquo;avoir permis à WordPress de dépasser les 43&nbsp;% de parts de marché des CMS en décembre 2021, et pour remercier toutes les personnes qui ont déjà contribué à WordPress 5.9. Il a également rappelé que les entreprises qui bâtissent leur économie sur le CMS sont invitées à participer au programme «&nbsp;Five for the Future&nbsp;», c’est à dire à donner 5% de leur temps à la contribution à WordPress. Cela permet de garantir la pérennité du CMS sur le long terme, de continuer à évoluer et de maintenir ses parts de marché sur le web.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs.png\"><img decoding=\"async\" loading=\"lazy\" width=\"1024\" height=\"590\" src=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-1024x590.png\" alt=\"\" class=\"wp-image-2249\" srcset=\"https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-1024x590.png 1024w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-300x173.png 300w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-768x442.png 768w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs-1536x884.png 1536w, https://fr.wordpress.org/files/2021/12/sotw-2021-WP59-contributeurs.png 1980w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a><figcaption><small>Ci-dessus, la liste des personnes ayant contribué à WordPress 5.9 au 14 décembre 2021</small></figcaption></figure>\n\n\n\n<p>Matt a aussi rappelé la feuille de route du projet WordPress, qui comprend l’édition collaborative en temps réel pour 2023, puis la gestion multilingue native.</p>\n\n\n\n<p>Il a enfin évoqué des sujets plus généraux, comme le «&nbsp;web3&nbsp;», les différentes acquisitions et fusions au sein de l’écosystème, ainsi que la poursuite du développement de l’open-source dans le web.</p>\n\n\n\n<p>S’en est suivi une <a href=\"https://wordpress.tv/2021/12/15/matt-mullenweg-state-of-the-word-2021-qa/\">séance de questions-réponses</a> pendant laquelle il a pu répondre a plusieurs questions de l’assistance.</p>\n\n\n\n<p>N’hésitez pas à rejoindre la discussion sur Twitter, avec le mot-dièse <a href=\"https://twitter.com/hashtag/ILoveWP\">#ILoveWP</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:133:\"https://fr.wordpress.org/2021/12/22/state-of-the-word-2021-le-bilan-annuel-du-projet-wordpress-en-video-sous-titree-en-francais/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:35:\"https://fr.wordpress.org/news/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:10:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Sat, 11 Feb 2023 08:19:57 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:6:\"x-olaf\";s:3:\"⛄\";s:13:\"last-modified\";s:29:\"Mon, 05 Dec 2022 10:33:57 GMT\";s:4:\"link\";s:61:\"<https://fr.wordpress.org/wp-json/>; rel=\"https://api.w.org/\"\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:16:\"content-encoding\";s:4:\"gzip\";s:4:\"x-nc\";s:9:\"HIT ord 2\";}}s:5:\"build\";s:14:\"20211220193300\";}', 'no');
