(668, '_transient_feed_48c2a7450ae14f12ef8a9b58ca9f0748', 'a:4:{s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"feed\";a:1:{i:0;a:6:{s:4:\"data\";s:126:\"\n    \n    \n    \n    \n    \n    \n\n        \n        \n        \n        \n        \n        \n        \n        \n        \n        \n    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Planet WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"subtitle\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Planet WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:4:\"href\";s:36:\"https://rss.wpfr.net/feed/wp-planet/\";s:3:\"rel\";s:4:\"self\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"https://rss.wpfr.net/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"2023-02-11T08:20:55+00:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"generator\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"\n        WP RSS Aggregator\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:3:\"uri\";s:27:\"https://wprssaggregator.com\";s:7:\"version\";s:6:\"4.22.4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"entry\";a:10:{i:0;a:6:{s:4:\"data\";s:70:\"\n    \n    \n    \n    \n    \n    \n    \n            \n                \n    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:9:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://www.whodunit.fr/wordpress-le-point-sur-ce-qui-vous-attend-en-2023/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"WordPress : le point sur ce qui vous attend en 2023\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:4:\"href\";s:74:\"https://www.whodunit.fr/wordpress-le-point-sur-ce-qui-vous-attend-en-2023/\";s:3:\"rel\";s:9:\"alternate\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2023-02-07T11:22:37.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2023-02-07T11:22:37.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"summary\";a:1:{i:0;a:5:{s:4:\"data\";s:743:\"La sortie en novembre dernier de la version 6.1 de WordPress est l’occasion idéale de faire le point sur le CMS qui a vu le jour en 2003 et qui compte aujourd’hui plus de 60 millions de sites actifs à travers le monde. Il est important voire indispensable d’anticiper les prochaines évolutions de WordPress afin de se poser les bonnes questions, de faire les bons choix techniques, d’informer les clients… Voici pour vous un récapitulatif des nouveautés de WordPress en 2022, une présentation des prochaines fonctionnalités attendues en 2023, le tout agrémenté de quelques spoilers alerts sur le futur de…\nL’article WordPress : le point sur ce qui vous attend en 2023 est apparu en premier sur Agence WordPress Whodunit.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:19809:\"\n        \n<p>La sortie en novembre dernier de la version 6.1 de WordPress est l’occasion idéale de faire le point sur le CMS qui a vu le jour en 2003 et qui compte aujourd’hui plus de 60 millions de sites actifs à travers le monde.</p>\n\n\n\n<p>Il est important voire indispensable d’anticiper les prochaines évolutions de WordPress afin de se poser les bonnes questions, de faire les bons choix techniques, d’informer les clients…</p>\n\n\n\n<p>Voici pour vous un récapitulatif des nouveautés de WordPress en 2022, une présentation des prochaines fonctionnalités attendues en 2023, le tout agrémenté de quelques spoilers alerts sur le futur de WordPress et tout plein de conseils made in Whodunit </p>\n\n\n\n<figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\n\n</div></figure>\n\n\n\n<p><strong>Avec les intervenants : Jean-Baptiste Audras, CTO Whodunit et anciennement représentant Core WordPress et Eddy Boels, Customer Happiness Manager Whodunit </strong></p>\n\n\n\n<figure class=\"wp-block-image size-full\" data-block-type=\"core\"><img loading=\"lazy\" width=\"813\" height=\"472\" src=\"https://www.whodunit.fr/wp-content/uploads/2023/02/evolution-des-parts-de-marche-cms-en-10-ans-1.png\" alt=\"\" class=\"wp-image-75428\" //></figure>\n\n\n\n<h2 id=\"h-l-histoire-de-wordpress-et-son-evolution-au-fil-des-ans\" data-block-type=\"core\">L’histoire de WordPress et son évolution au fil des ans</h2>\n\n\n\n<h3 id=\"h-les-versions-majeures-en-2022\" data-block-type=\"core\">Les versions majeures en 2022</h3>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">La version 5.9 a vu apparaître le full site editing (édition complète du site). Cela offre par exemple la possibilité d’éditer l’entête et le pied de page de son site et différents modèles de pages. Elle représente ainsi une grosse évolution pour le CMS.</li>\n\n\n\n<li data-block-type=\"core\">La version 6.0 : cette “petite” version majeure a servi à fignoler l’expérience d’édition de sites</li>\n\n\n\n<li data-block-type=\"core\">La version 6.0.3 : plus grosse version de sécurité de l’histoire du CMS, elle a contenu 15 correctifs de failles de sécurité remontées par des audits externes et des chercheurs en sécurité.</li>\n\n\n\n<li data-block-type=\"core\">La dernière version 6.1 : version très attendue car elle a implémenté le full site editing de façon encore plus profonde avec l’édition de style et variations de styles. Et un nouveau thème natif <a href=\"https://fr.wordpress.org/themes/twentytwentythree/\">T</a><a href=\"https://fr.wordpress.org/themes/twentytwentythree/\" target=\"_blank\" rel=\"noreferrer noopener\">wenty Twenty-Three</a>, un thème canevas vierge et qui contient tout ce qu’il faut pour réaliser un site accessible. Cette version représente un record en termes de contributeurs et contributrices (1399 personnes dont 656 qui n’avaient jamais contribué au développement de WP avant). Ceci peut s’expliquer en partie par la présence du Javascript moderne utilisé par l’éditeur Gutenberg qui attire de nouveaux développeurs et développeuses.</li>\n</ul>\n\n\n\n<p>La team performance de WordPress a été créée, permettant d’améliorer les performances de 20 à 30% notamment en back office.</p>\n\n\n\n<h3 id=\"h-comment-wordpress-s-est-adapte-aux-changements-technologiques-et-aux-nouvelles-tendances-du-web\" data-block-type=\"core\">Comment WordPress s’est adapté aux changements technologiques et aux nouvelles tendances du web</h3>\n\n\n\n<p>Aujourd&#8217;hui avec WordPress 6.1, il nous est possible de dire que WordPress supporte PHP 8 et 8.1. C’est à dire que vous n’aurez pas d&#8217;erreurs majeures si vous passez votre serveur en php 8.0, ou 8.1. En revanche, ce n’est pas encore forcément le cas de toutes les extensions et de tous les thèmes.</p>\n\n\n\n<p>En effet, il va falloir du temps pour s&#8217;assurer que tous les thèmes et toutes les extensions soient compatibles. D&#8217;ailleurs toutes ne le seront pas, il y a des extensions qui n’ont pas été mises à jour depuis trois ou quatre ans et dans ce cas là on risque d&#8217;avoir des problèmes d&#8217;incompatibilité.</p>\n\n\n\n<p>Il y a un travail en cours du côté de l&#8217;équipe Meta <a href=\"http://WordPress.org\" target=\"_blank\" rel=\"noreferrer noopener\">WordPress.org</a> pour pouvoir ajouter un tag sur les extensions du répertoire et pouvoir identifier facilement les extensions qui sont compatibles ou celles qui ne le sont pas. C’est un travail de test assez complet et assez complexe à mettre en oeuvre mais c&#8217;est quelque chose qui pourrait voir le jour pour 2023.</p>\n\n\n\n<p>On vous a préparé une liste non exhaustive des fonctionnalités qu’on aime sur WP 6.1 :</p>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">Les variations de style, en un seul clic on peut changer l&#8217;apparence complète du site, la gestion des styles globaux, les palettes de couleurs, les typos,</li>\n\n\n\n<li data-block-type=\"core\">On trouve désormais dans l’éditeur des modèles de page et donc la possibilité de créer des modèles de page avec différents headers et footers</li>\n\n\n\n<li data-block-type=\"core\">La liste des blocs Gutenberg indispensables</li>\n\n\n\n<li data-block-type=\"core\">La gestion des espaces qui était très attendue (marges internes, externes, espacements…)</li>\n\n\n\n<li data-block-type=\"core\">Les blocs réutilisables ou patterns très importants : on trouve des modèles de composition de blocs tout faits, des bibliothèques très intéressantes qu’il suffit de copier-coller </li>\n</ul>\n\n\n\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><img loading=\"lazy\" width=\"1080\" height=\"748\" src=\"https://www.whodunit.fr/wp-content/uploads/2023/02/capture-decran-2023-01-24-a-09-30-29-1080x748.png\" alt=\"\" class=\"wp-image-75444\" //></figure>\n\n\n\n<p>Il y a eu un gros travail sur la bibliothèque de patterns donc la composition de blocs, un développeur ou une développeuse peut créer ses propres compositions, utiliser celles qui sont natives, celles proposées directement par le thème qu’on aura installé mais on peut aussi aller chercher celles de <a href=\"http://wordpress.org\" target=\"_blank\" rel=\"noreferrer noopener\">wordpress</a><a href=\"http://wordpress.org\">.org</a>.</p>\n\n\n\n<p>L’étape suivante sera de créer ses propres compositions directement dans l&#8217;éditeur et c&#8217;est ainsi que nous en arrivons à ce qui est en cours de développement.</p>\n\n\n\n<h2 id=\"h-etat-des-lieux-de-wordpress\" data-block-type=\"core\">État des lieux de WordPress</h2>\n\n\n\n<h3 id=\"h-l-editeur-gutenberg-s-emancipe\" data-block-type=\"core\">L’éditeur Gutenberg s’émancipe</h3>\n\n\n\n<p>Nous voyons le projet Gutenberg sortir de l’écosystème WordPress lui-même, de sa zone de contenus.</p>\n\n\n\n<p>Il y a quelques semaines, un projet en Sass monté sur <a href=\"https://laravel.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Laravel</a> et qui utilise Gutenberg a été présenté au <a href=\"https://wordpress.org/news/2022/11/state-of-the-word-2022/\" target=\"_blank\" rel=\"noreferrer noopener\">State of the word</a>, la conférence annuelle du cofondateur WordPress.</p>\n\n\n\n<p>On a vu aussi apparaître l’extension <a href=\"https://wordpress.org/plugins/blocks-everywhere/\" target=\"_blank\" rel=\"noreferrer noopener\">blocks everywhere</a> disponible sur <a href=\"http://wordpress.org\" target=\"_blank\" rel=\"noreferrer noopener\">wordpress.org</a>. Comme son nom l&#8217;indique elle permet d&#8217;embarquer l&#8217;éditeur de bloc dans les commentaires par exemple. Elle permet aussi d&#8217;utiliser l&#8217;éditeur, pour ceux qui ont des sites vraiment collaboratifs, dans les extensions buddypress ou bbpress donc des extensions qui permettent de gérer des communautés ou de gérer des forums.</p>\n\n\n\n<p>On sait aussi que ça n’est qu’une question de semaine avant que l&#8217;éditeur puisse être utilisé pour directement éditer une catégorie, la description de catégorie étant quelque chose de très demandé notamment pour des sites de e-commerce.</p>\n\n\n\n<p>Gutenberg est également sorti de WordPress pour être directement implémenté dans Tumblr, une vieille plateforme de blogging et microblogging rachetée il y a maintenant quelques temps par <a href=\"https://automattic.com/\" target=\"_blank\" rel=\"noreferrer noopener\">automattic</a>, l&#8217;entreprise fondée par le co-fondateur de <a href=\"http://wordpress.org\" target=\"_blank\" rel=\"noreferrer noopener\">wordpress.org</a>, <a href=\"https://fr.wikipedia.org/wiki/Matthew_Mullenweg\" target=\"_blank\" rel=\"noreferrer noopener\">Matt Mullenweg</a>.</p>\n\n\n\n<p><mark class=\"has-inline-color has-palette-color-3-color\"><strong>On observe donc que le Projet Gutenberg a tendance à devenir plus gros que WordPress lui-même, l&#8217;objectif visé étant d’en faire un éditeur universel.</strong></mark></p>\n\n\n\n<h3 id=\"h-wp-playground-l-application-qui-permet-de-simuler-wordpress\" data-block-type=\"core\"><a href=\"https://developer.wordpress.org/playground/\" target=\"_blank\" rel=\"noreferrer noopener\">WP Playground</a>, l’application qui permet de simuler WordPress</h3>\n\n\n\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><img loading=\"lazy\" width=\"1080\" height=\"341\" src=\"https://www.whodunit.fr/wp-content/uploads/2023/02/capture-decran-2023-01-24-a-11-09-24-1080x341.png\" alt=\"\" class=\"wp-image-75429\" //></figure>\n\n\n\n<p>Cette initiative présentée récemment par <a href=\"https://fr.wikipedia.org/wiki/Matthew_Mullenweg\" target=\"_blank\" rel=\"noreferrer noopener\">Matt Mullenweg</a> est en fait une application qui va se charger directement dans un onglet du navigateur et permettre de simuler un WordPress vierge dans lequel nous pourrons installer des extensions, installer des thèmes, créer du contenu et le publier…</p>\n\n\n\n<p>C&#8217;est bien sûr une installation provisoire c&#8217;est à dire que tout le contenu qui aura été rédigé sera détruit au moment où le navigateur sera fermé mais d’un point de vue pédagogique, la possibilité de pouvoir faire une démonstration de WordPress est grandement appréciée.</p>\n\n\n\n<p>Il y a également une application de WP playground encore en développement qui donnera la possibilité d’avoir ce mini WordPress sur la page du répertoire des extensions et thème.</p>\n\n\n\n<p>En clair, on pourra tester la compatibilité des extensions qui nous intéressent.</p>\n\n\n\n<h3 id=\"h-create-block-theme\" data-block-type=\"core\">Create Block Theme</h3>\n\n\n\n<p><a href=\"https://wordpress.org/plugins/create-block-theme/\" target=\"_blank\" rel=\"noreferrer noopener\">Create Block Theme</a> est vraiment d&#8217;actualité. Créée par les équipes de développement de <a href=\"http://wordpress.org\" target=\"_blank\" rel=\"noreferrer noopener\">wordpress.org</a>, elle permet de paramétrer un thème basé sur des blocs utilisant le full set editing et de le paramétrer entièrement depuis l’administration.</p>\n\n\n\n<p>C’est vraiment un outil no code c&#8217;est à dire que l’on créé un thème directement depuis notre administration sans créer la moindre ligne de code. Ça va vraiment créer les fichiers physiques sur le serveur, on pourra les zipper et les récupérer pour notre site donc c’est une extension très prometteuse !</p>\n\n\n\n<p>Pour en savoir plus, n’hésitez pas à écouter notre <a href=\"https://www.whodunit.fr/woa-20-le-no-code-avec-stephane-menet/\" target=\"_blank\" rel=\"noreferrer noopener\">dernier podcast</a>.</p>\n\n\n\n<h3 id=\"h-openverse\" data-block-type=\"core\">Openverse</h3>\n\n\n\n<p><a href=\"https://wordpress.org/openverse/\" target=\"_blank\" rel=\"noreferrer noopener\">Openverse</a> est un projet qui appartenait à Godzilla mais faute d’équipes pour s’en occuper, c’est <a href=\"http://wordpress.org\" target=\"_blank\" rel=\"noreferrer noopener\">wordpress.org</a> qui a souhaité le récupérer. Il s’agit une bibliothèque de partage de médias libres de droit. Que ce soit des images, des vidéos ou des fichiers audio. Ce qui en fait pour être très clair un concurrent de unsplash par exemple. Openverse est vraiment un projet 100% open source et ici c&#8217;est pas de code dont il est question mais de médias et de création artistique et graphique.</p>\n\n\n\n<h2 id=\"h-roadmap-2023\" data-block-type=\"core\">RoadMap 2023</h2>\n\n\n\n<h3 id=\"h-les-differentes-phases-du-projet-gutenberg\" data-block-type=\"core\">Les différentes phases du projet Gutenberg</h3>\n\n\n\n<p><strong><span style=\"color: var(--paletteColor1, #ff3475)\" class=\"stk-highlight\">Phase 1</span></strong></p>\n\n\n\n<p>Pour rappel c&#8217;était vraiment l&#8217;éditeur de bloc donc l’édition de la zone de contenu d&#8217;une page d&#8217;un article ou de n&#8217;importe quel type de publication avec des blocs</p>\n\n\n\n<p><strong><span style=\"color: var(--paletteColor1, #ff3475)\" class=\"stk-highlight\">Phase 2</span></strong></p>\n\n\n\n<p>C’était le Full Site Editing qui d&#8217;ailleurs a été renommé en Site Editor tout simplement. Il fonctionne bien et permet donc d’éditer l&#8217;ensemble du site.</p>\n\n\n\n<p><strong><span style=\"color: var(--paletteColor1, #ff3475)\" class=\"stk-highlight\">Phase 3</span></strong></p>\n\n\n\n<p>C&#8217;est la phase collaborative alors c&#8217;est la phase qui parle le moins finalement aux gens de la communauté WordPress pourquoi parce que la plupart des gens de la communauté WordPress utilisent WordPress pour créer un site vitrine, une boutique et l’administrer.</p>\n\n\n\n<p>Il faut se souvenir que le Projet Gutenberg est un projet qui est un petit peu séparé de WordPress c&#8217;est-à-dire qu&#8217;il est développé pour WordPress évidemment puisqu’il est son premier lieu d&#8217;expression et depuis le début il est dit que Gutenberg doit pouvoir être utilisé en dehors de WordPress, pour n&#8217;importe quel CMS, n&#8217;importe quel usage.</p>\n\n\n\n<p>L’idée du Projet Gutenberg est bien d’en faire l&#8217;éditeur universel de contenus sur le web.</p>\n\n\n\n<p>Mais l&#8217;édition de contenu n’est pas réservée aux sites internet et ce que fait WordPress avec Gutenberg c&#8217;est clairement lorgner sur des outils comme Google Docs par exemple.</p>\n\n\n\n<p>Gutenberg a donc besoin d&#8217;outils de workflow éditorial, de workflow de flux collaboratif et c’est vraiment cette phase 3 qui va être lancée en 2023.</p>\n\n\n\n<p>Elle commence dès janvier avec des travaux en cours sur la gestion des flux éditoriaux, donc de la collaboration dans l&#8217;éditeur, une collaboration asynchrone ou en temps réel avec la possibilité sur du contenu de laisser des notes et des commentaires.</p>\n\n\n\n<p>En cours également une refonte complète du système de révision WordPress : Le système de révision c&#8217;est ce qui permet de revenir en arrière sur ce qui a été fait. Très utile lorsqu&#8217;on a fait une bêtise&#8230;</p>\n\n\n\n<p>A noter aussi que Gutenberg a désormais la double licence. A la fois <a href=\"https://www.gnu.org/licenses/gpl-3.0.html\">GPL</a> et <a href=\"https://www.mozilla.org/en-US/MPL/\">MPL</a> (Mozilla Public Licence) Cette deuxième licence était obligatoire au Projet Gutenberg pour qu&#8217;il puisse être porté sur de l&#8217;applicatif mobile comme sur les stores Google sur les Apple Store.</p>\n\n\n\n<p><strong><span style=\"color: var(--paletteColor1, #ff3475)\" class=\"stk-highlight\">Phase 4</span></strong></p>\n\n\n\n<p>C&#8217;est le multilingue. Cette phase 4 était censée arriver une fois que la phase 3 serait en place mais en réalité ça va probablement arriver un peu en même temps. Il va y avoir des développements en parallèle donc on peut attendre effectivement le multilingue avec des premiers développements en 2023 puis des premiers déploiements in situ en 2024.</p>\n\n\n\n<p>En tout cas le multilingue va être intégré directement dans l&#8217;éditeur donc ça sera pas du tout le même fonctionnement que les extensions qu&#8217;on connaît toutes et tous comme <a href=\"https://fr.wordpress.org/plugins/polylang/\">polylang</a> notre petite extension favorite de multilingue. Il va y avoir quelque chose de complémentaire et qui permettra d&#8217;aller encore un peu plus loin sur cette partie là et de façon simplifiée, sans extension.</p>\n\n\n\n<p><strong><span style=\"color: var(--paletteColor1, #ff3475)\" class=\"stk-highlight\">Avant la phase 5</span></strong></p>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">On se dirige vers une refonte complète de la médiathèque, la bibliothèque de médias de WordPress. Ce sujet est très attendu car beaucoup de personnes se plaignent depuis maintenant des années du fait qu&#8217;on ne puisse pas catégoriser les médias, qu&#8217;on puisse pas les ranger dans des dossiers… L’autre souci c’est qu’en voulant insérer une image, Gutenberg va charger la médiathèque qui est lourde et très lente alors que Gutenberg lui est plutôt rapide. On a hâte !</li>\n\n\n\n<li data-block-type=\"core\">D’autres petites choses aussi qui vont être développées en 2023 sont l&#8217;affichage des blocs en fonction du contexte mobile, comptes connectés ou non…</li>\n\n\n\n<li data-block-type=\"core\">On va retrouver l&#8217;éditeur de composition c&#8217;est à dire le fait de pouvoir créer des patterns directement, les exporter et ainsi de suite. C&#8217;est quelque chose que nous proposons dans une petite extension développée début 2022 pour nos clients : <a href=\"https://fr.wordpress.org/plugins/mywp-custom-patterns/\" target=\"_blank\" rel=\"noreferrer noopener\">myWP Custom Patterns</a></li>\n\n\n\n<li data-block-type=\"core\">On aura un nouveau type d&#8217;extension sur le répertoire des extensions <a href=\"http://wordpress.org\" target=\"_blank\" rel=\"noreferrer noopener\">wordpress.org</a> ce sont les canonical plugins (les extensions canoniques en français). Ce sont des extensions qui seront maintenues par <a href=\"http://WordPress.org\" target=\"_blank\" rel=\"noreferrer noopener\">WordPress.org</a> officiellement. Gutenberg est déjà une extension de ce type mais aussi toutes les extensions d&#8217;import et d&#8217;export de contenu seront des extensions canoniques. C’est à la fois un gage de sécurité et un gage de performance parce que c&#8217;est maintenu par les équipes du cœur mais en même temps tout le monde peut y contribuer.</li>\n\n\n\n<li data-block-type=\"core\">On a aussi l’extension <a href=\"https://fr.wordpress.org/plugins/performance-lab/\" target=\"_blank\" rel=\"noreferrer noopener\">performance lab</a> (le laboratoire d’amélioration des performances de WordPress) Toutes ces améliorations sont développées sous la forme d’une extension canonique, certaines fonctionnalités sont portées dans le coeur de WordPress tandis que les autres restent dans l’extension.</li>\n</ul>\n\n\n\n<p>L’idée c’est que ces extensions puissent servir de laboratoire.</p>\n\n\n\n<h3 id=\"h-les-20-ans-de-wordpress\" data-block-type=\"core\">Les 20 ans de WordPress</h3>\n\n\n\n<p>Une équipe travaille sur les festivités des 20 ans de WordPress, on peut s&#8217;attendre à beaucoup de surprises au printemps 2023 !</p>\n\n\n\n<p>Plus de détails à venir ici : <a href=\"https://wp20.wordpress.net/\" target=\"_blank\" rel=\"noreferrer noopener\">WordPress turns 20 in 2023</a></p>\n\n\n\n<p>A noter également que WordPress, qui ne serait rien sans sa communauté, connaît une reprise de ses fameux WordCamps, un WordCamp Paris est d’ailleurs attendu courant 2023. </p>\n<p>L’article <a rel=\"nofollow\" href=\"https://www.whodunit.fr/wordpress-le-point-sur-ce-qui-vous-attend-en-2023/\">WordPress : le point sur ce qui vous attend en 2023</a> est apparu en premier sur <a rel=\"nofollow\" href=\"https://www.whodunit.fr\">Agence WordPress Whodunit</a>.</p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Gaelle\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:6:\"source\";a:1:{i:0;a:6:{s:4:\"data\";s:67:\"\n                    \n                            \n                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:2:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"https://www.whodunit.fr/wordpress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Whodunit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}i:1;a:6:{s:4:\"data\";s:70:\"\n    \n    \n    \n    \n    \n    \n    \n            \n                \n    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:9:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"https://wpchannel.com/wordpress/tutoriels-wordpress/heberger-localement-polices-google-fonts-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"Comment héberger localement des polices Google Fonts avec WordPress ?\";s:7:\"attribs\";a:1:{s:0: