WordPress Whodunit.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:10328:\"\n        \n<p>Au sommaire de ce numéro 20 : WordPress est-il un outil No code ? <br>On débat sur cette question (mais pas tant que ça) avec notre invité du mois, Stéphane Menet, directeur et fondateur de Digital Korner et WP Connect.<br><br>Et bien-sûr notre revue de presse &amp; d&#8217;infos :<br>&#8211; WordPress 6.1 ;<br>&#8211; L&#8217;outil Audit Accessibilité Gouv;<br>&#8211; Arrêt de la prise en charge des vieilles versions de WP pour les mises à jours de sécurité;<br>&#8211; Meetup et l&#8217;outil de surcouche d&#8217;accessibilité.</p>\n\n\n\n\n\n\n\n<h2 id=\"h-ecoutez-le-podcast-sur\" data-block-type=\"core\">Ecoutez le podcast sur </h2>\n\n\n\n<div class=\"is-layout-flex wp-container-5 wp-block-columns\" data-block-type=\"core\">\n<div class=\"is-layout-flow wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://podcasts.apple.com/fr/podcast/woa-wordpress-on-air/id1482779414\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/apple-podcasts-e1571142591535.jpg\" alt=\"\" class=\"wp-image-66447\" //></a></figure>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://open.spotify.com/show/5rEMqG2cyoKYxpTTUAKSPp\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/unknown.png\" alt=\"\" class=\"wp-image-66448\" //></a></figure>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://www.deezer.com/fr/show/586602\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/deezer-1024x196.png\" alt=\"\" class=\"wp-image-66449\" //></a></figure>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"http://podplayer.net/?podId=2447675\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/podcast-addict-for-windows-pc.jpg\" alt=\"\" class=\"wp-image-66450\" //></a></figure>\n</div>\n</div>\n\n\n\n<h2 id=\"h-woa-wordpress-on-air-n-20\" data-block-type=\"core\">WOA : WordPress On Air N°20</h2>\n\n\n\n<p>Bonjour à toutes et à tous. <br>Heureux de vous retrouver après une pause un peu longue, on s&#8217;en excuse. <br>Mais on ne revient pas les mains vides, JB a plein d&#8217;infos WordPress à nous partager et Simon nous fera un retour du WordCamp Lyon et nous parlera également de son extension du mois pour gérer les formulaires. <br><br>Notre sujet du jour, est un sujet qui fait parfois grincer des dents,<strong> le NO CODE </strong>et c&#8217;est avec plaisir que nous en discuterons avec notre invité Stéphane Menet directeur et fondateur de Digital Korner et WP Connect. <br><br>WOA Episode 20, c&#8217;est parti.</p>\n\n\n\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\" data-block-type=\"core\"></div>\n\n\n\n<h2 id=\"h-sommaire-de-l-emission\" data-block-type=\"core\">Sommaire de l&#8217;émission</h2>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">Revue de presse, infos :\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">WordPress 6.1 Stats </li>\n\n\n\n<li data-block-type=\"core\">Outil Audit Accessibilité Gouv </li>\n\n\n\n<li data-block-type=\"core\">Mercredi 30 &#8211; EOL vieilles versions de WP</li>\n\n\n\n<li data-block-type=\"core\">Meetup.com retire son outil de surcouche d&#8217;accessibilité suite à la pression des teams Community et Accessibility de WordPress.org</li>\n</ul>\n</li>\n\n\n\n<li data-block-type=\"core\">Invité du mois\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">Stéphane Menet</li>\n</ul>\n</li>\n\n\n\n<li data-block-type=\"core\">Extension du mois\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">Gravity Forms</li>\n</ul>\n</li>\n\n\n\n<li data-block-type=\"core\">Au prochain épisode…</li>\n</ul>\n\n\n\n<h2 id=\"h-notre-invite\" data-block-type=\"core\">Notre invité</h2>\n\n\n\n<div class=\"wp-block-stackable-columns stk-block-columns stk-block stk-e642d92\" data-block-id=\"e642d92\">.stk-e642d92-column{--stk-column-gap:40px !important}<div class=\"stk-row stk-inner-blocks stk-block-content stk-content-align stk-e642d92-column\">\n<div class=\"wp-block-stackable-column stk-block-column stk-block-column--v2 stk-column stk-block stk-f343bdc\" data-block-id=\"f343bdc\">@media screen and (min-width:768px){.stk-f343bdc{flex:1 1 33.3% !important}}<div class=\"stk-column-wrapper stk-block-column__content stk-container stk-f343bdc-container stk--no-background stk--no-padding\"><div class=\"stk-block-content stk-inner-blocks stk-f343bdc-inner-blocks\">\n<div class=\"wp-block-stackable-image stk-block-image stk-block stk-cc37644\" data-block-id=\"cc37644\"><figure class=\"stk-img-wrapper stk-image--shape-stretch\"><img loading=\"lazy\" class=\"stk-img wp-image-75353\" src=\"https://www.whodunit.fr/wp-content/uploads/2022/12/5d8f502de6be58bcee3873e2_stepahan-1.png\" width=\"600\" height=\"600\" //></figure></div>\n</div></div></div>\n\n\n\n<div class=\"wp-block-stackable-column stk-block-column stk-block-column--v2 stk-column stk-block stk-5b66fd7\" data-block-id=\"5b66fd7\">@media screen and (min-width:768px){.stk-5b66fd7{flex:1 1 66.7% !important}}<div class=\"stk-column-wrapper stk-block-column__content stk-container stk-5b66fd7-container stk--no-background stk--no-padding\"><div class=\"stk-block-content stk-inner-blocks stk-5b66fd7-inner-blocks\">\n<div class=\"wp-block-stackable-heading stk-block-heading stk-block stk-cb40838\" id=\"strong-stephane-menet-strong\" data-block-id=\"cb40838\"><h3 class=\"stk-block-heading__text\"><strong>Stéphane Menet</strong></h3></div>\n\n\n\n<div class=\"wp-block-stackable-text stk-block-text stk-block stk-2a40d35\" data-block-id=\"2a40d35\"><p class=\"stk-block-text__text\">Conseil, Direction de projets Web @ Digital Korner // Accompagnement No Code @ enabl // Fondateur @ WP Connect</p></div>\n\n\n\n<div class=\"wp-block-stackable-button-group stk-block-button-group stk-block stk-8266a83\" data-block-id=\"8266a83\"><div class=\"stk-row stk-inner-blocks stk-block-content stk-button-group\">\n<div class=\"wp-block-stackable-button stk-block-button stk-block stk-1b2276f\" data-block-id=\"1b2276f\"><a class=\"stk-link stk-button stk--hover-effect-darken\" href=\"https://wpconnect.co/\" target=\"_blank\" rel=\"noreferrer noopener\"><span class=\"stk-button__inner-text\">Vers le site de WP Connect</span></a></div>\n</div></div>\n</div></div></div>\n</div></div>\n\n\n\n<div style=\"height:17px\" aria-hidden=\"true\" class=\"wp-block-spacer\" data-block-type=\"core\"></div>\n\n\n\n<h2 id=\"h-les-liens-de-l-emission\" data-block-type=\"core\">Les liens de l&#8217;émission</h2>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">Les <a href=\"https://jeanbaptisteaudras.com/en/2022/11/contribution-stats-for-wordpress-6-1-misha/\" target=\"_blank\" rel=\"noreferrer noopener\">statistiques détaillées de WordPress 6.1 (en anglais)</a> par Jb</li>\n\n\n\n<li data-block-type=\"core\"><a href=\"https://ara.numerique.gouv.fr/\" target=\"_blank\" rel=\"noreferrer noopener\">ARA</a>, l&#8217;outil d&#8217;audit d&#8217;accessibilité proposé par la DINUM</li>\n\n\n\n<li data-block-type=\"core\"><a href=\"https://make.wordpress.org/core/2022/11/30/now-available-wordpress-3-7-4-0-final-releases/\" target=\"_blank\" rel=\"noreferrer noopener\">Fin du support des vieilles versions de WP (en anglais)</a></li>\n\n\n\n<li data-block-type=\"core\">Meetup.com retire son outil de surcouche d&#8217;accessibilité <a href=\"https://make.wordpress.org/community/2022/11/23/meetup-com-accessibility-overlay-update/\" target=\"_blank\" rel=\"noreferrer noopener\">suite à la pression des teams Community et Accessibility de WordPress.org (en anglais)</a></li>\n\n\n\n<li data-block-type=\"core\">Extension du mois : <a href=\"https://www.gravityforms.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Gravity Forms (en anglais)</a></li>\n</ul>\n\n\n\n<h2 id=\"h-l-equipe\" data-block-type=\"core\">L&#8217;équipe</h2>\n\n\n\n<p><strong>Simon</strong> est un enfant de <s>la TV</s> Youtube, il s’intéresse à tous les sujets et dévore les podcasts et émissions, que ce soit sur les jeux de société, WordPress, la science ou encore la bière&nbsp;!</p>\n\n\n\n<p><strong>JB</strong> est une encyclopédie sur pattes de son CMS préféré. Devinez ce qu&#8217;il a gravé dans <a href=\"https://twitter.com/AudrasJb/status/1189955528782471169\" target=\"_blank\" rel=\"noreferrer noopener\">sa citrouille</a> pour Halloween&nbsp;?</p>\n\n\n\n<p><strong>Eddy</strong> a goûté au plaisir de la radio pendant plusieurs années, ça le démangeait de reprendre le micro.</p>\n\n\n\n<figure class=\"is-layout-flex wp-block-gallery-6 wp-block-gallery has-nested-images columns-4 is-cropped\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><img loading=\"lazy\" width=\"425\" height=\"425\" data-id=\"69730\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/05/eddy.jpg\" alt=\"\" class=\"wp-image-69730\" //><figcaption class=\"wp-element-caption\">Eddy</figcaption></figure>\n\n\n\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><img loading=\"lazy\" width=\"425\" height=\"425\" data-id=\"69748\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/05/simon.jpg\" alt=\"\" class=\"wp-image-69748\" //><figcaption class=\"wp-element-caption\">Simon</figcaption></figure>\n\n\n\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><img loading=\"lazy\" width=\"425\" height=\"425\" data-id=\"69738\" src=\"https://www.whodunit.fr/wp-content/uploads/2021/05/jean-baptiste.jpg\" alt=\"\" class=\"wp-image-69738\" //><figcaption class=\"wp-element-caption\">Jb</figcaption></figure>\n</figure>\n\n\n\n<h2 id=\"h-on-attend-vos-retours-avec-impatience\" data-block-type=\"core\">On attend vos retours avec impatience&nbsp;!</h2>\n\n\n\n<p>N&#8217;hésitez pas à laisser un commentaire, ça nous fera plaisir et surtout ça nous aidera à nous améliorer.</p>\n\n\n\n<p>Vous souhaitez intervenir ? Envoyez un mail à eddy@whodunit.fr pour en discuter.</p>\n<p>L’article <a rel=\"nofollow\" href=\"https://www.whodunit.fr/woa-20-le-no-code-avec-stephane-menet/\">WOA ! #20 Le No code avec Stéphane Menet</a> est apparu en premier sur <a rel=\"nofollow\" href=\"https://www.whodunit.fr\">Agence WordPress Whodunit</a>.</p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Eddy Boels\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:6:\"source\";a:1:{i:0;a:6:{s:4:\"data\";s:67:\"\n                    \n                            \n                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:2:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"https://www.whodunit.fr/podcasts/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Podcast WordPress on Air!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}i:8;a:6:{s:4:\"data\";s:70:\"\n    \n    \n    \n    \n    \n    \n    \n            \n                \n    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:9:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"https://beapi.fr/blog/debuter-dans-le-developpement-de-blocs-gutenberg-en-react-un-retour-dexperience/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"Débuter dans le développement de blocs Gutenberg en React : un retour d’expérience  \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:4:\"href\";s:102:\"https://beapi.fr/blog/debuter-dans-le-developpement-de-blocs-gutenberg-en-react-un-retour-dexperience/\";s:3:\"rel\";s:9:\"alternate\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2022-12-09T09:38:55.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2022-12-09T09:38:55.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"summary\";a:1:{i:0;a:5:{s:4:\"data\";s:509:\"Introduction Cet été, chez Be API, nous avons démarré un projet interne nommé Blocks party dans le but de créer une collection de blocs Gutenberg complémentaire à la liste de blocs natifs de WordPress. Ces blocs seront faits-maison, et seront également bien évidemment open-source pour rester fidèle à l’ADN de WordPress. Dans un premier temps, […]\nThe post Débuter dans le développement de blocs Gutenberg en React : un retour d’expérience   appeared first on Be API, agence WordPress.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:11787:\"\n        \n<h2>Introduction</h2>\n\n\n\n<p>Cet été, chez Be API, nous avons démarré<strong> un projet interne nommé <em>Blocks party</em> </strong>dans le but de créer une collection de blocs Gutenberg complémentaire à la liste de blocs natifs de WordPress. Ces blocs seront faits-maison, et seront également bien évidemment <em>open-source</em> pour rester fidèle à l&rsquo;ADN de WordPress.</p>\n\n\n\n<p>Dans un premier temps, nous avons identifié <strong>les mises en forme / fonctionnalités les plus récurrentes dans nos projets</strong>, à partir desquelles nous avons produit une liste de blocs candidats pour le développement. Sans le savoir, j&rsquo;allais commencer par le bloc le plus difficile et le plus complexe de la liste.&nbsp;</p>\n\n\n\n<p>Je suis Paolo Tesei, développeur de thèmes WordPress depuis 15 ans, et je vous propose ci-dessous <strong>un retour d’expérience </strong>sur la création de mon premier bloc Gutenberg natif.</p>\n\n\n\n<h2>Un parcours en forte pente</h2>\n\n\n\n<p>Tout est difficile quand on entame quelque chose de nouveau !</p>\n\n\n\n<p>Pour commencer du bon pied, j’ai <strong>utilisé le paquet </strong><a href=\"https://www.npmjs.com/package/@wordpress/create-block\"><strong>create-block</strong></a><strong> </strong>de WordPress pour initialiser le projet, sous forme d’extension WordPress. J’ai ensuite<strong> ajouté nos </strong><strong><em>coding standards</em></strong><strong> </strong>habituels pour les langages JavaScript, CSS et PHP, puis je suis passé <strong>en mode </strong><strong><em>multi-blocks</em></strong> (une extension permettant d’enregistrer plusieurs blocs à fois).</p>\n\n\n\n<p>Personnellement, j’avais déjà commencé à prendre mes marques avec React en développant un site sous Gatsby.js. Avec Gutenberg l&rsquo;expérience est similaire, comparable au développement à l’aide d’un Framework JavaScript : <strong>il faut s’adapter à ses règles et sa façon de fonctionner</strong>.&nbsp;</p>\n\n\n\n<p>Pour bien démarrer, la documentation (qui, à date, n&rsquo;est pas encore optimale) reste la première pièce du puzzle, bien qu’il n’y est pas encore beaucoup d&rsquo;exemples. Pour compenser ce manque, vu que tout est en <em>open-source</em>, il est plus facile de trouver et d’aller jeter un œil à l’utilisation que d’autres développeurs ont pu en faire (et de constater, ou non, s’ils sont également tombés dans les mêmes pièges que moi).</p>\n\n\n\n<h3>L’origine du mal</h3>\n\n\n\n<p>Le premier bloc que l’équipe projet a décidé de développer a été <strong>le bloc “Tabs”</strong>. Très demandé/utilisé dans nos projets, il s&rsquo;agit d&rsquo;un bloc composé <strong>d’une barre d&rsquo;onglets (</strong><strong><em>tabs list</em></strong><strong>) </strong>et <strong>de panneaux de contenus (</strong><strong><em>panels</em></strong><strong>)</strong> avec un petit bonus permettant à l&rsquo;utilisateur de choisir une icone pour chaque onglet.&nbsp;</p>\n\n\n\n<p>Comme nous avions déjà développé un bloc “Icons” qui permet de charger des collections d&rsquo;icônes, j’ai préféré exploiter <strong>le système d’</strong><strong><em>innerBlocks</em></strong><strong> natif (blocs imbriqués) </strong>pour bien respecter le concept de modularité et d’indépendance des fonctionnalités, plutôt que de transformer ce bloc en composant.</p>\n\n\n\n<h3>Le Bloc “Tabs”</h3>\n\n\n<div class=\"wp-block-image\">\n<figure class=\"aligncenter size-large\"><img width=\"1024\" height=\"490\" src=\"https://beapi.fr/wp-content/uploads/2022/12/beapi-tabs-block-1024x490.png\" alt=\"Capture d\'écran de l\'interface utilisateur du block tabs\" class=\"wp-image-1780\" //><figcaption>UI du Be API Tabs Block</figcaption></figure></div>\n\n\n<p>Après quelques jours passés à essayer de concevoir ce bloc à partir d’un seul bloc enfant, j’ai fini par réaliser <strong>qu&rsquo;il n’en fallait pas moins de 4 </strong>pour faire le bloc de la manière la plus logique et cohérente !</p>\n\n\n\n<p>Pour être plus précis, dans ce bloc “Tabs”, nous retrouvons les deux premiers blocs de niveau 1, un qui contient <strong>tous les onglets (</strong><strong><em>tabs list</em></strong><strong>) </strong>et un autre qui contient <strong>tous les panneaux (</strong><strong><em>panels</em></strong><strong>)</strong>. Les enfants (niveau 2) de ces derniers sont synchronisés, ce qui veut dire que si je déplace le premier onglet (<em>tab item</em>) en deuxième position, le contenu<em> </em>(<em>panel item</em>) correspondant suivra et se positionnera <strong>dans le même ordre dans la liste des </strong><strong><em>panels</em></strong>.</p>\n\n\n\n<p>Dans cette phase, le plus difficile a été de comprendre comment faire parler les blocs entre eux. Dans Gutenberg, de base, chaque bloc vit sa vie, mais il existe plusieurs solutions pour permettre à ces blocs d’interagir. Bien sûr, il a fallu essayer chacune de ces méthodes pour déterminer celle qui serait la plus performante. J’ai donc utilisé <strong>les contextes</strong> (l&rsquo;équivalent de Redux pour Gutenberg) et <strong>les </strong><strong><em>Select</em></strong><strong> et </strong><strong><em>Dispatch</em></strong> pour récupérer la donnée dans le registre des blocks. Une autre piste était de créer un <em>Store</em> dédié, mais c’était clairement une solution surdimensionnée, donc vite abandonnée.</p>\n\n\n\n<p>Petite contrainte (et astuce) : pendant toute la phase de développement, on casse souvent le block (autant de fois qu’on change la logique de développement) et une recontribution régulière est nécessaire pour le faire (re)fonctionner. Passage obligé, le message “Ce bloc a rencontré une erreur et ne peut pas être prévisualisé.” devient ton meilleur ami. Le message n’étant pas très explicite, il n’est pas évident de comprendre d&rsquo;où vient l’erreur. Je conseille donc de <strong>développer petit à petit et de tester en continu </strong>pour éviter une frustration trop grande liée à des changements trop importants !</p>\n\n\n\n<p>Si dans la majorité des cas, l&rsquo;erreur vient d’un changement de markup, cette <em>feature</em> (non non, ce n’est pas un <em>bug</em>) met avant tout en évidence la fragilité des blocs. Il faut donc garder à l’esprit que si vous faites évoluer votre bloc dans le futur, <strong>il faudra prendre en compte sa rétrocompatibilité</strong>.</p>\n\n\n\n<p>Nous avons commencé par établir (pour ce bloc, mais pour les suivants également) <strong>des règles générales de nommage</strong> pour préfixer nos blocs, nos classes et variables CSS et le <em>namespace</em> de nos plugins.</p>\n\n\n\n<p>Pour rendre l’ensemble plus flexible et <em>developer-friendly,</em> nous avons rendu possible le fait de paramétrer <strong>quels types de bloc nous pouvons ajouter </strong>à l’intérieur des onglets (<em>tabs</em>) et de&nbsp; la zone de contenu (<em>panels</em>), avec une<strong> liste de blocs autorisés</strong> (<em>allowed blocks</em>).&nbsp;</p>\n\n\n\n<p>Globalement, il faut réfléchir à comment rendre chaque bloc assez<strong> souple et ouvert</strong> pour qu&rsquo;il puisse interagir avec les autres extensions/blocs de l’écosystème.</p>\n\n\n\n<p>En parallèle, il faut également faire en sorte de <strong>brider l’interface </strong>efficacement<strong>,</strong> pour offrir aux contributeurs les moins expérimentés seulement les options qui leur seront utiles, ou bien tout simplement pour adapter l’édition du bloc à une direction artistique bien cadrée.&nbsp;</p>\n\n\n\n<p>Pour le bloc “Tabs”, j’ai désactivé l’édition de certains éléments (<em>locking</em>) pour <strong>éviter des erreurs de contribution</strong> et j’ai également rendu possible le fait de limiter et personnaliser la liste des alignements possibles.</p>\n\n\n\n<p>En modifiant la configuration du <em>blockSupport,</em> il est également possible <strong>d’activer ou de désactiver l&rsquo;affichage des options natives</strong> comme le sélecteur de couleurs ou la gestion des marges.</p>\n\n\n\n<p>Une dernière source de réflexion concerne le CSS. En préparation de l’arrivée massive du FSE (Full Site Editing, plutôt Site editor (<em>renaming</em> récent)), il faut identifier <strong>quels sont les paramètres de styles</strong> qui permettent d’éditer l’aspect visuel du bloc, et ensuite créer <strong>les variables CSS associées</strong>.</p>\n\n\n\n<h2>Les trois règles</h2>\n\n\n\n<p>Dans le théâtre classique de 1500 inspiré par Aristote, la pièce parfaite devait être conçue en suivant les trois règles suivantes :<strong>&nbsp;</strong></p>\n\n\n\n<ul><li><strong>l&rsquo;unité de temps</strong> : tout se doit passer à l&rsquo;intérieur d&rsquo;une journée ;</li><li><strong>l&rsquo;unité de lieu</strong> : tout se doit dérouler dans les mêmes lieux/espaces ;</li><li><strong>l&rsquo;unité d&rsquo;action</strong> : tous les événements principaux nécessaires à l&rsquo;histoire doivent commencer et terminer à l&rsquo;intérieur de la pièce.&nbsp;</li></ul>\n\n\n\n<p>J&rsquo;ai trouvé assez amusant de pouvoir appliquer ces « unités aristotéliques” dans le développement des blocs Gutenberg.</p>\n\n\n\n<h3>Unité de temps.</h3>\n\n\n\n<p>La vie d’un bloc s’étire d’une phase d&rsquo;édition (<em>edit</em>) à une phase de sauvegarde (<em>save</em>), et <strong>ces deux phases sont intimement interconnectées</strong>. Il est fondamental de rendre l’interface d&rsquo;édition fidèle au rendu front-office. C&rsquo;est particulièrement vrai quand on développe un bloc qui n&rsquo;a pas un rendu dynamique. <strong>Le markup de sa partie </strong><strong><em>save</em></strong><strong> impose aussi la structure de sa partie </strong><strong><em>edit</em></strong><em>.</em></p>\n\n\n\n<h3>Unité de lieu</h3>\n\n\n\n<p>Ce concept est important pour la modularité : quand toutes les fonctionnalités ne peuvent pas être portées par un bloc seul, nous sommes contraints de <strong>décomposer ce dernier dans une structure parent &gt; enfants</strong>. Cette règle est imposée par le fait que dans un bloc Gutenberg, nous avons le droit d’utiliser un seul <em>innerBlock</em>. Par exemple, le bloc natif “Buttons” (un wrapper <em>innerBlock</em>) est parent du bloc natif “Button”.</p>\n\n\n\n<h3>Unité d&rsquo;action</h3>\n\n\n\n<p>Toutes les manipulations modifient les attributs du bloc simultanément. On doit donc essayer de <strong>privilégier un certain ordre d&rsquo;interaction </strong>pour permettre une contribution la plus logique et naturelle possible :</p>\n\n\n\n<ol><li>dans le contenu de la page (<em>editor</em>)</li><li>dans la barre d’outils (<em>toolbar</em>) ou on accède à ces réglages principaux&nbsp;</li><li>dans la barre latérale (<em>sidebar</em>) ou on trouve ses options plus avancées.&nbsp;</li></ol>\n\n\n\n<h2>Conclusion</h2>\n\n\n\n<p>Même si au début, la mise en place a été un peu compliquée, j’ai pris énormément de plaisir à créer ce bloc.</p>\n\n\n\n<p>En étudiant de plus près les blocs natifs (<em>core blocks</em>) de WordPress, j’ai pris conscience du soin et de l’importante réflexion derrière chaque bloc, ainsi que la quantité et la qualité de travail qu’il y a derrière le projet Gutenberg.&nbsp;</p>\n\n\n\n<p>Pour tout ce que j&rsquo;ai appris/découvert, chapeau bas et merci à la communauté !</p>\n<p>The post <a rel=\"nofollow\" href=\"https://beapi.fr/blog/debuter-dans-le-developpement-de-blocs-gutenberg-en-react-un-retour-dexperience/\">Débuter dans le développement de blocs Gutenberg en React : un retour d&rsquo;expérience  </a> appeared first on <a rel=\"nofollow\" href=\"https://beapi.fr\">Be API, agence WordPress</a>.</p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Paolo Tesei\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:6:\"source\";a:1:{i:0;a:6:{s:4:\"data\";s:67:\"\n                    \n                            \n                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:2:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://beapi.fr/blog/categories/wordpress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"BeAPI\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}i:9;a:6:{s:4:\"data\";s:70:\"\n    \n    \n    \n    \n    \n    \n    \n            \n                \n    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:9:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://www.whodunit.fr/eco-conception-web-comment-valider-et-valoriser-sa-demarche/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"Eco-conception web : comment valider et valoriser sa démarche ?\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:4:\"href\";s:84:\"https://www.whodunit.fr/eco-conception-web-comment-valider-et-valoriser-sa-demarche/\";s:3:\"rel\";s:9:\"alternate\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2022-11-22T11:01:53.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2022-11-22T11:01:53.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"summary\";a:1:{i:0;a:5:{s:4:\"data\";s:900:\"Que signifie avoir une démarche d’éco-conception ? Comment la mettre en pratique puis la mettre en avant ? Ce live vous en dit plus sur les bonnes pratiques d’éco-conception, les guides et référentiels existants, les solutions… Tout cela à travers le retour d’expérience de Whodunit et Temesis, agence spécialisée en conseil, formation et audit sur l’accessibilité, l’éco conception et la conformité RGPD. 👥 Avec les intervenants suivants :Julien Wilhelm, Analyste en performance web environnementale chez TemesisChristophe CLOUZEAU, Expert écoconception numérique chez TemesisNandor Wiener, Directeur Général WhodunitEddy Boels, Customer Happiness Manager Whodunit Les concepts de sobriété numérique Le numérique responsable, celui…\nL’article Eco-conception web : comment valider et valoriser sa démarche ? est apparu en premier sur Agence WordPress Whodunit.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:11825:\"\n        \n<p>Que signifie avoir une démarche d’éco-conception ? Comment la mettre en pratique puis la mettre en avant ?</p>\n\n\n\n<p>Ce live vous en dit plus sur les bonnes pratiques d’éco-conception, les guides et référentiels existants, les solutions… Tout cela à travers le retour d’expérience de Whodunit et <a href=\"https://www.temesis.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Temesis</a>, agence spécialisée en conseil, formation et audit sur l&#8217;accessibilité, l&#8217;éco conception et la conformité RGPD.</p>\n\n\n\n<p>👥 Avec les intervenants suivants :<br><span style=\"color: var(--paletteColor1, #ff3475)\" class=\"stk-highlight\">Julien Wilhelm, Analyste en performance web environnementale chez Temesis<br>Christophe CLOUZEAU, Expert écoconception numérique chez Temesis<br>Nandor Wiener, Directeur Général Whodunit<br>Eddy Boels, Customer Happiness Manager Whodunit</span></p>\n\n\n\n<figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\n\n</div></figure>\n\n\n\n<h2 id=\"h-les-concepts-de-sobriete-numerique\" data-block-type=\"core\">Les concepts de sobriété numérique</h2>\n\n\n\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><img loading=\"lazy\" width=\"1080\" height=\"431\" src=\"https://www.whodunit.fr/wp-content/uploads/2022/11/greenit-1080x431.jpg\" alt=\"\" class=\"wp-image-75164\" //></figure>\n\n\n\n<p>Le numérique responsable, celui qui respecte le plus la planète, englobe à la fois des enjeux environnementaux mais aussi des enjeux économiques et sociaux.</p>\n\n\n\n<p>Lorsqu’il s’agit d’un site web, on va parler de sobriété numérique. Cette démarche comprend plusieurs engrenages qui s’influencent les uns les autres :</p>\n\n\n\n<p>L’éco conception, l’accessibilité, la sécurité, l’éthique, le respect des données personnelles (<a href=\"https://www.cnil.fr/fr/reglement-europeen-protection-donnees\" target=\"_blank\" rel=\"noreferrer noopener\">RGPD</a>) et la performance.</p>\n\n\n\n<h3 id=\"h-la-demarche\" data-block-type=\"core\">La démarche</h3>\n\n\n\n<p>On parle de “démarche” d’éco conception car elle ne s’applique pas comme on appliquerait un patch en milieu ou en fin de projet. Les questions d’éco conception vont se poser dès le début, avant même la première ligne de code : l’utilité du projet, à qui il s’adresse, à quels besoins on souhaite répondre, comment on y répond… ?</p>\n\n\n\n<p>Attention, il ne s’agit pas d’interdire mais d’utiliser des moyens adaptés et proportionnés, le design n’en sera pas moins efficace mais plus épuré.</p>\n\n\n\n<p>La conception de services numériques responsables tient compte à la fois des enjeux environnementaux mais aussi des utilisateurs : On ne peut pas penser à l’environnement sans se soucier des utilisateurs car nombre d’entre eux sont exclus du numérique soit par manque d’accès à des équipements, par manque d’accès aux réseaux, ou pour des raisons de facultés psychique ou physiques.</p>\n\n\n\n<p><strong>La démarche d’éco conception a donc deux visées, celle de réduire les impacts environnementaux mais également celle de limiter la fracture numérique.</strong></p>\n\n\n\n<p><strong>Cette démarche est sans fin, elle s’inscrit dans une logique d’amélioration continue.</strong></p>\n\n\n\n<h3 id=\"h-quid-des-guides-et-referentiels-pour-bien-demarrer\" data-block-type=\"core\">Quid des guides et référentiels pour bien démarrer ?</h3>\n\n\n\n<p>Il existe de nombreux guides et référentiels.</p>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">Le plus connu est <a href=\"https://collectif.greenit.fr/ecoconception-web/115-bonnes-pratiques-eco-conception_web.html\" target=\"_blank\" rel=\"noreferrer noopener\">les 115 bonnes pratiques d’éco conception web fournies par Green IT</a> avec une approche plus développement.</li>\n\n\n\n<li data-block-type=\"core\"><a href=\"https://eco-conception.designersethiques.org/guide/fr/\" target=\"_blank\" rel=\"noreferrer noopener\">Le guide des designers éthiques</a></li>\n\n\n\n<li data-block-type=\"core\">L’<a href=\"https://normalisation.afnor.org/actualites/guide-reference-pour-ecoconcevoir-services-numeriques/\" target=\"_blank\" rel=\"noreferrer noopener\">Afnor spec 2202</a> (organisation et stratégie)</li>\n\n\n\n<li data-block-type=\"core\">Le <a href=\"https://ecoresponsable.numerique.gouv.fr/publications/referentiel-general-ecoconception/\" target=\"_blank\" rel=\"noreferrer noopener\">RGESN</a> (Référentiel général d&#8217;éco conception de services numériques) est le plus récent et focalisé sur l’ensemble de la démarche. ****</li>\n</ul>\n\n\n\n<p>👉&nbsp; Le RGESN pour valider la démarche d’éco conception</p>\n\n\n\n<p>Même s’il est encore en version bêta, on peut s’appuyer dès maintenant sur le RGESN pour la création ou la refonte d’un site.</p>\n\n\n\n<p>Il intervient sur toute la chaîne : il sert de formation en amont, on le voit en accompagnement, pendant la production du service lui-même et et on s’en sert à la fin comme audit pour faire un état des lieux. L’audit en question permet d’obtenir un % de conformité sur lequel il est tout à fait possible de communiquer.</p>\n\n\n\n<div class=\"is-layout-flex wp-container-2 wp-block-columns has-background\" style=\"background-color:#dfeef7\" data-block-type=\"core\">\n<div class=\"is-layout-flow wp-block-column\" data-block-type=\"core\">\n<p>💡 Dans toutes les approches d’éco conception, on trouve énormément de choses dans la partie réflexion, mise en ligne, Frontend. En revanche, pour tout ce qui se joue en Backend, les infrastructures, les architectures, on sent que c’est plus balbutiant.</p>\n\n\n\n<p>→ C’est pourquoi une telle démarche nécessite de l’expertise et un accompagnement spécifique.</p>\n</div>\n</div>\n\n\n\n<h2 id=\"h-le-marche-de-l-eco-conception\" data-block-type=\"core\">Le marché de l’éco conception</h2>\n\n\n\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><img loading=\"lazy\" width=\"1080\" height=\"422\" src=\"https://www.whodunit.fr/wp-content/uploads/2022/11/eco-conception-web-cover-1080x422.jpg\" alt=\"\" class=\"wp-image-75165\" //></figure>\n\n\n\n<h3 id=\"h-un-marche-en-plein-essor\" data-block-type=\"core\">Un marché en plein essor</h3>\n\n\n\n<p>On observe une demande quasi systématique aujourd’hui dans les cahiers des charges des projets qui nous sont soumis alors qu’elle était pratiquement inexistante l’année dernière.</p>\n\n\n\n<p>Whodunit a démarré il y a un an avec l’<a href=\"https://www.ademe.fr/\" target=\"_blank\" rel=\"noreferrer noopener\">ADEME</a>, premier client dont l’appel d’offre portait sur des critères d’éco conception.</p>\n\n\n\n<p>Puis une question de la part des clients commençait à revenir souvent : “Comment baisser l’empreinte carbone de notre site ?” On parlait de site existants pas de refonte.</p>\n\n\n\n<p>Depuis juin, sur une dizaine de projets, les 3/4 ont mentionné le numérique responsable&#8230; C’est un véritable boom !</p>\n\n\n\n<p>Malheureusement, les sites représentatifs du paysage numérique français sont mauvais d’après <a href=\"https://www.lesechos.fr/tech-medias/hightech/les-sites-web-generent-autant-de-co2-que-plus-de-1000-tours-du-monde-1848742#utm_source=le%3Alec0f&amp;utm_medium=click&amp;utm_campaign=share-links_twitter\" target=\"_blank\" rel=\"noreferrer noopener\">le premier baromètre</a> de l&#8217;éco conception numérique édité par <a href=\"https://www.razorfish.fr/\" target=\"_blank\" rel=\"noreferrer noopener\">Razorfish</a> et le <a href=\"https://collectif.greenit.fr/\" target=\"_blank\" rel=\"noreferrer noopener\">collectif GreenIT</a>.</p>\n\n\n\n<p>Mais si l’on regarde le marché plus en détails, on voit une présence systématique de la démarche d’éco conception dans les groupes publics et internationaux, et parfois même dans les agences de communication.</p>\n\n\n\n<h3 id=\"h-pourquoi-cet-engouement-pour-l-eco-conception\" data-block-type=\"core\">Pourquoi cet engouement pour l’éco conception ?</h3>\n\n\n\n<p>Il s’agit d’un contexte général avec les tendances écologiques que l’on connaît.</p>\n\n\n\n<p>Mais c’est aussi une stratégie de communication, un enjeu business et même un enjeu de recrutement. Si ce sont ces raisons qui permettent de passer à l’action, tant mieux.</p>\n\n\n\n<p>L&#8217;anticipation d’une future législation européenne au même titre que le RGPD est aussi envisageable, au même titre qu’un éco-score : Google intègre déjà dans son algorithme à travers ses critères sur l&#8217;expérience utilisateurs.</p>\n\n\n\n<h3 id=\"h-comment-valoriser-la-demarche\" data-block-type=\"core\">Comment valoriser la démarche ?</h3>\n\n\n\n<h4 id=\"h-les-referentiels\" data-block-type=\"core\">Les Référentiels</h4>\n\n\n\n<p>On a la possibilité d’obtenir une déclaration de conformité grâce au RGESN même si aujourd’hui celle-ci n’est pas obligatoire. C’est le principal référentiel sur l’éco conception web.</p>\n\n\n\n<h4 id=\"h-les-solutions-saas\" data-block-type=\"core\">Les solutions Saas</h4>\n\n\n\n<p>Il existe aussi des solutions Saas qui émergent <a href=\"https://www.fruggr.io/fr/\" target=\"_blank\" rel=\"noreferrer noopener\">Fruggr</a>, <a href=\"https://greenoco.io/\" target=\"_blank\" rel=\"noreferrer noopener\">greenoco</a>, <a href=\"https://www.greenly.earth/\" target=\"_blank\" rel=\"noreferrer noopener\">greenlee</a>, <a href=\"https://improved-impact.com/\" target=\"_blank\" rel=\"noreferrer noopener\">improvedimpact</a> qui permettent de montrer les axes d’amélioration et d’obtenir des certificats. Ce sont surtout des outils de mesure (empreinte carbone, accessibilité…)</p>\n\n\n\n<p>Ces solutions ont le mérite de vulgariser la démarche mais ont leurs limites, elles sont difficiles à automatiser. En effet, elles ne remplaceront jamais l’interprétation humaine car les moyens sont très différents en fonction des sites. (ex : page Netflix VS page Google)</p>\n\n\n\n<div class=\"is-layout-flex wp-container-4 wp-block-columns has-background\" style=\"background-color:#dfeef7\" data-block-type=\"core\">\n<div class=\"is-layout-flow wp-block-column\" data-block-type=\"core\">\n<p>💡 De manière générale, on conseillera toujours de communiquer sur ce qui a été mis en place, les solutions d’amélioration et les itérations.</p>\n</div>\n</div>\n\n\n\n<h2 data-block-type=\"core\">Conclusion</h2>\n\n\n\n<p>Dans un premier temps, le plus important c’est d’avoir une démarche d’éco conception éditoriale et technique, peu importe le score ou le résultat obtenu.</p>\n\n\n\n<p>Ce qui est certain c’est que le numérique responsable n’a pas fini de faire parler de lui… Et c’est tant mieux !</p>\n\n\n\n<div class=\"is-layout-flex wp-container-8 wp-block-columns has-background\" style=\"background-color:#dfeef7\" data-block-type=\"core\">\n<div class=\"is-layout-flow wp-block-column\" data-block-type=\"core\">\n<p>👀 <strong>Ce qu’il faut retenir</strong> :</p>\n\n\n\n<div class=\"is-vertical is-content-justification-left is-layout-flex wp-container-6 wp-block-group\" data-block-type=\"core\">\n<div class=\"is-layout-constrained wp-block-group\" data-block-type=\"core\">\n<p>L’éco conception est une démarche </p>\n\n\n\n<p>⤷ ça démarre avant le projet en se posant la question de la nécessité d’un contenu ou d’une fonctionnalité, c’est avant tout du bon sens</p>\n\n\n\n<p>⤷ c&#8217;est une démarche d’amélioration continue au même titre que le travail sur l&#8217;UX</p>\n</div>\n</div>\n</div>\n</div>\n\n\n\n<p></p>\n<p>L’article <a rel=\"nofollow\" href=\"https://www.whodunit.fr/eco-conception-web-comment-valider-et-valoriser-sa-demarche/\">Eco-conception web : comment valider et valoriser sa démarche ?</a> est apparu en premier sur <a rel=\"nofollow\" href=\"https://www.whodunit.fr\">Agence WordPress Whodunit</a>.</p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Gaelle\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:6:\"source\";a:1:{i:0;a:6:{s:4:\"data\";s:67:\"\n                    \n                            \n                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:2:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"https://www.whodunit.fr/videos/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Whodunit Videos\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:512;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:11:{s:6:\"server\";s:12:\"nginx/1.21.4\";s:4:\"date\";s:29:\"Sat, 11 Feb 2023 08:20:55 GMT\";s:12:\"content-type\";s:20:\"application/atom+xml\";s:12:\"x-powered-by\";s:10:\"PHP/8.0.13\";s:13:\"last-modified\";s:29:\"Wed, 15 Dec 2021 21:33:54 GMT\";s:4:\"etag\";s:34:\"\"2ffe8d75591b5b1ed5ca7f66d3c037d3\"\";s:4:\"link\";s:57:\"<https://rss.wpfr.net/wp-json/>; rel=\"https://api.w.org/\"\";s:13:\"cache-control\";s:35:\"no-cache, no-store, must-revalidate\";s:6:\"pragma\";s:8:\"no-cache\";s:7:\"expires\";s:1:\"0\";s:25:\"strict-transport-security\";s:16:\"max-age=63072000\";}}s:5:\"build\";s:14:\"20211220193300\";}', 'no');
