(706, 'wpforms_notifications', 'a:4:{s:6:\"update\";i:1676105143;s:4:\"feed\";a:0:{}s:6:\"events\";a:6:{s:22:\"wp-mail-smtp-education\";a:5:{s:2:\"id\";s:22:\"wp-mail-smtp-education\";s:5:\"title\";s:59:\"Ne manquez pas vos e-mails de notification de formulaire !\";s:7:\"content\";s:363:\"Saviez-vous que de nombreux sites WordPress ne sont pas correctement configurés pour envoyer des e-mails ? Avec l’extension gratuite WP Mail SMTP, vous pouvez facilement optimiser votre site pour envoyer des e-mails, éviter le dossier des indésirables et vous assurer que vos e-mails atterrissent dans la boîte de réception du destinataire à chaque fois.\";s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:58:\"http://localhost:8000/wp-admin/admin.php?page=wpforms-smtp\";s:4:\"text\";s:20:\"Installer maintenant\";}s:3:\"alt\";a:2:{s:3:\"url\";s:195:\"https://wpforms.com/docs/how-to-set-up-smtp-using-the-wp-mail-smtp-plugin/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=WP%20Mail%20SMTP%20Learn%20More\";s:4:\"text\";s:14:\"En savoir plus\";}}s:5:\"start\";s:19:\"2023-02-07 10:42:27\";}s:15:\"join-vip-circle\";a:5:{s:2:\"id\";s:15:\"join-vip-circle\";s:5:\"title\";s:56:\"Vous voulez être un VIP ? Rejoignez-nous maintenant !\";s:7:\"content\";s:428:\"Gérer un site WordPress peut être difficile. Mais l’aide est juste au coin ! Notre groupe Facebook contient des tonnes de conseils et d’aide pour faire croître votre entreprise ! Lorsque vous rejoignez notre cercle VIP, vous obtenez un accès instantané aux conseils, astuces et réponses d’une communauté d’utilisateurs et d‘utilisatrices fidèles de WPForms. Mieux encore, l’adhésion est 100 % gratuite !\";s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:43:\"https://www.facebook.com/groups/wpformsvip/\";s:4:\"text\";s:20:\"Rejoindre maintenant\";}}s:5:\"start\";s:19:\"2023-03-06 10:42:27\";}s:14:\"survey-reports\";a:5:{s:2:\"id\";s:14:\"survey-reports\";s:5:\"title\";s:69:\"Vous voulez savoir ce que pensent vraiment vos clients et clientes ?\";s:7:\"content\";s:438:\"Rien ne vaut les vrais commentaires de vos clients, clientes et internautes. C’est pourquoi de nombreuses petites entreprises adorent notre formidable module Surveys and Pools. Débloquez instantanément des rapports d’enquête complets directement dans votre tableau de bord WordPress. Et n’oubliez pas : la création d’un sondage est facile grâce à nos modèles prédéfinis, vous pouvez donc commencer en quelques minutes !\";s:4:\"btns\";a:2:{s:4:\"main\";a:1:{s:7:\"license\";a:5:{s:4:\"lite\";a:2:{s:3:\"url\";s:161:\"https://wpforms.com/lite-upgrade/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Lite\";s:4:\"text\";s:16:\"Mettre à niveau\";}s:5:\"basic\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Mettre à niveau\";}s:4:\"plus\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Mettre à niveau\";}s:3:\"pro\";a:2:{s:3:\"url\";s:60:\"http://localhost:8000/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:20:\"Installer maintenant\";}s:5:\"elite\";a:2:{s:3:\"url\";s:60:\"http://localhost:8000/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:20:\"Installer maintenant\";}}}s:3:\"alt\";a:2:{s:3:\"url\";s:202:\"https://wpforms.com/docs/how-to-install-and-use-the-surveys-and-polls-addon/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Learn%20More\";s:4:\"text\";s:14:\"En savoir plus\";}}s:5:\"start\";s:19:\"2023-03-21 10:42:27\";}s:16:\"form-abandonment\";a:5:{s:2:\"id\";s:16:\"form-abandonment\";s:5:\"title\";s:57:\"Obtenez plus de prospects à partir de vos formulaires !\";s:7:\"content\";s:484:\"Vos formulaires convertissent-ils moins d‘internautes que vous ne l’espériez ? Souvent, les visiteurs quittent les formulaires en cours de route. Cela peut vous empêcher d’obtenir tous les prospects que vous méritez de capturer. Avec notre module d’abandon de formulaire, vous pouvez capturer des entrées partielles même si votre visiteur n’a pas cliqué sur Envoyer ! À partir de là, il est facile de suivre les prospects et de les transformer en clients fidèles.\";s:4:\"btns\";a:2:{s:4:\"main\";a:1:{s:7:\"license\";a:5:{s:4:\"lite\";a:2:{s:3:\"url\";s:158:\"https://wpforms.com/lite-upgrade/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Lite\";s:4:\"text\";s:16:\"Mettre à niveau\";}s:5:\"basic\";a:2:{s:3:\"url\";s:163:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Mettre à niveau\";}s:4:\"plus\";a:2:{s:3:\"url\";s:163:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Mettre à niveau\";}s:3:\"pro\";a:2:{s:3:\"url\";s:60:\"http://localhost:8000/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:20:\"Installer maintenant\";}s:5:\"elite\";a:2:{s:3:\"url\";s:60:\"http://localhost:8000/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:20:\"Installer maintenant\";}}}s:3:\"alt\";a:2:{s:3:\"url\";s:201:\"https://wpforms.com/docs/how-to-install-and-use-form-abandonment-with-wpforms/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Learn%20More\";s:4:\"text\";s:14:\"En savoir plus\";}}s:5:\"start\";s:19:\"2023-04-05 10:42:27\";}s:21:\"translation-community\";a:5:{s:2:\"id\";s:21:\"translation-community\";s:5:\"title\";s:53:\"WPForms a besoin de vos compétences en traduction !\";s:7:\"content\";s:336:\"Saviez-vous que WPForms a sa propre communauté de traduction ? Nous sommes à la recherche de traducteurs qualifiés pour aider à rendre WPForms vraiment accessible à nos millions d’utilisateurs et d‘utilisatrices à travers le monde. Vous pouvez gagner du swag WPForms et une licence Pro gratuite. Vous voulez vous impliquer ?\";s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:30:\"https://wpforms.com/translate/\";s:4:\"text\";s:20:\"Rejoindre maintenant\";}}s:5:\"start\";s:19:\"2023-05-05 10:42:27\";}s:5:\"ideas\";a:5:{s:2:\"id\";s:5:\"ideas\";s:5:\"title\";s:54:\"Quelle est la fonctionnalité WPForms de vos rêves ?\";s:7:\"content\";s:387:\"Si vous pouviez ajouter une seule fonctionnalité à WPForms, quelle serait-elle ? Nous voulons savoir ! Notre équipe est occupée à sonder de précieux clients comme vous alors que nous planifions l’année à venir. Nous aimerions savoir quelles fonctionnalités feraient passer votre entreprise au niveau supérieur ! Avez-vous une seconde pour partager votre idée avec nous ?\";s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:36:\"https://wpforms.com/share-your-idea/\";s:4:\"text\";s:20:\"Partagez votre idée\";}}s:5:\"start\";s:19:\"2023-06-04 10:42:27\";}}s:9:\"dismissed\";a:0:{}}', 'yes'),
